.000000',4,333,8,NULL,'2025-09-28 20:15:12.000000','2025-09-28 20:13:13.833853','0.0001','6ea90edd-378c-4e8a-804d-f2599df437d7','콜렉션 정리 때문에 출품합니다','저의 판매 페이지를 찾아주셔서 감사합니다. 저는 모든 카드를 \'내가 받을 물건\'이라는 생각으로 정성껏 포장합니다. \n    기본적으로 카드 보호 필름 + 탑로더 + 안전 봉투 + 에어캡(뽁뽁이) + 박스 순으로 5중 포장을 원칙으로 하며, 배송 중 카드가 절대 흔들리거나 구겨지지 않도록 내부 공간도 완충재로 채워 보냅니다. \n    배송은 보통 오후 4시 이전 결제 건에 한해 당일 출고되며, 출고 후 바로 운송장 번호를 보내드려 이동 현황을 확인하실 수 있도록 돕고 있습니다. \n    안심하고 구매하세요.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '',0.04443000,0.03943000,7,_binary '',_binary '\0',0.03943000,_binary '\0',367,1,33,'2025-09-28 20:13:14.938186',NULL,'2025-10-05 20:37:13.000000',2,334,6,NULL,'2025-09-28 20:14:13.000000','2025-09-28 20:13:14.938186','0.001','af27753a-0833-47f3-84a2-4935af9a9f91','낙찰되면 배송 빠르게 해드려요','\n    전체적으로는 깨끗한 편이지만, 사진 4번과 5번에서 확인하실 수 있듯이 뒷면 오른쪽 상단 모서리에 미세한 찍힘이 있습니다. \n    또한 빛에 비춰 자세히 보면 앞면 홀로그램 부분에 피해갈 수 없는 잔기스가 약간 존재합니다. \n    플레이용으로는 전혀 문제없으며, 소장용으로도 크게 거슬리는 수준은 아니라고 생각합니다. 이런 부분에 예민하지 않으신 분께서 저렴하게 구매해가시면 좋을 것 같습니다. \n    상태 관련해서 추가로 궁금한 점은 편하게 문의 주세요.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',19.01010000,0.01010000,3,_binary '',_binary '\0',0.01010000,_binary '\0',1301,2,29,'2025-09-28 20:13:23.221474',NULL,'2025-10-01 20:34:22.000000',1,335,8,NULL,'2025-09-28 20:14:22.000000','2025-09-28 20:13:23.221474','1','a20dfadd-0e65-4330-a991-4d22b9b6dfa3','이거 희귀한 카드인데 아시는 분만','\n    처음 카드를 구매하시는 분들도 환영합니다. 이 카드는 OOO 시리즈에서 매우 인기 있는 카드로, 하나쯤 소장해두시면 만족감이 높으실 겁니다. \n    사진은 최대한 여러 각도에서 상세하게 촬영했으니 천천히 살펴보시고, 혹시 궁금한 점이 있다면 아무리 사소한 것이라도 괜찮으니 편하게 질문 남겨주세요. \n    거래가 처음부터 끝까지 기분 좋게 마무리될 수 있도록 친절하게 안내해 드리겠습니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.03318000,0.02768000,3,_binary '',_binary '\0',0.02768000,_binary '\0',367,1,33,'2025-09-28 20:13:23.508626',NULL,'2025-10-01 20:30:22.000000',6,336,6,NULL,'2025-09-28 20:18:22.000000','2025-09-28 20:13:23.508626','0.0005','5c457518-aa40-41c2-8ffd-b7782f72983c','환불/교환 X, 쿨거하실 분들만 입찰해주세요.','\n    개인적으로 소장해오던 카드입니다. \n    사진에서 보시다시피 카드 앞면과 뒷면 모두 눈에 띄는 큰 상처나 찍힘 없이 매우 깨끗한 상태를 유지하고 있습니다. \n    빛에 비춰봐도 실기스 거의 찾아보기 힘들 정도이며, 네 모서리 모두 날카롭게 살아있습니다. \n    습도와 온도 관리가 되는 전용 보관함에서 슬리브와 탑로더에 넣어 이중으로 보관해왔기 때문에 변색이나 휘어짐 현상도 전혀 없습니다. \n    최상의 상태를 원하시는 컬렉터분께 강력히 추천합니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '',0.85187000,0.00187000,3,_binary '',_binary '\0',0.00187000,_binary '\0',1301,2,29,'2025-09-28 20:13:30.163332',NULL,'2025-10-01 20:27:28.000000',1,337,8,NULL,'2025-09-28 20:18:28.000000','2025-09-28 20:13:30.163332','0.05','e9283902-fdf3-4cdf-995f-3aece1953f70','콜렉션 정리 때문에 출품합니다','\"카드 수집 경력 15년차 컬렉터입니다. 이번에 상위 등급의 다른 카드를 구매하기 위해 자금 마련차 아끼던 카드를 출품합니다. \n    보시는 카드는 발매 당시 직접 박스를 개봉하여 뽑은 후, 바로 UV 차단 슬리브와 탑로더에 봉인하여 제습 기능이 있는 암실 캐비닛에 보관해왔습니다. \n    센터링, 엣지, 코너, 서페이스 4가지 항목 모두에서 최상의 컨디션을 자부하며, 그레이딩 업체에 보내도 높은 점수를 기대할 수 있는 수준입니다. \n    더 이상의 설명은 생략하겠습니다. 카드의 가치를 아시는 분께서 좋은 가격에 낙찰받으시길 바랍니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',2.00944000,0.00944000,8,_binary '',_binary '\0',0.00944000,_binary '\0',777,3,59,'2025-09-28 20:13:33.622211',NULL,'2025-10-06 20:24:32.000000',4,338,12,NULL,'2025-09-28 20:16:32.000000','2025-09-28 20:13:33.622211','0.1','b2c72390-5750-40b0-83d3-31d492395721','이거 싸게 가져가실 분?','자세한 상태는 사진을 참고해주세요. 빛에 비춰봐야 보이는 미세한 기스가 있을 수 있습니다.',NULL,NULL,NULL,NULL,NULL),(_binary '',13.01180000,0.01180000,6,_binary '',_binary '\0',0.01180000,_binary '\0',367,1,33,'2025-09-28 20:13:34.400562',NULL,'2025-10-04 20:30:31.000000',3,339,6,NULL,'2025-09-28 20:18:31.000000','2025-09-28 20:13:34.400562','1','a3483dd4-efef-4af9-80fe-609848307ede','낙찰되면 배송 빠르게 해드려요','이번에 콜렉션을 정리하면서 중복 카드를 판매하게 되었습니다. 포장 꼼꼼하게 해서 보내드릴게요.',NULL,NULL,NULL,NULL,NULL),(_binary '',0.82954000,0.02954000,9,_binary '',_binary '\0',0.02954000,_binary '\0',1301,2,29,'2025-09-28 20:13:41.397550',NULL,'2025-10-07 20:42:40.000000',4,340,8,NULL,'2025-09-28 20:13:40.000000','2025-09-28 20:13:41.397550','0.1','215bb187-89d5-4bb0-bf0d-23a869cd512f','급처합니다.','급하게 돈이 필요해서 아끼던 카드 판매합니다. 바로 구매하시면 약간의 서비스도 드려요.',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.00496000,0.00366000,2,_binary '',_binary '\0',0.00366000,_binary '\0',777,3,59,'2025-09-28 20:13:44.394636',NULL,'2025-09-30 20:25:44.000000',5,341,12,NULL,'2025-09-28 20:16:44.000000','2025-09-28 20:13:44.394636','0.0001','e518a93e-2377-4a75-9e7f-42c246a6cbc6','전 여자친구가 사줬던 카드, 이제는 보내줍니다...','\n    솔직히 말씀드립니다. 사진 보시면 아시겠지만 완벽한 S급 카드는 아닙니다. \n    뒷면 왼쪽 하단에 고양이가 할퀸 것 같은 미세한 스크래치가 하나 있고, 앞면에는 저만 보이는 것 같은 작은 점도 하나 있습니다. \n    그래서 시세보다 30% 저렴하게 시작합니다. 하지만 이 카드로 게임하면 왠지 더 잘 풀리는 이상한 버프가 있습니다. \n    제 친구도 이 카드로 연승했다고 하네요. 외모보다 실력, 상태보다 성능을 중시하는 실전파 게이머분들을 기다립니다. \n    쿨하게 거래하실 분 환영합니다.\n    \n    상품 페이지를 봐주셔서 대단히 감사합니다. 본 상품은 사진에 있는 것이 전부입니다. \n    상품의 상태에 대해서는 사진을 잘 확인하신 후, 납득하신 분만 입찰을 부탁드립니다. \n    미품이라고는 생각합니다만, 어디까지나 개인의 주관이므로 극히 미세한 초기 상처 등에 민감하신 분은 입찰을 삼가해주십시오. \n    클레임 및 반품은 받지 않으므로 양해 바랍니다. 그럼, 잘 부탁드리겠습니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.29039000,0.04039000,8,_binary '',_binary '\0',0.04039000,_binary '\0',367,1,33,'2025-09-28 20:13:48.105169',NULL,'2025-10-06 20:33:47.000000',6,342,6,NULL,'2025-09-28 20:16:47.000000','2025-09-28 20:13:48.105169','0.05','34c82f1d-56c9-4f87-bb5b-7aeb6687801a','카드 싸게 팔아요','이번에 콜렉션을 정리하면서 중복 카드를 판매하게 되었습니다. 포장 꼼꼼하게 해서 보내드릴게요.',NULL,NULL,NULL,NULL,NULL),(_binary '',8.53531000,0.03531000,11,_binary '',_binary '\0',0.03531000,_binary '\0',1302,2,30,'2025-09-28 20:13:51.527803',NULL,'2025-10-09 20:33:51.000000',6,343,8,NULL,'2025-09-28 20:18:51.000000','2025-09-28 20:13:51.527803','0.5','14dd582c-3509-4413-b108-6c0bca061ae2','문의 답변 빠름@@ 입찰 적극 환영@@','자세한 상태는 사진을 참고해주세요. 빛에 비춰봐야 보이는 미세한 기스가 있을 수 있습니다.',NULL,NULL,NULL,NULL,NULL),(_binary '',0.03521000,0.03411000,10,_binary '',_binary '\0',0.03411000,_binary '\0',777,3,59,'2025-09-28 20:13:51.595541',NULL,'2025-10-08 20:40:50.000000',1,344,12,NULL,'2025-09-28 20:17:50.000000','2025-09-28 20:13:51.595541','0.0001','296f22a9-9cea-4512-97fd-73bb7f847377','뜯고 한 번도 사용 안 한 카드인데 급하게 팝니다.','\n    개인적으로 소장해오던 카드입니다. \n    사진에서 보시다시피 카드 앞면과 뒷면 모두 눈에 띄는 큰 상처나 찍힘 없이 매우 깨끗한 상태를 유지하고 있습니다. \n    빛에 비춰봐도 실기스 거의 찾아보기 힘들 정도이며, 네 모서리 모두 날카롭게 살아있습니다. \n    습도와 온도 관리가 되는 전용 보관함에서 슬리브와 탑로더에 넣어 이중으로 보관해왔기 때문에 변색이나 휘어짐 현상도 전혀 없습니다. \n    최상의 상태를 원하시는 컬렉터분께 강력히 추천합니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '',0.18230000,0.02230000,12,_binary '',_binary '\0',0.02230000,_binary '\0',367,1,33,'2025-09-28 20:13:56.470132',NULL,'2025-10-10 20:37:53.000000',3,345,6,NULL,'2025-09-28 20:16:53.000000','2025-09-28 20:13:56.470132','0.01','5e4aca3e-8a3b-47af-be00-10809f1bbc29','거의 새것, 슬리브 보관 A+급 카드 저렴하게 가져가세요.','\"카드 수집 경력 15년차 컬렉터입니다. 이번에 상위 등급의 다른 카드를 구매하기 위해 자금 마련차 아끼던 카드를 출품합니다. \n    보시는 카드는 발매 당시 직접 박스를 개봉하여 뽑은 후, 바로 UV 차단 슬리브와 탑로더에 봉인하여 제습 기능이 있는 암실 캐비닛에 보관해왔습니다. \n    센터링, 엣지, 코너, 서페이스 4가지 항목 모두에서 최상의 컨디션을 자부하며, 그레이딩 업체에 보내도 높은 점수를 기대할 수 있는 수준입니다. \n    더 이상의 설명은 생략하겠습니다. 카드의 가치를 아시는 분께서 좋은 가격에 낙찰받으시길 바랍니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '',0.11737000,0.03237000,11,_binary '',_binary '\0',0.03237000,_binary '\0',1302,2,30,'2025-09-28 20:13:57.553030',NULL,'2025-10-09 20:24:57.000000',3,346,8,NULL,'2025-09-28 20:18:57.000000','2025-09-28 20:13:57.553030','0.005','55135b7e-1178-4a17-8f7b-4c4200ab1416','희귀 매물 팝니다@@@@@','사진 보시면 아시겠지만 상태 정말 좋습니다. 네고 문의는 받지 않습니다.',NULL,NULL,NULL,NULL,NULL),(_binary '\0',13.03164000,0.03164000,12,_binary '',_binary '\0',0.03164000,_binary '\0',777,3,59,'2025-09-28 20:13:58.908792',NULL,'2025-10-10 20:24:58.000000',3,347,12,NULL,'2025-09-28 20:13:58.000000','2025-09-28 20:13:58.908792','1','71f69ab0-d7d0-4115-bfe1-d2b4a3645693','콜렉션 정리 때문에 출품합니다','문의 있으면 언제든 문의 보내주세요~ 최대한 빠르게 답장 드리도록 하겠습니다.',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.18958000,0.01958000,2,_binary '',_binary '\0',0.01958000,_binary '\0',1302,2,30,'2025-09-28 20:14:04.944178',NULL,'2025-09-30 20:33:04.000000',3,348,8,NULL,'2025-09-28 20:19:04.000000','2025-09-28 20:14:04.944178','0.01','9d78d0fb-e18a-4d8b-873b-da94a057a3eb','상태 좋은 카드입니다.','문의 있으면 언제든 문의 보내주세요~ 최대한 빠르게 답장 드리도록 하겠습니다.',NULL,NULL,NULL,NULL,NULL),(_binary '',0.10616000,0.04616000,10,_binary 