 카드를 구매하기 위해 자금 마련차 아끼던 카드를 출품합니다. \n    보시는 카드는 발매 당시 직접 박스를 개봉하여 뽑은 후, 바로 UV 차단 슬리브와 탑로더에 봉인하여 제습 기능이 있는 암실 캐비닛에 보관해왔습니다. \n    센터링, 엣지, 코너, 서페이스 4가지 항목 모두에서 최상의 컨디션을 자부하며, 그레이딩 업체에 보내도 높은 점수를 기대할 수 있는 수준입니다. \n    더 이상의 설명은 생략하겠습니다. 카드의 가치를 아시는 분께서 좋은 가격에 낙찰받으시길 바랍니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '',0.61494000,0.01494000,14,_binary '',_binary '\0',0.01494000,_binary '\0',1303,2,11,'2025-09-28 20:14:33.741137',NULL,'2025-10-12 20:45:32.000000',3,357,8,NULL,'2025-09-28 20:17:32.000000','2025-09-28 20:14:33.741137','0.05','c1e9d9b2-16c3-432e-bc3c-73491f7b2e85','아들아, 미안하다! 아빠가 급전이 필요하단다.','\n    솔직히 말씀드립니다. 사진 보시면 아시겠지만 완벽한 S급 카드는 아닙니다. \n    뒷면 왼쪽 하단에 고양이가 할퀸 것 같은 미세한 스크래치가 하나 있고, 앞면에는 저만 보이는 것 같은 작은 점도 하나 있습니다. \n    그래서 시세보다 30% 저렴하게 시작합니다. 하지만 이 카드로 게임하면 왠지 더 잘 풀리는 이상한 버프가 있습니다. \n    제 친구도 이 카드로 연승했다고 하네요. 외모보다 실력, 상태보다 성능을 중시하는 실전파 게이머분들을 기다립니다. \n    쿨하게 거래하실 분 환영합니다.\n    \n    상품 페이지를 봐주셔서 대단히 감사합니다. 본 상품은 사진에 있는 것이 전부입니다. \n    상품의 상태에 대해서는 사진을 잘 확인하신 후, 납득하신 분만 입찰을 부탁드립니다. \n    미품이라고는 생각합니다만, 어디까지나 개인의 주관이므로 극히 미세한 초기 상처 등에 민감하신 분은 입찰을 삼가해주십시오. \n    클레임 및 반품은 받지 않으므로 양해 바랍니다. 그럼, 잘 부탁드리겠습니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.90013000,0.00013000,2,_binary '',_binary '\0',0.00013000,_binary '\0',778,3,59,'2025-09-28 20:14:34.318002',NULL,'2025-09-30 20:33:33.000000',1,358,12,NULL,'2025-09-28 20:19:33.000000','2025-09-28 20:14:34.318002','0.1','6e2356c9-5ec9-4878-897c-02f7a794c391','상태 좋은 카드입니다.','\n    개인적으로 소장해오던 카드입니다. \n    사진에서 보시다시피 카드 앞면과 뒷면 모두 눈에 띄는 큰 상처나 찍힘 없이 매우 깨끗한 상태를 유지하고 있습니다. \n    빛에 비춰봐도 실기스 거의 찾아보기 힘들 정도이며, 네 모서리 모두 날카롭게 살아있습니다. \n    습도와 온도 관리가 되는 전용 보관함에서 슬리브와 탑로더에 넣어 이중으로 보관해왔기 때문에 변색이나 휘어짐 현상도 전혀 없습니다. \n    최상의 상태를 원하시는 컬렉터분께 강력히 추천합니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.03372000,0.02522000,3,_binary '',_binary '\0',0.02522000,_binary '\0',1303,2,11,'2025-09-28 20:14:46.468253',NULL,'2025-10-01 20:37:45.000000',4,359,8,NULL,'2025-09-28 20:17:45.000000','2025-09-28 20:14:46.468253','0.0005','6df1b257-ea0b-4489-9943-6b7b21db6dd2','금일 카드샵에서 직접 뽑은 신상 카드 바로 판매합니다.','\n    처음 카드를 구매하시는 분들도 환영합니다. 이 카드는 OOO 시리즈에서 매우 인기 있는 카드로, 하나쯤 소장해두시면 만족감이 높으실 겁니다. \n    사진은 최대한 여러 각도에서 상세하게 촬영했으니 천천히 살펴보시고, 혹시 궁금한 점이 있다면 아무리 사소한 것이라도 괜찮으니 편하게 질문 남겨주세요. \n    거래가 처음부터 끝까지 기분 좋게 마무리될 수 있도록 친절하게 안내해 드리겠습니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',8.00766000,0.00766000,7,_binary '',_binary '\0',0.00766000,_binary '\0',778,3,59,'2025-09-28 20:14:47.596281',NULL,'2025-10-05 20:27:45.000000',4,360,12,NULL,'2025-09-28 20:18:45.000000','2025-09-28 20:14:47.596281','0.5','43fea6c1-061a-473e-8227-d5c0dab60a00','아들아, 미안하다! 아빠가 급전이 필요하단다.','\n    개인적으로 소장해오던 카드입니다. \n    사진에서 보시다시피 카드 앞면과 뒷면 모두 눈에 띄는 큰 상처나 찍힘 없이 매우 깨끗한 상태를 유지하고 있습니다. \n    빛에 비춰봐도 실기스 거의 찾아보기 힘들 정도이며, 네 모서리 모두 날카롭게 살아있습니다. \n    습도와 온도 관리가 되는 전용 보관함에서 슬리브와 탑로더에 넣어 이중으로 보관해왔기 때문에 변색이나 휘어짐 현상도 전혀 없습니다. \n    최상의 상태를 원하시는 컬렉터분께 강력히 추천합니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.03167000,0.03007000,11,_binary '',_binary '\0',0.03007000,_binary '\0',368,1,33,'2025-09-28 20:14:48.592837',NULL,'2025-10-09 20:34:46.000000',6,361,6,NULL,'2025-09-28 20:16:46.000000','2025-09-28 20:14:48.592837','0.0001','bc4f137c-5101-459c-9f67-44c27b1854d9','환불/교환 X, 쿨거하실 분들만 입찰해주세요.','자세한 상태는 사진을 참고해주세요. 빛에 비춰봐야 보이는 미세한 기스가 있을 수 있습니다.',NULL,NULL,NULL,NULL,NULL),(_binary '\0',9.02234000,0.02234000,10,_binary '',_binary '\0',0.02234000,_binary '\0',1303,2,11,'2025-09-28 20:14:54.700582',NULL,'2025-10-08 20:38:53.000000',5,362,8,NULL,'2025-09-28 20:16:53.000000','2025-09-28 20:14:54.700582','0.5','d7cee9e9-0000-4b40-b0d9-079f47a91ea2','희귀 매물 팝니다@@@@@','\n    솔직히 말씀드립니다. 사진 보시면 아시겠지만 완벽한 S급 카드는 아닙니다. \n    뒷면 왼쪽 하단에 고양이가 할퀸 것 같은 미세한 스크래치가 하나 있고, 앞면에는 저만 보이는 것 같은 작은 점도 하나 있습니다. \n    그래서 시세보다 30% 저렴하게 시작합니다. 하지만 이 카드로 게임하면 왠지 더 잘 풀리는 이상한 버프가 있습니다. \n    제 친구도 이 카드로 연승했다고 하네요. 외모보다 실력, 상태보다 성능을 중시하는 실전파 게이머분들을 기다립니다. \n    쿨하게 거래하실 분 환영합니다.\n    \n    상품 페이지를 봐주셔서 대단히 감사합니다. 본 상품은 사진에 있는 것이 전부입니다. \n    상품의 상태에 대해서는 사진을 잘 확인하신 