,'2b2b8a5b-ab35-4a9e-97f3-ae62cf0e64e2','환불/교환 X, 쿨거하실 분들만 입찰해주세요.','\n    전체적으로는 깨끗한 편이지만, 사진 4번과 5번에서 확인하실 수 있듯이 뒷면 오른쪽 상단 모서리에 미세한 찍힘이 있습니다. \n    또한 빛에 비춰 자세히 보면 앞면 홀로그램 부분에 피해갈 수 없는 잔기스가 약간 존재합니다. \n    플레이용으로는 전혀 문제없으며, 소장용으로도 크게 거슬리는 수준은 아니라고 생각합니다. 이런 부분에 예민하지 않으신 분께서 저렴하게 구매해가시면 좋을 것 같습니다. \n    상태 관련해서 추가로 궁금한 점은 편하게 문의 주세요.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.04555000,0.03755000,3,_binary '',_binary '\0',0.03155000,_binary '\0',369,1,33,'2025-09-28 20:15:23.739898',NULL,'2025-10-01 20:31:21.000000',2,371,6,NULL,'2025-09-28 20:18:21.000000','2025-09-28 23:20:10.288092','0.001','89007c03-e712-4703-bf1c-669e855b017f','낙찰되면 배송 빠르게 해드려요','안녕하세요, 카드 전문 판매자입니다. 낙찰해 주신 소중한 카드는 구겨지거나 손상되지 않도록 슬리브, 탑로더, 뽁뽁이, 박스 포장까지 4중으로 안전하게 포장하여 보내드립니다. \n    배송 중 발생할 수 있는 모든 문제를 미연에 방지하기 위해 최선을 다하고 있으며, 보통 결제 다음 날 바로 발송 처리해 드리고 있습니다. \n    믿고 구매하실 수 있도록 언제나 꼼꼼하게 준비하겠습니다.\n    ',NULL,NULL,NULL,NULL,NULL),(_binary '\0',0.00000000,0.00010000,1,_binary '',_binary '',0.00010000,_binary '\0',1470,4,61,'2025-09-29 00:12:03.357685',NULL,'2025-09-29 00:11:00.000000',21,372,5,6,'2025-09-29 00:10:00.000000','2025-09-29 00:12:04.887379','0.0001','b429d956-849e-4f61-afbd-7a6653f5281b','소장용 카드 싸게 내놓습니다','카드 수집 경력 15년차 컬렉터입니다. 이번에 상위 등급의 다른 카드를 구매하기 위해 자금 마련차 아끼던 카드를 출품합니다. \n    보시는 카드는 발매 당시 직접 박스를 개봉하여 뽑은 후, 바로 UV 차단 슬리브와 탑로더에 봉인하여 제습 기능이 있는 암실 캐비닛에 보관해왔습니다. \n    센터링, 엣지, 코너, 서페이스 4가지 항목 모두에서 최상의 컨디션을 자부하며, 그레이딩 업체에 보내도 높은 점수를 기대할 수 있는 수준입니다. \n    더 이상의 설명은 생략하겠습니다. 카드의 가치를 아시는 분께서 좋은 가격에 낙찰받으시길 바랍니다.\n    ','NO_BIDS','2025-09-29 00:12:04.885834',NULL,NULL,NULL),(_binary '\0',0.00000000,0.00020000,1,_binary '',_binary '',0.00010000,_binary '\0',1470,4,61,'2025-09-29 00:13:37.961436',149,'2025-09-29 00:17:00.000000',22,373,5,6,'2025-09-29 00:00:00.000000','2025-09-29 00:17:16.545299','0.0001','2a72bf33-41a2-4fcd-a2d2-dfcd62865ca1','이 카드로 대회 우승했습니다. (기운 받아가세요)','저의 판매 페이지를 찾아주셔서 감사합니다. 저는 모든 카드를 \'내가 받을 물건\'이라는 생각으로 정성껏 포장합니다. \n    기본적으로 카드 보호 필름 + 탑로더 + 안전 봉투 + 에어캡(뽁뽁이) 