INSERT INTO `card` VALUES (1,33,'2025-09-16 16:37:09.992746',366,'2025-09-16 16:37:09.992746','DABL-KR005','BF－각야의 존다','{\"attribute\": \"어둠\", \"type\": \"[비행야수족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2300\", \"deffence\": \"수비력 900\", \"card_text\": \"이 카드명의 ②③의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 이 카드가 몬스터 존에 존재하는 한, 자신은 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 이 카드가 일반 소환 / 특수 소환에 성공했을 경우, 필드의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 주인의 패로 되돌린다. ③: 묘지의 이 카드를 제외하고 발동할 수 있다. 패 / 덱에서 레벨 5 이상의 \\\"BF(블랙 페더)\\\" 몬스터 1장을 특수 소환한다. 그 후, 자신은 이 효과로 특수 소환한 몬스터의 공격력만큼의 데미지를 받는다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:25.880355',367,'2025-09-16 16:37:25.880355','DABL-KR007','비스테드 살로니르','{\"attribute\": \"어둠\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 또는 상대 묘지의, 빛 / 어둠 속성 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 제외하고, 이 카드를 패에서 특수 소환한다. 상대 필드에 몬스터가 존재할 경우, 이 효과는 상대 턴에도 발동할 수 있다. ②: 이 카드가 묘지로 보내졌을 경우에 발동할 수 있다. \\\"비스테드 살로니르\\\" 이외의 \\\"비스테드\\\" 몬스터 1장 또는 \\\"낙인\\\" 마법 / 함정 카드 1장을 덱에서 묘지로 보낸다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:26.871027',368,'2025-09-16 16:37:26.871027','DABL-KR018','총의 첩자－카게로우','{\"attribute\": \"화염\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 소환 / 특수 소환 / 리버스했을 경우에 발동할 수 있다. 자신의 패 / 묘지에서 \\\"총의 첩자－카게로우\\\" 이외의 \\\"첩자\\\" 몬스터 1장을 고르고 뒷면 수비 표시로 특수 소환한다. ②: 이 카드가 묘지에 존재하고, 자신 필드의, \\\"첩자\\\" 카드 1장만 또는 뒷면 수비 표시 몬스터 1장만을 대상으로 하는 상대 효과가 발동했을 때에 발동할 수 있다. 이 카드를 뒷면 수비 표시로 특수 소환하고, 그 대상이 된 카드를 주인의 패로 되돌린다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:27.092860',369,'2025-09-16 16:37:27.092860','DABL-KR019','점술공주 비블리오무사','{\"attribute\": \"땅\", \"type\": \"[천사족／리버스／효과]\", \"level\": \"레벨 9\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2500\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 릴리스되어 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 뒷면 수비 표시로 특수 소환한다. ②: 이 카드가 리버스했을 경우에 발동할 수 있다. 덱에서 \\\"점술공주 비블리오무사\\\" 이외의 \\\"점술공주\\\" 몬스터 1장과 의식 마법 카드 1장을 패에 넣는다. ③: 이 카드가 몬스터 존에 존재하는 한, 자신 필드의 의식 몬스터는 상대 효과의 대상이 되지 않으며, 상대 효과로는 파괴되지 않는다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:27.502184',370,'2025-09-16 16:37:27.502184','DABL-KR023','룡검사 마제스티P','{\"attribute\": \"바람\", \"type\": \"[마법사족／펜듈럼／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명은 룰상 \\\"마제스펙터\\\" 카드로도 취급한다. 이 카드명의 ②의 몬스터 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 패에서 버리고 발동할 수 있다. 이 턴에, 자신 필드의 \\\"룡검사\\\" 몬스터는 상대 효과의 대상이 되지 않으며, 상대 효과로는 파괴되지 않는다. 이 효과는 상대 턴에도 발동할 수 있다. ②: 이 카드가 펜듈럼 소환 또는 \\\"룡검사\\\" 카드의 효과로 특수 소환에 성공했을 경우에 발동할 수 있다. 덱에서 필드 마법 카드 1장을 패에 넣는다. 그 후, 자신의 패를 1장 고르고 버린다.\"}',NULL,'UNCOMMON'),(1,33,'2025-09-16 16:37:27.775790',371,'2025-09-16 16:37:27.775790','DABL-KR024','룡검사 다이너마이트P','{\"attribute\": \"물\", \"type\": \"[기계족／펜듈럼／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1700\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명은 룰상 \\\"다이너미스트\\\" 카드로도 취급한다. 이 카드명의 몬스터 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 릴리스되었을 경우에 발동할 수 있다. 자신의 엑스트라 덱에서 \\\"룡검사 다이너마이트P(파워로드)\\\" 이외의 앞면 표시의, \\\"룡검사\\\" 펜듈럼 몬스터 또는 \\\"다이너미스트\\\" 펜듈럼 몬스터 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:28.282793',372,'2025-09-16 16:37:28.282793','DABL-KR029','소울 시저','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 550\", \"deffence\": \"수비력 350\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 묘지에 존재하는 상태에서, 필드의 몬스터가 전투 / 효과로 파괴되어 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다. ②: 이 카드가 묘지에서의 특수 소환에 성공했을 경우, 상대 필드의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 파괴한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:28.676287',373,'2025-09-16 16:37:28.676287','DABL-KR033','도화조 래핑퍼핀','{\"attribute\": \"어둠\", \"type\": \"[비행야수족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 1700\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 필드에 앞면 표시의 마법 / 함정 카드가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 자신 필드의 비행야수족 몬스터 1장을 릴리스하고, 필드의 앞면 표시의 마법 / 함정 카드 1장을 대상으로 하여 발동할 수 있다. 그 앞면 표시의 카드를 주인의 패로 되돌린다. 이 턴에, 자신은 이 효과로 패로 되돌린 카드 및 그와 같은 이름의 카드의 효과를 발동할 수 없다. 자신 필드의 몬스터가 비행야수족 몬스터뿐일 경우, 이 효과는 상대 턴에도 발동할 수 있다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:28.903816',374,'2025-09-16 16:37:28.903816','DABL-KR034','데스튠－GT19','{\"attribute\": \"화염\", \"type\": \"[기계족／리버스／튜너／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 이 카드가 리버스했을 경우, 1~9 까지의 임의의 레벨을 선언하고 발동할 수 있다. 이 카드의 레벨은 턴 종료시까지 선언한 레벨이 된다. ②: 리버스한 이 카드가 앞면 표시로 존재할 경우, 자신 / 상대의 메인 페이즈에, 이 카드 이외의 자신 / 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터와 이 카드만을 소재로서 싱크로 소환한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:29.171005',375,'2025-09-16 16:37:29.171005','DABL-KR035','사이코 로버','{\"attribute\": \"어둠\", \"type\": \"[사이킥족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 700\", \"card_text\": \"①: 이 카드가 특수 소환에 성공했을 경우에 발동할 수 있다. 주사위를 1회 던진다. 1 / 6 이 나왔을 경우, 필드의 카드를 2장까지 고르고 파괴한다. ②: 이 카드가 묘지로 보내졌을 경우에 발동할 수 있다. 주사위를 1회 던진다. 2~5 가 나왔을 경우, 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드가 몬스터 존에 앞면 표시로 존재하는 한, 자신은 엑스트라 덱에서 몬스터를 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:29.483693',376,'2025-09-16 16:37:29.483693','DABL-KR036','정령명기－큐캄바','{\"attribute\": \"어둠\", \"type\": \"[식물족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 100\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 배틀 페이즈 이외로는, 몬스터 존의 이 카드는 묘지로 보내진다. ②: 이 카드가 묘지에 존재할 경우, 자신 / 상대의 배틀 페이즈 개시시에, 패 및 자신 필드의 앞면 표시 몬스터 중에서, 식물족 몬스터 1장을 묘지로 보내고 발동할 수 있다. 이 카드를 특수 소환한다. 그 후, 자신 또는 상대 묘지에서 몬스터 1장을 고르고 자신 필드에 특수 소환할 수 있다. 이 효과로 특수 소환한 몬스터는 전부 배틀 페이즈 종료시에 묘지로 보내진다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:29.700236',377,'2025-09-16 16:37:29.700236','DABL-KR037','오메르타－칼루포','{\"attribute\": \"어둠\", \"type\": \"[야수전사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1400\", \"deffence\": \"수비력 1400\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 소환 / 특수 소환에 성공했을 경우에 발동한다. 자신의 덱 맨 위의 카드를 공격력 500 올리는 장착 카드로 취급하고 뒷면 표시로 이 카드에 장착한다. ②: 자신 / 상대의 엔드 페이즈에 발동한다. 상대는 이 카드의 ①의 효과로 장착하고 있는 카드의 원래의 종류(몬스터 / 마법 / 함정)를 맞힌다. 맞힌 경우, 이 카드를 묘지로 보낸다. 맞히지 못한 경우, 상대의 패를 무작위로 1장 골라 버리고, 이 카드를 주인의 패로 되돌린다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:30.136057',378,'2025-09-16 16:37:30.136057','DABL-KR041','루닉의 이빨 프레키','{\"attribute\": \"어둠\", \"type\": \"[야수족／융합／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 0\", \"card_text\": \"루닉 몬스터 × 2이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 엑스트라 몬스터 존의 이 카드가 전투를 실행하는 공격 선언시에 발동할 수 있다. 상대의 덱 위에서 카드를 2장 제외한다. ②: 이 카드의 전투로 발생하는 서로의 전투 데미지는 0 이 된다. ③: 필드의 이 카드가 전투 / 효과로 파괴되었을 경우, 자신 묘지의 \\\"루닉\\\" 속공 마법 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:30.629197',379,'2025-09-16 16:37:30.629197','DABL-KR044','린회의 삼현묘','{\"attribute\": \"어둠\", \"type\": \"[언데드족／싱크로／튜너／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 1200\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 상대 메인 페이즈에 발동할 수 있다. 이 카드를 포함하는 자신 필드의 몬스터를 소재로서 싱크로 소환한다. ②: 이 카드가 묘지에 존재할 경우, 이 카드 이외의 자신 묘지의 싱크로 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 엑스트라 덱으로 되돌리고, 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'UNCOMMON'),(1,33,'2025-09-16 16:37:30.854522',380,'2025-09-16 16:37:30.854522','DABL-KR047','사조의 예룡 워로','{\"attribute\": \"어둠\", \"type\": \"[언데드족／엑시즈／효과]\", \"rank\": \"랭크 6\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 1300\", \"card_text\": \"레벨 6 몬스터 × 2장 이상이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 몬스터의 공격력 / 수비력은, 상대 묘지의 카드의 수 × 100 올린다. ②: 상대 묘지의 카드 1장을 대상으로 하고, 이 카드의 엑시즈 소재를 이하의 수만큼 제거하여, 그 효과를 발동할 수 있다. 이 효과는 상대 턴에도 발동할 수 있다.●1개: 그 카드를 덱으로 되돌린다.●2개: 그 카드가 몬스터일 경우, 자신 필드에 앞면 표시 또는 뒷면 수비 표시로 특수 소환한다. 그 이외일 경우, 자신 필드에 세트한다.\"}',NULL,'UNCOMMON'),(1,33,'2025-09-16 16:37:31.595559',381,'2025-09-16 16:37:31.595559','DABL-KR053','복낙인','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의, ①의 효과는 1턴에 1번밖에 사용할 수 없으며, ②의 효과는 동일한 체인 위에서는 1번밖에 발동할 수 없다. ①: 빛 / 어둠 속성 몬스터가 제외되었을 경우, 그 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 주인의 덱 맨 아래로 되돌리고, 자신은 덱에서 1장 드로우한다. ②: 1턴에 1번, 상대가 몬스터의 일반 소환 / 특수 소환에 성공했을 경우, 자신 묘지의 \\\"비스테드\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,33,'2025-09-16 16:37:31.854453',382,'2025-09-16 16:37:31.854453','DABL-KR054','결전의 골곤다','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 카드명은, 필드 / 묘지에 존재하는 한 \\\"대사해 골드 골곤다\\\"로 취급한다. ②: 1턴에 1번, 자신 필드의 카드가 전투 / 효과로 파괴될 경우, 대신에 엑스트라 덱에서 \\\"알버스의 낙윤\\\"을 융합 소재로 하는 융합 몬스터 1장을 묘지로 보낼 수 있다. ③: 자신의 필드 또는 묘지에 \\\"알버스의 낙윤\\\"이 존재할 경우, 자신 / 상대의 엔드 페이즈에 발동할 수 있다. 패 / 덱에서 \\\"스프리건즈\\\" 몬스터 1장을 특수 소환한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:32.088099',383,'2025-09-16 16:37:32.088099','DABL-KR055','트라이브리게이드 데드라인','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 야수족 / 야수전사족 / 비행야수족 몬스터가 특수 소환되었을 경우, 제외되어 있는 자신의 \\\"트라이브리게이드\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 패에 넣는다. ②: 자신의 \\\"트라이브리게이드\\\" 몬스터가 상대 몬스터와 전투를 실행한 데미지 계산 후에 발동할 수 있다. 그 상대 몬스터를 주인의 패로 되돌린다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:32.309864',384,'2025-09-16 16:37:32.309864','DABL-KR057','티아라멘츠 하트비츠','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 필드의 마법 / 함정 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 주인의 덱으로 되돌린다. 그 후, 자신의 패를 1장 고르고 묘지로 보낸다. 자신 필드에 \\\"비서스＝스타프로스트\\\"가 존재할 경우, 이 효과의 대상을 2장으로 할 수 있다. ②: 이 카드가 효과로 묘지로 보내졌을 경우, 자신 묘지의 \\\"티아라멘츠\\\" 함정 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:32.522698',385,'2025-09-16 16:37:32.522698','DABL-KR058','티아라멘츠 스크림','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 필드에 몬스터가 일반 소환 / 특수 소환되었을 경우에, 자신 필드에 \\\"티아라멘츠\\\" 몬스터 또는 \\\"비서스＝스타프로스트\\\"가 존재하고 있으면 발동할 수 있다. 자신의 덱 위에서 카드를 3장 묘지로 보낸다. 이 턴에, 상대 필드의 몬스터의 공격력은 500 내린다. ②: 이 카드가 효과로 묘지로 보내졌을 경우에 발동할 수 있다. 덱에서 \\\"티아라멘츠\\\" 함정 카드 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:32.751814',386,'2025-09-16 16:37:32.751814','DABL-KR059','디클라인 스케어클로','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신의 필드 / 묘지의 \\\"사세괴＝라이포비아\\\" 1장을 대상으로 하고 발동할 수 있다. 그 카드를 주인의 패로 되돌린다. 자신 필드에 \\\"비서스＝스타프로스트\\\"가 존재할 경우, 추가로 상대 필드의 앞면 표시 몬스터 1장을 고르고 뒷면 수비 표시로 할 수 있다. ②: 필드에 수비 표시 몬스터가 3장 이상 존재할 경우, 묘지의 이 카드를 제외하고 발동할 수 있다. 자신 묘지에서 \\\"스케어클로\\\" 카드 1장을 고르고 패에 넣는다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:33.083159',387,'2025-09-16 16:37:33.083159','DABL-KR063','명점술의 의식','{\"attribute\": \"마법\", \"card_text\": \"점술공주 의식 몬스터의 의식 소환에 필요. ①: 레벨의 합계가 의식 소환할 몬스터의 레벨 이상이 되도록, 자신의 패 / 필드의 몬스터를 릴리스하고, 자신의 패 / 묘지에서 \\\"점술공주\\\" 의식 몬스터 1장을 앞면 공격 표시 또는 뒷면 수비 표시로 의식 소환한다. ②: 자신 필드에 \\\"점술공주\\\" 의식 몬스터가 존재할 경우, 자신 / 상대의 스탠바이 페이즈에 묘지의 이 카드를 제외하고 발동할 수 있다. 덱에서 의식 몬스터 이외의 \\\"점술공주\\\" 몬스터 1장을 뒷면 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:33.334135',388,'2025-09-16 16:37:33.334135','DABL-KR064','나츄르의 봄바람','{\"attribute\": \"마법\", \"card_text\": \"①: 이하의 효과에서 1개를 선택하고 발동할 수 있다.●자신의 패 / 묘지에서 \\\"나츄르\\\" 몬스터 1장을 고르고 특수 소환한다.●\\\"나츄르\\\" 몬스터를 포함하는 자신 필드의 몬스터를 소재로서 싱크로 소환한다.●자신 필드에서, 융합 몬스터 카드에 기재된, \\\"나츄르\\\" 몬스터를 포함하는 융합 소재 몬스터를 묘지로 보내고, 그 융합 몬스터 1장을 엑스트라 덱에서 융합 소환한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:33.573525',389,'2025-09-16 16:37:33.573525','DABL-KR067','금주 아라마티아','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 메인 페이즈에 발동할 수 있다. 자신 또는 상대 필드에 \\\"용사 토큰\\\"(천사족 / 땅 / 레벨 4 / 공 2000 / 수 2000) 1장을 특수 소환한다. 그 후, 자신의 패를 1장 고르고 묘지로 보낸다. 이 효과를 발동하는 턴에, 자신은 \\\"용사 토큰\\\" 및 그 토큰명이 쓰여진 몬스터밖에 특수 소환할 수 없다. ②: 자신 필드의 몬스터가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 자신 또는 상대 필드에 \\\"용사 토큰\\\" 1장을 특수 소환한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:33.824450',390,'2025-09-16 16:37:33.824450','DABL-KR068','VV－솔로액티베이트','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 덱에서 \\\"밸리언츠\\\" 펜듈럼 몬스터 1장을 고르고 자신의 펜듈럼 존에 놓는다. ②: 필드 존에 카드가 존재할 경우, 묘지의 이 카드를 제외하고, 자신 메인 몬스터 존의 \\\"밸리언츠\\\" 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 자신 몬스터의 위치를, 그 옆의 몬스터 존으로 이동한다.\"}',NULL,'UNCOMMON'),(1,33,'2025-09-16 16:37:34.167158',391,'2025-09-16 16:37:34.167158','DABL-KR069','지중계의 액재','{\"attribute\": \"마법\", \"card_text\": \"①: 자신 필드의 뒷면 수비 표시 몬스터는 상대 효과의 대상이 되지 않는다. ②: 이 카드가 마법 & 함정 존에 존재하는 한, 이 카드가 앞면 표시로 존재하는 동안에 리버스한, 자신 필드의 몬스터의 공격력 / 수비력은 1500 올린다. ③: 마법 & 함정 존의 이 카드가 상대 효과로 파괴되었을 경우, 자신 묘지의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 뒷면 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:34.452733',392,'2025-09-16 16:37:34.452733','DABL-KR072','블랙 노블','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 마법 / 함정 카드가 발동했을 때, 자신 필드의 검은 날개 카운터를 1개 제거하고 발동할 수 있다. 그 발동을 무효로 하고 파괴한다. ②: 자신 필드에 \\\"블랙 페더 드래곤\\\"이 존재할 경우에 발동할 수 있다. 묘지의 이 카드를 자신 필드에 세트한다. 이 효과로 세트한 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:34.726839',393,'2025-09-16 16:37:34.726839','DABL-KR073','낙인의 야수','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 1턴에 1번, 자신 필드에 \\\"비스테드\\\" 몬스터가 존재할 경우, 자신 / 상대의 메인 페이즈에, 자신 필드의 드래곤족 몬스터 1장을 릴리스하고, 상대 필드의 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 파괴한다. ②: 자신 / 상대의 엔드 페이즈에, 자신 묘지의 \\\"낙인\\\" 지속 마법 / 지속 함정 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 자신 필드에 앞면 표시로 놓는다.\"}',NULL,'UNCOMMON'),(1,33,'2025-09-16 16:37:34.967873',394,'2025-09-16 16:37:34.967873','TT01-KRB25','스프라이트 더블크로스','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신이나 상대의 필드 / 묘지의 몬스터 1장을 대상으로 하고, 이하의 효과에서 1개를 선택하여 발동할 수 있다. ●대상 몬스터를, 자신 필드의 랭크 2 몬스터 1장의 엑시즈 소재로 한다. ●대상의 상대 필드의 몬스터를, 자신 필드의 링크 2 몬스터의 링크 앞이 되는 자신 필드에 놓고 컨트롤을 얻는다. ●대상 묘지의 몬스터를, 자신 필드의 링크 2 몬스터의 링크 앞이 되는 자신 필드에 특수 소환한다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:35.194279',395,'2025-09-16 16:37:35.194279','DABL-KR075','스케어클로 트윈소우','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 \\\"스케어클로\\\" 몬스터 1장을 릴리스하고, 상대 필드의 카드 2장을 대상으로 하여 발동할 수 있다. 그 카드를 파괴한다. 자신 필드에 \\\"비서스＝스타프로스트\\\"가 존재할 경우, 이 효과로 파괴한 카드는 묘지로는 가지 않으며 제외된다. ②: 필드에 링크 3 이상의 몬스터가 존재할 경우, 묘지의 이 카드를 제외하고 발동할 수 있다. 이 턴에, 필드의 링크 몬스터는 효과를 발동할 수 없다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:35.451559',396,'2025-09-16 16:37:35.451559','DABL-KR077','인법 낙엽무','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신 / 상대 필드의 \\\"첩자\\\" 몬스터 또는 뒷면 수비 표시 몬스터 1장을 대상으로 하고 이 카드를 발동할 수 있다. 그 몬스터를 릴리스하고, 덱에서 \\\"첩자\\\" 몬스터 1장을 특수 소환한다. 이 카드가 필드에서 벗어났을 때에 그 몬스터는 묘지로 보내진다. ②: 이 카드가 앞면 표시로 존재할 경우, 자신의 마법 & 함정 존의 \\\"인법\\\" 지속 마법 / 지속 함정 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 주인의 패로 되돌린다.\"}',NULL,'UNCOMMON'),(1,33,'2025-09-16 16:37:35.642330',397,'2025-09-16 16:37:35.642330','DABL-KR079','성봉의 천하','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 패의 의식 몬스터 1장을 상대에게 보여주고 발동할 수 있다. 그 몬스터와는 카드명이 다르고, 레벨이 같은 의식 몬스터 1장을 덱에서 패에 넣는다. ②: 묘지의 이 카드를 제외하고, 패에서 의식 마법 카드 1장을 묘지로 보내고 발동할 수 있다. 이 효과는, 그 의식 마법 카드 발동시의 의식 소환하는 효과와 같아진다.\"}',NULL,'COMMON'),(1,33,'2025-09-16 16:37:35.889310',398,'2025-09-16 16:37:35.889310','DABL-KR080','천지 뒤집기','{\"attribute\": \"함정\", \"card_text\": \"①: 자신의 덱 맨 아래의 카드를 패에 넣는다. 그 후, 자신의 덱에서 카드 1장을 고르고 덱 맨 아래에 놓는다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:36.308007',399,'2025-09-16 16:37:36.308007','DUNE-KR001','휠 싱크론','{\"attribute\": \"빛\", \"type\": \"[기계족／튜너／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 800\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 이 카드를 싱크로 소재로 할 경우, 이 카드를 튜너 이외의 몬스터로 취급할 수 있다. ②: 자신 메인 페이즈에 발동할 수 있다. 레벨 4 이하의 몬스터 1장의 일반 소환을 실행한다. 이 턴에, 자신은 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ③: 묘지의 이 카드를 제외하고, 자신 필드의 싱크로 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터의 레벨을 4개까지 내린다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:36.670175',400,'2025-09-16 16:37:36.670175','DUNE-KR003','환조의 왕 가젤','{\"attribute\": \"땅\", \"type\": \"[야수족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1200\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 덱에서 악마족 / 레벨 5 몬스터 1장이나 \\\"키메라 퓨전\\\" 1장을 패에 넣는다. ②: 이 카드가 융합 소환의 소재가 되어 묘지로 보내졌을 경우에 발동할 수 있다. 덱에서 환상마족 몬스터 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:36.848836',401,'2025-09-16 16:37:36.848836','DUNE-KR005','콘필드 코아틀','{\"attribute\": \"바람\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 1700\", \"card_text\": \"이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 패에서 버리고 발동할 수 있다. \\\"콘필드 코아틀\\\" 이외의 \\\"키메라 퓨전\\\"의 카드명이 쓰여진 몬스터 1장을 덱에서 패에 넣는다. ②: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다. ③: 자신 필드에 \\\"유익환상수 키메라\\\"가 존재하고, 자신 필드의 카드를 대상으로 하는 효과를 상대가 발동했을 때, 필드 / 묘지의 이 카드를 제외하고 발동할 수 있다. 그 효과를 무효로 하고 파괴한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:37.113306',402,'2025-09-16 16:37:37.113306','DUNE-KR006','미러 스워드나이트','{\"attribute\": \"빛\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1900\", \"deffence\": \"수비력 300\", \"card_text\": \"이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대 턴에, 이 카드를 릴리스하고 발동할 수 있다. \\\"미러 스워드나이트\\\" 이외의 \\\"키메라 퓨전\\\"의 카드명이 쓰여진 몬스터 1장을 덱에서 특수 소환한다. ②: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다. ③: 자신 필드에 \\\"유익환상수 키메라\\\"가 존재하고, 상대 필드의 몬스터가 효과를 발동했을 때, 필드 / 묘지의 이 카드를 제외하고 발동할 수 있다. 그 효과를 무효로 한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:37.343096',403,'2025-09-16 16:37:37.343096','DUNE-KR007','쌍두룡 킹렉스','{\"attribute\": \"땅\", \"type\": \"[공룡족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 1200\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 몬스터가 존재하지 않을 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 이 카드를 일반 소환 / 특수 소환했을 경우, 자신 필드의 공룡족 몬스터의 공격력 합계보다 낮은 공격력을 가지는 필드의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 파괴한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:37.570434',404,'2025-09-16 16:37:37.570434','DUNE-KR008','용왕 킹렉스','{\"attribute\": \"땅\", \"type\": \"[공룡족／효과]\", \"level\": \"레벨 9\", \"attack\": \"공격력 3200\", \"deffence\": \"수비력 1200\", \"card_text\": \"①: 이 카드의 공격으로 상대 몬스터를 파괴했을 때에 발동할 수 있다. 이 배틀 페이즈 중, 이 카드는 1번만 더 공격할 수 있다. ②: 이 카드가 이 턴에 일반 소환 / 반전 소환 / 특수 소환되어 있지 않을 경우, 1턴에 1번, 상대 필드의 몬스터를 2장까지 대상으로 하고 발동할 수 있다. 그 몬스터를 파괴한다.\"}',NULL,'UNCOMMON'),(1,36,'2025-09-16 16:37:37.761748',405,'2025-09-16 16:37:37.761748','DUNE-KR014','불꽃성기사－튀르팽','{\"attribute\": \"화염\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1400\", \"deffence\": \"수비력 1700\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 장착 카드를 장착하고 있는 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 패 / 묘지에서 특수 소환한다. 이 효과로 묘지에서 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다. ②: 이 카드가 묘지에 존재할 경우, 자신 필드의 전사족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 장착 마법 카드로 취급하고 그 자신의 몬스터에 장착한다. ③: 장착 몬스터를 싱크로 소재로 할 경우, 튜너로서 취급할 수 있다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:38.163596',406,'2025-09-16 16:37:38.163596','DUNE-KR019','언체인드소울 샤바라','{\"attribute\": \"화염\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재할 경우, 자신 / 상대의 메인 페이즈에, 자신 필드의, 악마족 몬스터 1장이나 뒷면 표시 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴하고, 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드가 몬스터 존에 앞면 표시로 존재하는 한, 자신은 악마족 몬스터밖에 특수 소환할 수 없다. ②: 이 카드가 묘지로 보내졌을 경우에 발동할 수 있다. 덱에서 \\\"언체인드\\\" 마법 / 함정 카드 1장을 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:38.404308',407,'2025-09-16 16:37:38.404308','DUNE-KR020','언체인드소울 슈야마','{\"attribute\": \"물\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다. 그 후, 필드의 마법 / 함정 카드 1장을 파괴할 수 있다. ②: 이 카드가 묘지에 존재할 경우, 자신 필드의, 악마족 몬스터 1장이나 뒷면 표시 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴하고, 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 덱 맨 아래로 되돌아간다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:38.626131',408,'2025-09-16 16:37:38.626131','DUNE-KR021','천극휘사－베어트론α','{\"attribute\": \"물\", \"type\": \"[기계족／특수 소환／효과]\", \"level\": \"레벨 7\", \"attack\": \"공