소환할 수 없으며, 레벨의 차가 1 이 되도록 자신 필드에서 튜너 1장과 튜너 이외의 몬스터 1장을 묘지로 보냈을 경우에만 특수 소환할 수 있다. ①: 이 카드와 자신의 패 / 필드의 레벨 8 의 \\\"베어루크티\\\" 몬스터 1장을 릴리스하고 발동할 수 있다. 레벨 7 의 \\\"베어루크티\\\" 싱크로 몬스터 1장을 소환 조건을 무시하고 엑스트라 덱에서 특수 소환한다. 이 효과로 특수 소환한 몬스터는 이하의 효과를 얻는다. ●상대는 엑스트라 덱에서 특수 소환된, 레벨을 가지는 몬스터의 효과를 발동할 수 없다.\"}',NULL,'UNCOMMON'),(1,36,'2025-09-16 16:37:41.945444',417,'2025-09-16 16:37:41.945444','DUNE-KR042','열일의 기사 가이아브레이즈','{\"attribute\": \"화염\", \"type\": \"[화염족／싱크로／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2600\", \"deffence\": \"수비력 2100\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상①: 이 카드의 공격으로 상대 몬스터를 파괴했을 때에 발동할 수 있다. 이 카드는 1번만 더 이어서 공격할 수 있다. ②: 자신 / 상대의 배틀 페이즈 종료시에, 이 턴에 이 카드가 전투로 파괴한 몬스터의 수까지, 자신 묘지의 화염 속성 몬스터를 대상으로 하고 발동할 수 있다. 그 몬스터를 패에 넣는다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:42.177731',418,'2025-09-16 16:37:42.177731','DUNE-KR044','에퓨어리 누아르','{\"attribute\": \"어둠\", \"type\": \"[천사족／엑시즈／효과]\", \"rank\": \"랭크 2\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 2000\", \"card_text\": \"레벨 2 몬스터 × 2①: 1턴에 1번, 패를 1장 버리고, 상대 필드의 카드 1장을 대상으로 하여 발동할 수 있다(이 카드가 \\\"퓨어리 슬리피메모리\\\"를 엑시즈 소재로 하고 있을 경우, 대상을 2장으로 할 수 있다). 그 카드를 패로 되돌린다. ②: 1턴에 3번까지, 자신이 \\\"퓨어리\\\" 속공 마법 카드를 발동했을 때에 발동할 수 있다. 필드의 그 카드를 이 카드의 엑시즈 소재로 한다. 그 후, 덱에서 \\\"퓨어리\\\" 함정 카드 1장을 자신 필드에 세트할 수 있다.\"}',NULL,'UNCOMMON'),(1,36,'2025-09-16 16:37:42.484791',419,'2025-09-16 16:37:42.484791','DUNE-KR045','셀레마테크 클라티스','{\"attribute\": \"어둠\", \"type\": \"[마법사족／엑시즈／효과]\", \"rank\": \"랭크 8\", \"attack\": \"공격력 3000\", \"deffence\": \"수비력 900\", \"card_text\": \"레벨 8 몬스터 × 2이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대가 마법 카드 이외의 카드의 효과를 발동할 때마다, 이 카드에 마력 카운터를 1개 놓는다(최대 9개까지). ②: 이 카드의 마력 카운터를 3개 제거하고 발동할 수 있다. 이하의 효과에서 1개를 적용한다. ●덱에서 마법 카드 1장이나 마법사족 효과 몬스터 1장을 패에 넣는다. ●패 / 덱에서 마법사족 몬스터 1장을 특수 소환한다. ③: 이 카드가 파괴될 경우, 대신에 이 카드의 엑시즈 소재를 1개 제거할 수 있다.\"}',NULL,'UNCOMMON'),(1,36,'2025-09-16 16:37:43.182409',420,'2025-09-16 16:37:43.182409','DUNE-KR050','싱크로 오버톱','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지의 레벨 7 / 8 의 드래곤족 싱크로 몬스터를 임의의 수만큼 대상으로 하고 발동할 수 있다. 그 몬스터를 수비 표시로 특수 소환한다. 이 효과로 특수 소환한 몬스터의 레벨은 1 이 되고, 효과는 무효화된다. 이 턴에, 자신은 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 자신의 싱크로 몬스터가 전투로 파괴되었을 때, 묘지의 이 카드를 제외하고 발동할 수 있다. 엑스트라 덱에서 \\\"붉은 용\\\" 1장을 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,36,'2025-09-16 16:37:43.424342',421,'2025-09-16 16:37:43.424342','DUNE-KR051','싱크로 월드','{\"attribute\": \"마법\", \"card_text\": \"①: 몬스터가 싱크로 소환될 때마다 이 카드에 시그널 카운터를 2개 놓는다. ②: 자신 필드의 시그널 카운터를 이하의 수만큼 제거하고, 그 효과를 발동할 수 있다. ●4: 자신 필드의 앞면 표시 몬스터 1장의 레벨을 1개 올리거나 내린다. ●7: 자신 묘지에서 튜너 1장을 특수 소환한다. ●10: 자신 묘지에서 싱크로 몬스터 1장을 특수 소환한다. ③: 필드의 이 카드가 상대 효과로 파괴되었을 경우에 발동할 수 있다. 엑스트라 덱에서 \\\"붉은 용\\\" 1장을 특수 소환한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:43.682051',422,'2025-09-16 16:37:43.682051','DUNE-KR053','쥐라기 파워','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 공룡족 몬스터의 공격력은 300 올린다. ②: 자신은 레벨 5 이상의 공룡족 몬스터를 일반 소환할 경우에 필요한 릴리스를 없앨 수 있다. ③: 자신의 패 / 필드(앞면 표시)에서 공룡족 몬스터 1장을 묘지로 보내고 발동할 수 있다. 덱에서 수비력 1200 의 공룡족 몬스터 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:43.974532',423,'2025-09-16 16:37:43.974532','DUNE-KR055','신세괴＝암리타라','{\"attribute\": \"마법\", \"card_text\": \"필드에 \\\"비서스＝스타프로스트\\\"가 존재할 경우에 이 카드를 발동할 수 있다. ①: 1턴에 1번, 자신 필드의 몬스터가 전투 / 효과로 파괴되어, 묘지로 보내졌을 경우 또는 제외되었을 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●그 중의 1장을 자신 필드에 수비 표시로 특수 소환한다. ●그 중의 1장의 공격력의 절반만큼, 필드의 튜너 1장의 공격력을 올린다. ●그 중의 1장을 덱으로 되돌리고, 자신은 1장 드로우한다. ●이 카드를 덱으로 되돌리고, 자신 묘지에서 필드 마법 카드 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:44.353062',424,'2025-09-16 16:37:44.353062','DUNE-KR060','반역의 죄보－스네이크아이','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 지속 마법 카드로 취급하고 원래 주인의 마법 & 함정 존에 앞면 표시로 놓는다.\"}',NULL,'UNCOMMON'),(1,36,'2025-09-16 16:37:44.601175',425,'2025-09-16 16:37:44.601175','DUNE-KR066','억년의 빙묘','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 / 상대의 메인 페이즈에, 상대 몬스터의 효과에 의한, 파괴 이외의 방법으로, 자신 필드의 몬스터가 필드에서 벗어났을 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다.●이 메인 페이즈를 종료한다.●다음 상대 턴의 메인 페이즈 1 을 스킵한다.\"}',NULL,'UNCOMMON'),(1,36,'2025-09-16 16:37:44.842567',426,'2025-09-16 16:37:44.842567','DUNE-KR068','고철의 신상','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 묘지 / 제외 상태인 레벨 7 / 8 의 드래곤족 싱크로 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. 이 효과로 특수 소환한 몬스터는 엔드 페이즈에 엑스트라 덱으로 되돌아간다. 발동 후 이 카드는 묘지로 보내지 않으며, 그대로 세트한다. ②: 세트된 이 카드가 상대 효과로 파괴되었을 경우에 발동할 수 있다. 엑스트라 덱에서 \\\"붉은 용\\\" 1장을 특수 소환한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:45.101292',427,'2025-09-16 16:37:45.101292','DUNE-KR070','신세괴성겁','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: \\\"비서스＝스타프로스트\\\"의 카드명이 쓰여진 자신 묘지의 마법 / 함정 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 자신 필드에 세트한다. 속공 마법 / 함정 카드를 세트했을 경우, 그 카드는 세트한 턴에도 발동할 수 있다. ②: 묘지의 이 카드를 제외하고, \\\"신세괴성겁\\\"이 아닌, \\\"비서스＝스타프로스트\\\"의 카드명이 쓰여진 자신 묘지의 마법 / 함정 카드 3장을 대상으로 하여 발동할 수 있다. 그 카드를 덱으로 되돌린다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:45.333099',428,'2025-09-16 16:37:45.333099','DUNE-KR071','별이 가득한 신세괴','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"비서스＝스타프로스트\\\"가 존재하는 한, 자신 몬스터는 각각 1턴에 1번만 전투로는 파괴되지 않는다. ②: 자신 필드에 \\\"비서스＝스타프로스트\\\"가 존재할 경우, 자신 엔드 페이즈에, 자신 묘지의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 덱으로 되돌린다. 자신 필드에 싱크로 몬스터의 튜너가 존재할 경우, 덱으로 되돌리지 않고 패에 넣을 수도 있다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:45.606711',429,'2025-09-16 16:37:45.606711','DUNE-KR072','샤를의 서사시','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 패의 \\\"성검\\\" 장착 마법 카드 1장을 상대에게 보여주고, 패 / 덱에서 \\\"불꽃성기사\\\" 몬스터 1장을 특수 소환한다. 그 후, 보여준 카드를 그 몬스터에 장착하거나, 묘지로 보낸다. ②: 묘지의 이 카드를 제외하고, 자신 필드의 \\\"불꽃성기사제－샤를\\\" 1장을 대상으로 하여 발동할 수 있다. 패 / 덱에서 \\\"성기사\\\" 몬스터 1장을 고르고, 공격력 500 올리는 장착 마법 카드로 취급하여 대상 몬스터에 장착한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:45.844486',430,'2025-09-16 16:37:45.844486','DUNE-KR074','VV－마스터페이즈','{\"attribute\": \"함정\", \"card_text\": \"①: 1턴에 1번, 몬스터 존의 카드가 다른 몬스터 존으로 이동했을 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다.●자신 필드의 모든 레벨 5 이상의 \\\"밸리언츠\\\" 몬스터의 공격력은 턴 종료시까지 1200 올린다.●마법 & 함정 존의 앞면 표시의 이 카드를 묘지로 보내고, 상대의 메인 몬스터 존의 효과 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 상대 몬스터를 그것과 같은 세로열인 상대의 마법 & 함정 존에 지속 마법 카드로 취급하고 앞면 표시로 놓는다(놓을 곳에 있는 카드는 파괴된다).\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:46.027279',431,'2025-09-16 16:37:46.027279','DUNE-KR075','퓨어리 셰어리!?','{\"attribute\": \"함정\", \"card_text\": \"①: 자신 필드의 \\\"퓨어리\\\" 엑시즈 몬스터 1장을 대상으로 하고 발동할 수 있다. 덱에서 레벨 1 의 \\\"퓨어리\\\" 몬스터 1장을 효과를 무효로 하여 특수 소환하고, 대상 몬스터와는 속성이 다르며, 랭크가 같은 \\\"퓨어리\\\" 엑시즈 몬스터 1장을 그 특수 소환한 몬스터 위에 겹쳐 엑시즈 소환으로 취급하고 엑스트라 덱에서 특수 소환한다. 그 후, 이하의 효과를 적용할 수 있다.●대상 몬스터가 엑시즈 소재로 하고 있는 \\\"퓨어리\\\" 속공 마법 카드와 같은 이름의 카드 1장을 덱에서 고르고, 그 엑시즈 소환한 몬스터의 엑시즈 소재로 한다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:46.237620',432,'2025-09-16 16:37:46.237620','DUNE-KR079','저승의 맞거울','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 상대의 공격 / 효과로 자신이 데미지를 받았을 때에 발동할 수 있다. 받은 데미지의 종류에 따라 이하의 효과를 적용한다.●전투: 그 수치 이하의 공격력을 가지는 몬스터 1장을 자신 묘지에서 특수 소환하고, 그 데미지 스텝 종료 후에 배틀 페이즈를 종료한다.●효과: 그 수치의 배의 데미지를 상대에게 준다.\"}',NULL,'COMMON'),(1,36,'2025-09-16 16:37:46.432619',433,'2025-09-16 16:37:46.432619','DUNE-KR080','칼방','{\"attribute\": \"함정\", \"card_text\": \"①: 카드의 효과가 10회 이상 발동한 턴에 이 카드를 발동할 수 있다. 발동 후, 효과 몬스터(사이버스족 / 어둠 / 레벨 10 / 공 3000 / 수 3000)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다). 이 효과로 특수 소환한 이 카드는, 자신 엔드 페이즈에 자신의 마법 & 함정 존에 세트된다. ②: 1턴에 1번, 이 카드가 몬스터 존에 존재하고, 상대가 카드의 효과를 발동했을 때에 발동할 수 있다. 상대 필드의 카드를 전부 파괴한다. 그 후, 이 카드를 자신의 마법 & 함정 존에 세트한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:46.933289',434,'2025-09-16 16:37:46.933289','DUAD-KR012','아르토메기아의 감옥신수','{\"attribute\": \"땅\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 300\", \"deffence\": \"수비력 200\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신은 융합 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 자신 / 상대의 메인 페이즈에 발동할 수 있다. 필드의 이 카드를 포함하는 자신의 패 / 필드의 몬스터를 융합 소재로 하고, \\\"아르토메기아\\\" 융합 몬스터나 \\\"창감옥신 네르바\\\" 1장을 융합 소환한다. ③: 이 카드가 패 / 필드에서 묘지로 보내졌을 경우에 발동할 수 있다. 같은 이름의 카드가 자신 묘지에 존재하지 않는 \\\"아르토메기아\\\" 마법 / 함정 카드 1장을 덱에서 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,44,'2025-09-16 16:37:47.132048',435,'2025-09-16 16:37:47.132048','DUAD-KR014','과묵한 사이코 미니스터','{\"attribute\": \"땅\", \"type\": \"[사이킥족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 2100\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"과묵한 사이코 미니스터\\\" 이외의 사이킥족 몬스터가 존재할 경우, 이 카드는 패에서 수비 표시로 특수 소환할 수 있다. ②: 자신 묘지에서 이 카드와 사이킥족 몬스터 1장을 제외하고, 필드의 앞면 표시 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 엔드 페이즈까지 제외한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:47.496638',436,'2025-09-16 16:37:47.496638','DUAD-KR016','프로토타입 사이코거너','{\"attribute\": \"땅\", \"type\": \"[사이킥족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 패에서 버리고 발동할 수 있다. 자신의 패 / 제외 상태인 레벨 4 이하의 사이킥족 몬스터 1장을 특수 소환한다. ②: 이 카드가 묘지에 존재할 경우, 1000 LP를 지불하고, 자신 묘지에서 다른 사이킥족 몬스터 1장을 제외하여 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:47.862980',437,'2025-09-16 16:37:47.862980','DUAD-KR018','원 제왕종기 테세라','{\"attribute\": \"빛\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 800\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 패의 \\\"제왕\\\" 마법 / 함정 카드 1장을 상대에게 보여주고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 자신 메인 페이즈에 발동할 수 있다. 몬스터 1장의 어드밴스 소환을 실행한다. ③: 이 카드가 묘지로 보내졌을 경우에 발동할 수 있다. 덱에서 공격력 800 / 수비력 1000 인 몬스터 1장을 특수 소환한다. 이 효과의 발동 후, 턴 종료시까지 자신은 엑스트라 덱에서 몬스터를 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:48.337412',438,'2025-09-16 16:37:48.337412','DUAD-KR027','검은 마족－레오 위저드','{\"attribute\": \"어둠\", \"type\": \"[마법사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1350\", \"deffence\": \"수비력 1200\", \"card_text\": \"이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 양쪽 플레이어는, 원래의 레벨이 4 이하이고 공격력이나 수비력이 1350 보다 큰 몬스터를 패에서 일반 소환할 경우, 몬스터 1장을 릴리스하여 어드밴스 소환해야 한다. ②: 이 카드가 빛 속성 몬스터와 전투를 실행하는 데미지 스텝 개시시에 발동할 수 있다. 그 몬스터를 파괴한다. ③: 이 카드가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 덱에서 공격력 1350 인 몬스터 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:48.987752',439,'2025-09-16 16:37:48.987752','DUAD-KR036','시조의 용왕','{\"attribute\": \"어둠\", \"type\": \"[드래곤족／융합／효과]\", \"level\": \"레벨 11\", \"attack\": \"공격력 3700\", \"deffence\": \"수비력 3000\", \"card_text\": \"일반 몬스터 × 3이 카드는 융합 소환으로밖에 특수 소환할 수 없다. 이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: \\\"시조의 용왕\\\"은 자신 필드에 1장밖에 앞면 표시로 존재할 수 없다. ②: 이 카드는 몬스터 존에 존재하는 한, 전투로는 파괴되지 않으며, 다른 몬스터의 효과를 받지 않는다. ③: 이 카드가 앞면 표시로 존재하는 한 1번만, 마법 / 함정 카드의 효과가 발동했을 때에 발동할 수 있다. 필드의 마법 / 함정 카드를 전부 파괴한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:49.189549',440,'2025-09-16 16:37:49.189549','DUAD-KR038','침묵의 사이코 매지션','{\"attribute\": \"땅\", \"type\": \"[사이킥족／싱크로／튜너／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 500\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 특수 소환했을 경우, 자신의 묘지 / 제외 상태인 레벨 4 이하의 사이킥족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. 그 후, 그 몬스터의 레벨을 1개 올릴 수 있다. 이 턴에, 자신은 사이킥족 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 자신 필드의 이 카드를 싱크로 소재로 할 경우, 이 카드를 튜너 이외의 몬스터로 취급할 수 있다.\"}',NULL,'UNCOMMON'),(1,44,'2025-09-16 16:37:49.428694',441,'2025-09-16 16:37:49.428694','DUAD-KR039','멘탈크로스 데몬','{\"attribute\": \"어둠\", \"type\": \"[사이킥족／싱크로／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2800\", \"card_text\": \"사이킥족 튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에, 자신의 제외 상태인 레벨 7 이하의 사이킥족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. ②: 자신 / 상대의 배틀 페이즈에, 자신 필드의 다른 몬스터 1장을 릴리스하고 발동할 수 있다. 그 몬스터의 원래 공격력만큼만 자신의 LP를 회복하고, 그 수치만큼만 이 카드의 공격력을 턴 종료시까지 올린다.\"}',NULL,'UNCOMMON'),(1,44,'2025-09-16 16:37:49.662647',442,'2025-09-16 16:37:49.662647','DUAD-KR040','사이코거너 Mk－Ⅱ','{\"attribute\": \"땅\", \"type\": \"[사이킥족／싱크로／효과]\", \"level\": \"레벨 9\", \"attack\": \"공격력 3200\", \"deffence\": \"수비력 2700\", \"card_text\": \"사이킥족 튜너 ＋ 튜너 이외의 사이킥족 몬스터 1장 이상이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신이나 상대의 제외 상태인 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 자신 필드에 특수 소환한다. ②: 자신 / 상대의 메인 페이즈에, 자신 묘지에서 몬스터 1장을 제외하고, 필드의 다른 앞면 표시 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 제외한다. 그 후, 제외한 몬스터의 원래 공격력만큼만 자신의 LP를 회복한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:50.149676',443,'2025-09-16 16:37:50.149676','DUAD-KR046','VS 록스','{\"attribute\": \"어둠\", \"type\": \"[화염족／엑시즈／효과]\", \"rank\": \"랭크 4\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 2500\", \"card_text\": \"레벨 4 \\\"VS(뱅키시 소울)\\\" 몬스터 × 2장 이상\\\"VS(뱅키시 소울) 록스\\\"는, \\\"VS(뱅키시 소울)\\\" 몬스터가 전투를 실행한 턴에 1번, 자신 필드의 \\\"VS(뱅키시 소울)\\\" 몬스터나 \\\"록 오브 뱅키셔\\\" 위에 겹쳐 엑시즈 소환할 수도 있다. ①: 이 카드가 엑시즈 소재로 하고 있는 몬스터의 속성에 따라, 이 카드는 이하의 효과를 얻는다. ●어둠: 상대 필드의 몬스터의 공격력은 800 내린다. ●화염: 자신 필드의 \\\"VS(뱅키시 소울)\\\" 몬스터의 공격력은 1000 올린다. ●땅: 이 카드의 엑시즈 소재를 1개 제거하고 발동할 수 있다. 상대 필드의 카드 1장을 파괴한다.\"}',NULL,'UNCOMMON'),(1,44,'2025-09-16 16:37:50.497774',444,'2025-09-16 16:37:50.497774','DUAD-KR048','초념총사 발롱','{\"attribute\": \"어둠\", \"type\": \"[사이킥족／엑시즈／효과]\", \"rank\": \"랭크 5\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2200\", \"card_text\": \"레벨 5 몬스터 × 2이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에, 이 카드의 엑시즈 소재를 1개 제거하고, 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 뒷면 수비 표시로 한다. ②: 이 카드가 묘지로 보내졌을 경우, 필드의 뒷면 표시 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'UNCOMMON'),(1,44,'2025-09-16 16:37:50.837736',445,'2025-09-16 16:37:50.837736','DUAD-KR052','가가가 호프 택틱스','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 원래 속성이 빛 속성인 \\\"유토피아\\\"나 \\\"호프\\\" 엑시즈 몬스터는 효과로는 파괴되지 않으며, 상대는 그 몬스터들을 효과의 대상으로 할 수 없다. ②: 1~12 까지의 임의의 레벨을 선언하고, \\\"가가가\\\" 몬스터를 포함하는 자신 필드의 앞면 표시 몬스터 2장을 대상으로 하여 발동할 수 있다. 그 몬스터의 레벨을 선언한 레벨로 한다. ③: 원래의 속성이 빛 속성인 \\\"유토피아\\\"나 \\\"호프\\\" 엑시즈 몬스터를 자신이 엑시즈 소환했을 경우, 상대 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:51.177074',446,'2025-09-16 16:37:51.177074','DUAD-KR055','테오리얼라이즈','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 덱에서 \\\"무구한 자 메디우스\\\" 1장을 묘지로 보내고 발동할 수 있다. 상대의 덱 맨 위의 카드를 확인하고, 덱 맨 위나 맨 아래로 되돌린다. ②: 묘지의 이 카드를 제외하고, 자신 필드의 앞면 표시 몬스터 1장을 대상으로 하여, 종족과 속성을 1개씩 선언하고 발동할 수 있다. 그 몬스터는 상대 턴 종료시까지, 선언한 종족 / 속성이 된다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:51.380399',447,'2025-09-16 16:37:51.380399','DUAD-KR056','아르토메기아 마스터워크 －계승－','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에 발동할 수 있다. \\\"아르토메기아\\\" 몬스터를 포함하는 자신의 패 / 필드의 몬스터를 융합 소재로 하고, 융합 몬스터 1장을 융합 소환한다. 필드 존에 카드가 존재할 경우, 추가로 이 효과로 특수 소환한 몬스터의 공격력은 500 올린다. ②: 자신 메인 페이즈에 묘지의 이 카드를 제외하고, 자신 묘지의 \\\"아르토메기아\\\" 카드 3장을 대상으로 하여 발동할 수 있다(같은 이름의 카드는 1장까지). 그 카드를 덱으로 되돌린다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:51.680808',448,'2025-09-16 16:37:51.680808','DUAD-KR058','아르토메기아 버니시 －개변－','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 덱 / 묘지에서 \\\"신예학도 아르토메기아\\\" 1장을 자신의 필드 존에 앞면 표시로 놓는다. 자신 필드에 \\\"신예학도 아르토메기아\\\"가 존재할 경우, 대신에 덱에서 \\\"아르토메기아 버니시 －개변－\\\" 이외의 \\\"아르토메기아\\\" 카드 1장을 패에 넣는다. ②: 자신의 \\\"아르토메기아\\\" 몬스터가 공격 대상으로 선택되었을 때, 묘지의 이 카드를 제외하고 발동할 수 있다. 그 공격을 무효로 한다. 그 후, 패에서 \\\"무구한 자 메디우스\\\" 1장을 특수 소환할 수 있다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:52.081911',449,'2025-09-16 16:37:52.081911','DUAD-KR060','텔레포트 퓨전','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에 발동할 수 있다. 자신의 필드 / 묘지의 사이킥족 몬스터를 융합 소재로서 제외하고, 사이킥족의 융합 몬스터 1장을 융합 소환한다. ②: 엑스트라 덱에서 특수 소환된 자신 필드의 앞면 표시의 사이킥족 몬스터가 전투 / 효과로 파괴되었을 경우, 묘지의 이 카드를 제외하고, 자신의 제외 상태인 사이킥족 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:52.379146',450,'2025-09-16 16:37:52.379146','DUAD-KR061','제왕의 책략','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 덱에서 \\\"제왕의 책략\\\" 이외의 \\\"제왕\\\" 마법 / 함정 카드 1장을 묘지로 보낸다. ②: 이 카드가 제외되었을 경우, 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 속성이 그 몬스터와 같고 공격력 2400 / 수비력 1000 인 몬스터 1장을 자신의 덱 / 묘지에서 패에 넣는다. 그 후, 이하의 효과를 적용할 수 있다. ●\\\"번개 제왕 자보르그\\\" \\\"빙제 뫼비우스\\\" \\\"화염 제왕 테스탈로스\\\" \\\"땅의 제왕 그란마그\\\" \\\"바람 제왕 라이저\\\" \\\"사 제왕 가이우스\\\" 중 어느 1장의 일반 소환을 실행한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:53.079797',451,'2025-09-16 16:37:53.079797','DUAD-KR066','Start for VS!','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 \\\"VS(뱅키시 소울)\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터와는 속성이 다른 \\\"VS(뱅키시 소울)\\\" 몬스터 1장을 덱에서 패에 넣는다. ②: 자신 필드의 \\\"VS(뱅키시 소울)\\\" 몬스터가 전투 / 효과로 파괴될 경우, 대신에 패의 \\\"VS(뱅키시 소울)\\\" 몬스터 1장을 보여줄 수 있다. ③: 자신 엔드 페이즈에, 자신 필드에 \\\"VS(뱅키시 소울)\\\" 몬스터가 2장 이상 존재할 경우에 발동할 수 있다. 덱에서 \\\"VS(뱅키시 소울)\\\" 함정 카드 1장을 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:53.329879',452,'2025-09-16 16:37:53.329879','DUAD-KR068','제19레이어 『습래간섭! 칠흑의 초량사!!』','{\"attribute\": \"마법\", \"card_text\": \"①: 이하의 효과에서 1개를 선택하고 발동할 수 있다(이 카드명의 이하의 효과는 각각 1턴에 1번밖에 선택할 수 없다). ●필드의 공격 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 수비 표시로 한다. ●자신 필드에 \\\"초량\\\" 몬스터가 존재할 경우에 발동할 수 있다. 원래의 속성이 같은 몬스터가 자신 필드에 존재하지 않는 \\\"초량\\\" 몬스터 1장을 덱에서 수비 표시로 특수 소환한다. ●덱에서 \\\"초량\\\" 함정 카드 1장을 자신 필드에 세트한다. 이 효과로 세트한 카드는 세트한 턴에도 발동할 수 있다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:53.537945',453,'2025-09-16 16:37:53.537945','DUAD-KR071','리턴 오브 더 듀얼리스트','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 필드 또는 자신이나 상대 묘지에 엑시즈 몬스터가 존재할 경우에 발동할 수 있다. 자신의 덱 / 묘지에서 장착 마법 카드 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,44,'2025-09-16 16:37:53.701861',454,'2025-09-16 16:37:53.701861','DUAD-KR076','제왕의 극치','{\"attribute\": \"함정\", \"card_text\": \"①: 상대가 몬스터를 특수 소환했을 경우에 1번, 자신 필드에 어드밴스 소환한 몬스터가 존재하고 있으면, 자신 묘지에서 \\\"제왕\\\" 마법 / 함정 카드 1장을 제외하고, 이하에서 1개를 선택하여 발동할 수 있다(이 카드명의 이하의 효과는 각각 1턴에 1번밖에 선택할 수 없다). ●필드의 몬스터 1장을 파괴한다. ●필드의 마법 / 함정 카드를 2장까지 파괴한다. ●상대의 패를 무작위로 1장 버린다. ●필드의 뒷면 표시 카드 1장을 파괴한다. ●필드의 카드 1장을 덱 맨 위로 되돌린다. ●필드의 카드 1장을 제외한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:54.433563',455,'2025-09-16 16:37:54.433563','LEDE-KR008','앤틱 기어 커맨더','{\"attribute\": \"땅\", \"type\": \"[기계족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 덱 / 필드(앞면 표시)에서 \\\"앤틱 기어 골렘\\\" 1장을 묘지로 보내고 발동할 수 있다. \\\"앤틱 기어\\\" 몬스터 1장의 일반 소환을 실행한다. ②: 자신이 \\\"앤틱 기어 골렘\\\"을 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 자신의 패 / 묘지에서 \\\"앤틱 기어 골렘\\\" 1장을 소환 조건을 무시하고 특수 소환한다. ③: 묘지의 이 카드를 제외하고 발동할 수 있다. 패에서 \\\"앤틱 기어\\\" 지속 함정 카드 1장을 자신 필드에 앞면 표시로 놓는다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:54.740487',456,'2025-09-16 16:37:54.740487','LEDE-KR009','환주의 가희 르프랭','{\"attribute\": \"빛\", \"type\": \"[천사족／펜듈럼／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 800\", \"card_text\": \"이 카드명의 ①②의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"환주의 가희 르프랭\\\" 이외의 \\\"환주\\\" 몬스터 1장을 패에 넣는다. ②: 이 카드가 엑스트라 덱에 앞면으로 존재하는 상태에서, 자신 필드에 \\\"환주\\\" 융합 몬스터가 특수 소환되었을 경우에 발동할 수 있다. 이 카드를 자신의 펜듈럼 존에 놓는다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:37:54.910432',457,'2025-09-16 16:37:54.910432','LEDE-KR010','환주의 가희 쿠플레','{\"attribute\": \"빛\", \"type\": \"[천사족／펜듈럼／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 1200\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①②의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 드로우 이외의 방법으로 패에 넣어졌을 경우, 이 카드를 상대에게 보여주고 발동할 수 있다. 자신의 패 / 묘지에서 레벨 4 이하의 \\\"환주\\\" 몬스터 1장을 특수 소환한다. ②: 이 카드가 엑스트라 덱에 앞면으로 존재하는 상태에서, 자신 필드에 \\\"환주\\\" 융합 몬스터가 특수 소환되었을 경우에 발동할 수 있다. 이 카드를 자신의 펜듈럼 존에 놓는다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:55.332183',458,'2025-09-16 16:37:55.332183','LEDE-KR023','드래곤 오브 라이트로드','{\"attribute\": \"빛\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1300\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지에 \\\"라이트로드\\\" 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"드래곤 오브 라이트로드\\\" 이외의 \\\"라이트로드\\\" 카드 1장을 묘지로 보낸다. ③: 이 카드가 묘지로 보내졌을 경우에 발동할 수 있다. 덱에서 공격력 3000 / 수비력 2600 의 드래곤족 몬스터 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:55.576655',459,'2025-09-16 16:37:55.576655','LEDE-KR025','저주받은 하인 로드','{\"attribute\": \"빛\", \"type\": \"[언데드족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 300\", \"deffence\": \"수비력 200\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 카드명은, 묘지에 존재하는 한 \\\"저주받은 하인\\\"으로 취급한다. ②: 자신 묘지에 \\\"저주받은 하인\\\"이나 \\\"저주받은 하인 킹\\\"이 존재할 경우, 패 / 필드의 이 카드를 묘지로 보내고 발동할 수 있다. 자신 묘지의 \\\"저주받은 하인\\\" \\\"저주받은 하인 킹\\\"의 수까지, 자신의 덱 위에서 카드를 묘지로 보낸다. ③: 묘지의 이 카드를 제외하고, 자신 묘지의, \\\"저주받은 하인\\\"이나 \\\"저주받은 하인 킹\\\" 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:55.818557',460,'2025-09-16 16:37:55.818557','LEDE-KR026','강철의 대마인 골고일','{\"attribute\": \"땅\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 10\", \"attack\": \"공격력 1800\", \"deffence\": \"수비력 3200\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다. ②: 자신의 기계족 / 환상마족 몬스터가 전투를 실행한 데미지 계산 후, 자신의 묘지 / 제외 상태인 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. ③: 이 카드가 필드에서 제외되었을 경우에 발동할 수 있다. 이 카드를 특수 소환한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:56.076885',461,'2025-09-16 16:37:56.076885','LEDE-KR028','탈론즈 오브 슈리렌','{\"attribute\": \"빛\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 2050\", \"card_text\": \"이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 상대 턴에, \\\"탈론즈 오브 슈리렌\\\" 이외의 자신 필드의 악마족 / 환상마족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 패로 되돌리고, 이 카드를 패에서 특수 소환한다. ②: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다. ③: 자신의 카드를 대상으로 하는 효과를 상대가 발동했을 때, 상대 필드의 몬스터 1장을 대상으로 하고 발동할 수 있다. 필드의 이 카드를 패로 되돌리고, 그 몬스터를 파괴한다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:37:56.441817',462,'2025-09-16 16:37:56.441817','LEDE-KR031','원환 요정 키클로스','{\"attribute\": \"바람\", \"type\": \"[식물족／튜너／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우, 패를 1장 버리고 발동할 수 있다. 덱에서 \\\"원환 요정 키클로스\\\" 이외의 곤충족 / 식물족 튜너 1장을 패에 넣는다. ②: 이 카드가 묘지에 존재하는 상태에서, 곤충족 / 식물족 싱크로 몬스터가 특수 소환되었을 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:56.674516',463,'2025-09-16 16:37:56.674516','LEDE-KR032','피시보그－하프너','{\"attribute\": \"물\", \"type\": \"[어류족／튜너／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 400\", \"deffence\": \"수비력 400\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 패의 이 카드와 패의 물 속성 몬스터 1장을 상대에게 보여주고 발동할 수 있다. 그 2장 중 1장을 특수 소환하고, 나머지 1장을 버린다. ②: 이 카드가 물 속성 싱크로 몬스터의 싱크로 소재로서 묘지로 보내졌을 경우에 발동할 수 있다. 상대 필드의 효과 몬스터 1장의 효과를 턴 종료시까지 무효로 한다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:37:56.896586',464,'2025-09-16 16:37:56.896586','LEDE-KR033','사그라지는 불','{\"attribute\": \"화염\", \"type\": \"[화염족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 1500\", \"card_text\": \"①: 자신이나 상대의 LP가 회복했을 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 1턴에 1번, 이 카드가 몬스터 존에 존재하는 상태에서, 자신이나 상대의 LP가 회복했을 경우에 발동할 수 있다. 자신이나 상대의 LP를 1000 회복한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:57.089447',465,'2025-09-16 16:37:57.089447','LEDE-KR034','순성한 용신 사피라','{\"attribute\": \"빛\", \"type\": \"[드래곤족／의식／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2550\", \"deffence\": \"수비력 2450\", \"card_text\": \"순성한 축복에 의해 의식 소환이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 의식 소환했을 경우, 자신의 필드나 묘지에 \\\"순성의 기도하는 손 로\\\"가 존재하면 발동할 수 있다. 자신은 2장 드로우한다. 그 후, 자신의 패를 1장 고르고 버린다. ②: 전사족 / 드래곤족이고 빛 속성인 의식 몬스터가 전투를 실행하는 공격 선언시에 발동할 수 있다. 상대의 패를 무작위로 1장 버린다. ③: 상대 엔드 페이즈에 발동할 수 있다. 자신 묘지에서 빛 속성 몬스터 1장을 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:37:57.374482',466,'2025-09-16 16:37:57.374482','LEDE-KR035','환주의 음희 스펙타큘러 바흐','{\"attribute\": \"빛\", \"type\": \"[천사족／융합／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 1800\", \"card_text\": \"환주 몬스터 × 2이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"환주\\\" 몬스터 1장을 특수 소환한다. ②: 융합 소환한 이 카드가 몬스터 존에 존재하는 한, 자신의 \\\"환주\\\" 융합 몬스터가 발동한 효과는 무효화되지 않는다. ③: 이 카드가 묘지로 보내졌을 경우, \\\"환주의 음희 스펙타큘러 바흐\\\" 이외의 자신 묘지의 \\\"환주\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 수비 표시로 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:37:58.283542',467,'2025-09-16 16:37:58.283542','LEDE-KR052','시간의 침묵－턴 사일렌스','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 레벨을 3개 올린다. 자신 필드에 \\\"빛의 황금궤\\\" 및 그 카드명이 쓰여진 몬스터가 존재하는 상태에서, 상대 몬스터의 효과 발동에 체인하여 이 카드를 발동했을 경우, 그 상대의 효과를 무효로 한다. ②: \\\"빛의 황금궤\\\"의 카드명이 쓰여진 자신 몬스터가 전투를 실행하는 데미지 계산시에, 묘지의 이 카드를 제외하고 발동할 수 있다. 그 배틀 페이즈를 종료한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:58.595264',468,'2025-09-16 16:37:58.595264','LEDE-KR053','동료의 연','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드에 \\\"빛의 황금궤\\\" 및 그 카드명이 쓰여진 몬스터가 존재할 경우에 발동할 수 있다. \\\"빛의 황금궤\\\"의 카드명이 쓰여진 레벨 4 이하의 몬스터를 패 / 덱에서 2장까지 특수 소환한다(같은 이름의 카드는 1장까지). 이 카드의 발동 후, 턴 종료시까지 자신은 엑스트라 덱에서 몬스터를 특수 소환할 수 없다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:37:58.910264',469,'2025-09-16 16:37:58.910264','LEDE-KR055','앤틱 기어 어드밴스','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드를 발동하는 턴에, 자신은 카드를 세트할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"앤틱 기어 어드밴스\\\" 이외의 \\\"앤틱 기어\\\" 마법 / 함정 카드 1장을 패에 넣는다. ②: 1턴에 1번, 자신 필드의 몬스터 1장을 릴리스하고 발동할 수 있다. 자신은 1장 드로우하고, 이 턴 중에, 이하의 효과를 적용한다. ●자신은 \\\"앤틱 기어 골렘\\\" 또는 그 카드명이 쓰여진 레벨 5 이상의 몬스터를 일반 소환할 경우에 필요한 릴리스를 없앨 수 있다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:37:59.148444',470,'2025-09-16 16:37:59.148444','LEDE-KR056','환주협주곡','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 필드의 몬스터를 융합 소재로 하고, 천사족의 융합 몬스터 1장을 융합 소환한다. 그 시기에, 자신의 펜듈럼 존에 존재하는 융합 소재 몬스터도 융합 소재로 사용할 수 있다. ②: 이 카드가 묘지에 존재하는 상태에서, \\\"환주\\\" 융합 몬스터가 자신 묘지로 보내졌을 경우에 발동할 수 있다(데미지 스텝에도 발동 가능). 이 카드를 덱 맨 아래로 되돌린다. 그 후, 자신은 1장 드로우한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:59.491848',471,'2025-09-16 16:37:59.491848','LEDE-KR062','순성한 축복','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: \\\"순성한 축복\\\" 이외의 자신의 묘지 / 제외 상태인 \\\"순성\\\" 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 패에 넣는다. ②: 의식 몬스터 이외의 몬스터가 앞면 표시로 일반 소환 / 특수 소환되었을 경우에 발동할 수 있다. 레벨의 합계가 의식 소환할 몬스터의 레벨 이상이 되도록, 자신의 패 / 필드의 몬스터를 릴리스하고, 패에서 전사족 / 드래곤족이고 빛 속성인 의식 몬스터 1장을 의식 소환한다. 이 효과로 특수 소환한 몬스터는 전투로는 파괴되지 않는다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:59.735764',472,'2025-09-16 16:37:59.735764','LEDE-KR064','웨이크업 센츄리온!','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 마법 & 함정 존에 앞면 표시로 몬스터 카드가 존재할 경우, 4 나 8 의 레벨을 선언하고 발동할 수 있다. 선언한 레벨을 가지는 \\\"센츄리온 토큰\\\"(화염족 / 어둠 / 공 0 / 수 0) 1장을 자신 필드에 특수 소환한다. 이 토큰은 융합 / 링크 소재로 할 수 없다. ②: 자신 메인 페이즈에 묘지의 이 카드를 제외하고 발동할 수 있다. 덱에서 \\\"웨이크업 센츄리온!\\\" 이외의 \\\"센츄리온\\\" 카드 1장을 묘지로 보낸다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:37:59.913177',473,'2025-09-16 16:37:59.913177','LEDE-KR067','구하면 얻으리라','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 양쪽 플레이어는, 자신 메인 페이즈에 발동할 수 있다. 상대 필드의 카드의 수까지 자신의 덱 위에서 카드를 넘기고, 그 중에서 1장을 골라 패에 넣는다. 그 후, 남은 카드 및 자신의 패 1장을 좋아하는 순서대로 덱 아래로 되돌린다. ②: 이 카드의 ①의 효과로 1번에 9장 이상 넘긴 플레이어는, 그 턴의 엔드 페이즈에 발동할 수 있다. 상대의 필드 / 묘지의 카드를 전부 덱으로 되돌린다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:38:00.133019',474,'2025-09-16 16:38:00.133019','LEDE-KR070','눈길위새긴 발자욱따라밟는 성긴한걸음','{\"attribute\": \"마법\", \"card_text\": \"①: \\\"눈길위새긴 발자욱따라밟는 성긴한걸음\\\" 이외의 카드가 묘지로 보내졌을 경우에 발동할 수 있다. 자신 묘지의 카드를 5장까지 뒷면으로 제외한다. 그 후, 자신의 제외 상태인 뒷면 카드가 7장 이상 존재할 경우, 상대는 자신 묘지의 카드를 5장까지 가능한 한 고르고 뒷면으로 제외한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:38:00.323270',475,'2025-09-16 16:38:00.323270','LEDE-KR071','비밀요새 스트롱 홀드','{\"attribute\": \"함정\", \"card_text\": \"①: 이 카드는 발동 후, 이하의 효과를 가지는 효과 몬스터(기계족 / 땅 / 레벨 4 / 공 0 / 수 2000)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다).●이 카드의 공격력은, 자신 필드의, \\\"빛의 황금궤\\\" 및 그 카드명이 쓰여진 몬스터의 수 × 1000 올린다.●1턴에 1번, 자신 필드에 \\\"빛의 황금궤\\\"가 존재할 경우, 상대 몬스터의 공격 선언시에 발동할 수 있다. 그 몬스터를 파괴한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:38:00.508451',476,'2025-09-16 16:38:00.508451','LEDE-KR075','졸음의 죄보－모리안','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 필드의 특수 소환된 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 뒷면 수비 표시로 한다. ②: 이 카드가 묘지에 존재하고, 자신 필드에 레벨 5 이상의 환상마족 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다. 이 효과로 세트한 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:38:00.732695',477,'2025-09-16 16:38:00.732695','LEDE-KR077','라이트로드 아이기스','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 \\\"라이트로드\\\" 몬스터의 수까지, 상대 필드의 앞면 표시 카드를 대상으로 하고 발동할 수 있다. 그 카드의 효과를 턴 종료시까지 무효로 한다. ②: 이 카드가 덱에서 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,39,'2025-09-16 16:38:00.964758',478,'2025-09-16 16:38:00.964758','LEDE-KR078','현혹의 베리어 －미라지 포스－','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대 몬스터의 공격 선언시에 발동할 수 있다. 자신의 패 / 묘지에서 환상마족 몬스터 1장을 특수 소환하고, 그 공격 몬스터를 패로 되돌린다. ②: 이 카드가 묘지에 존재하는 상태에서, 자신 필드의 앞면 표시의 환상마족 몬스터가 상대 효과로 필드에서 벗어났을 경우, 이 카드를 제외하고 발동할 수 있다. 자신의 패 / 묘지에서 환상마족 몬스터 1장을 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,39,'2025-09-16 16:38:01.215789',479,'2025-09-16 16:38:01.215789','LEDE-KR079','지박사령 조마','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드는 발동 후, 이하의 효과를 가지는 효과 몬스터(언데드족 / 어둠 / 레벨 4 / 공 1800 / 수 500)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다). ●공격 가능한 상대 몬스터는 이 카드를 공격해야 한다. ②: 이 카드의 효과로 특수 소환한 이 카드가 상대 몬스터의 공격으로 파괴되었을 경우에 발동한다. 이 카드를 파괴한 몬스터의 원래 공격력의 배의 수치만큼 상대에게 데미지를 준다(최대 3000 까지).\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:01.654244',480,'2025-09-16 16:38:01.654244','ROTA-KR003','아머드 샤크','{\"attribute\": \"물\", \"type\": \"[어류족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명은 룰상 \\\"아머드 엑시즈\\\" 카드로도 취급한다. 이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 엑스트라 덱에서 물 속성 엑시즈 몬스터 1장을 묘지로 보내고, 그 랭크의 수치와 같은 레벨을 가지는 자신 묘지의 어류족 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다. ②: 상대 턴에, 이 카드가 묘지에 존재할 경우, 자신 필드의 물 속성 엑시즈 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 공격력 500 올리는 장착 마법 카드로 취급하고 그 몬스터에 장착한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:02.201547',481,'2025-09-16 16:38:02.201547','ROTA-KR007','악마수 데블 조아','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2600\", \"deffence\": \"수비력 1900\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 상대 필드에 몬스터가 존재할 경우, 이 카드는 릴리스 없이 일반 소환할 수 있다. ②: 이 카드가 패에 존재할 경우에 발동할 수 있다. 이 카드를 수비 표시로 특수 소환한다. 자신 묘지에 \\\"메탈화 강화반사장갑\\\"이 존재하지 않을 경우, 추가로 상대는 자신의 패에서 몬스터 1장을 특수 소환할 수 있다. ③: 자신 메인 페이즈에 발동할 수 있다. 덱에서 \\\"메탈화\\\" 함정 카드 1장을 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:02.440171',482,'2025-09-16 16:38:02.440171','ROTA-KR009','B·F－맹격의 레이피어','{\"attribute\": \"바람\", \"type\": \"[곤충족／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 1900\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 앞면 표시 몬스터가, 존재하지 않을 경우 또는 곤충족 몬스터뿐일 경우, 패에서 다른 곤충족 몬스터 1장을 버리고 발동할 수 있다. 덱에서 \\\"B·F·W(비 포스 윈드)\\\" 1장을 자신의 마법 & 함정 존에 앞면 표시로 놓는다. 그 후, 이 카드를 패에서 특수 소환한다. 이 턴에, 자신은 곤충족 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 묘지의 이 카드를 제외하고 발동할 수 있다. 자신 필드의 곤충족 몬스터 1장의 레벨을 1개 내린다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:02.619593',483,'2025-09-16 16:38:02.619593','ROTA-KR010','Em 볼 라이더','{\"attribute\": \"땅\", \"type\": \"[마법사족／펜듈럼／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명의 ①②③의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"Em(엔터메이지)\\\" 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 일반 소환 / 특수 소환했을 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●덱에서 \\\"Em(엔터메이지)\\\" 펜듈럼 몬스터 1장을 엑스트라 덱에 앞면으로 넣는다. ●자신 필드의 \\\"Em(엔터메이지)\\\" 몬스터 카드 1장을 파괴한다. ③: 특수 소환된 상대 몬스터의 직접 공격 선언시에 발동할 수 있다. 이 카드를 묘지에서 특수 소환한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:03.045260',484,'2025-09-16 16:38:03.045260','ROTA-KR016','센츄리온 시메리아','{\"attribute\": \"어둠\", \"type\": \"[화염족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1200\", \"deffence\": \"수비력 1600\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 체인 2 이후에 상대가 몬스터의 효과를 발동했을 때에 발동할 수 있다. 그 효과는 \\\"상대는 자신의 필드(앞면 표시) / 묘지의 \\\"센츄리온\\\" 몬스터 1장을 지속 함정 카드로 취급하고 자신의 마법 & 함정 존에 앞면 표시로 놓는다\\\"가 된다. 이 턴에, 자신은 \\\"센츄리온 시메리아\\\"를 특수 소환할 수 없다. ②: 이 카드를 지속 함정 카드로 취급할 경우, 자신 / 상대의 메인 페이즈에 발동할 수 있다. 이 카드를 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:03.581894',485,'2025-09-16 16:38:03.581894','ROTA-KR019','여섯 무사의 파계승','{\"attribute\": \"어둠\", \"type\": \"[전사족／튜너／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"여섯 무사의 파계승\\\" 이외의 \\\"여섯 무사\\\" 몬스터가 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 이 카드가 필드에서 묘지로 보내졌을 경우에 발동할 수 있다. 덱에서 \\\"여섯 무사\\\" 속공 마법 카드 1장을 패에 넣는다. ③: 이 카드를 소재로서 싱크로 소환한 \\\"여섯 무사\\\" 몬스터는 이하의 효과를 얻는다. ●상대 필드의 몬스터의 레벨은 1개 내려간다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:03.800730',486,'2025-09-16 16:38:03.800730','ROTA-KR020','여섯 무사의 지남번','{\"attribute\": \"땅\", \"type\": \"[전사족／튜너／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 200\", \"deffence\": \"수비력 1200\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"여섯 무사의 지남번\\\" 이외의 \\\"여섯 무사\\\" 몬스터가 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 이 카드가 필드에서 묘지로 보내졌을 경우에 발동할 수 있다. 자신의 덱 / 묘지에서 \\\"여섯 무식\\\" 카드 1장을 패에 넣는다. ③: 이 카드를 소재로서 싱크로 소환한 \\\"여섯 무사\\\" 몬스터는 이하의 효과를 얻는다. ●상대 필드의 몬스터의 공격력은 500 내린다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:04.081328',487,'2025-09-16 16:38:04.081328','ROTA-KR021','타르타로스의 회신','{\"attribute\": \"땅\", \"type\": \"[언데드족／효과]\", \"level\": \"레벨 9\", \"attack\": \"공격력 2600\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 이 카드가 덱에서 묘지로 보내졌을 경우에 발동한다(이 효과의 발동에 대하여 양쪽 플레이어는 몬스터의 효과를 발동할 수 없다). 자신 필드의 카드를 전부 묘지로 보내고, 이 카드를 특수 소환한다. 그 후, 이 효과로 묘지로 보낸 카드의 수까지 상대 필드의 카드를 묘지로 보낸다. ②: 이 카드가 덱 이외에서 묘지로 보내졌을 경우, 패를 1장 묘지로 보내고 발동할 수 있다. 필드의 카드 1장을 묘지로 보낸다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:04.487381',488,'2025-09-16 16:38:04.487381','ROTA-KR032','아자미나 솔 에리시크톤','{\"attribute\": \"어둠\", \"type\": \"[환상마족／융합／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2700\", \"deffence\": \"수비력 0\", \"card_text\": \"환상마족 몬스터 ＋ 악마족 몬스터이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 융합 소환했을 경우, 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 묘지로 보낸다. ②: 자신 / 상대의 스탠바이 페이즈에, 자신 묘지의, \\\"아자미나\\\" 카드나 \\\"죄보\\\" 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:04.723320',489,'2025-09-16 16:38:04.723320','ROTA-KR034','공극의 원성룡','{\"attribute\": \"빛\", \"type\": \"[드래곤족／융합／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2500\", \"card_text\": \"빛 / 어둠 속성 드래곤족 몬스터 ＋ 드래곤족 몬스터이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 융합 소환했을 경우, 그 융합 소재로 한 자신의 빛 / 어둠 속성 몬스터의 수까지, 상대 필드의 카드를 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다. ②: 이 카드가 제외되었을 경우, 자신 필드의 빛 / 어둠 속성의 드래곤족 / 레벨 4 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 레벨을 8 로 한다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:05.232996',490,'2025-09-16 16:38:05.232996','ROTA-KR037','B·F－신사궁의 사치','{\"attribute\": \"바람\", \"type\": \"[곤충족／싱크로／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 1200\", \"card_text\": \"곤충족 튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 싱크로 소환했을 경우에 발동할 수 있다. 이 카드를 튜너로 취급한다. ②: 1턴에 1번, 자신 필드의 지속 마법 카드 1장을 패로 되돌리고 발동할 수 있다. 이 턴에, 자신은 통상 소환 외에도 1번만, 자신 메인 페이즈에 \\\"B·F(비 포스)\\\" 몬스터 1장을 일반 소환할 수 있다. ③: 이 카드가 싱크로 소재로서 묘지로 보내졌을 경우에 발동할 수 있다. 자신의 제외 상태인 \\\"B·F(비 포스)\\\" 몬스터의 수 × 100 데미지를 상대에게 준다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:05.602857',491,'2025-09-16 16:38:05.602857','ROTA-KR040','진마 여섯 무사－에니시','{\"attribute\": \"빛\", \"type\": \"[전사족／싱크로／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 1700\", \"deffence\": \"수비력 1200\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 싱크로 소환했을 경우, 자신 묘지의 \\\"여섯 무사\\\" 몬스터를 임의의 수만큼 제외하고, 그 수만큼 상대 필드의 몬스터를 대상으로 하여 발동할 수 있다. 그 몬스터를 패로 되돌린다. ②: 자신 필드의 전사족 몬스터의 공격력 / 수비력은, 배틀 페이즈 동안에만 500 올린다. ③: 이 카드가 묘지로 보내졌을 경우에 발동할 수 있다. 자신의 제외 상태인 \\\"여섯 무사\\\" 몬스터 1장을 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:05.955451',492,'2025-09-16 16:38:05.955451','ROTA-KR044','지강의 옥 루베사피루스','{\"attribute\": \"땅\", \"type\": \"[암석족／엑시즈／효과]\", \"rank\": \"랭크 9\", \"attack\": \"공격력 2700\", \"deffence\": \"수비력 1600\", \"card_text\": \"레벨 9 몬스터 × 2장 이상①: 이 카드는, 이 카드가 엑시즈 소재로 하고 있는 몬스터의 속성에 따라 이하의 효과를 얻는다. ●화염: 이 카드가, 이 카드보다 높은 공격력을 가지는 몬스터에 공격하는 공격 선언시에 발동할 수 있다. 이 카드의 공격력은 그 데미지 스텝 종료시까지 배가 된다. ●물: 상대 턴에 1번, 자신 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 이 턴에, 그 카드를 대상으로 하고 상대가 발동한 효과는 무효화된다. ②: 이 카드가 파괴될 경우, 대신에 이 카드의 엑시즈 소재를 1개 제거할 수 있다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:06.143683',493,'2025-09-16 16:38:06.143683','ROTA-KR045','데먼스미스 아뉴스데이','{\"attribute\": \"빛\", \"type\": \"[악마족／링크／효과]\", \"link_arrows\": \"Bottom-Left/Top/Bottom-Right\", \"attack\": \"공격력 1800\", \"deffence\": \"수비력 -\", \"card_text\": \"악마족 / 빛 속성 몬스터를 포함하는 몬스터 2장 이상①: 자신 / 상대 턴에 1번, 링크 몬스터 이외의 자신 묘지의 악마족 / 빛 속성 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환하고, 자신 필드의 이 카드를 이하의 효과를 가지는 장착 마법 카드로 취급하여 그 몬스터에 장착한다. ●장착 몬스터의 공격력은, 자신이 장착하고 있는 링크 몬스터의 링크 마커의 합계 × 600 올린다. ●장착 몬스터가 수비 표시 몬스터를 공격했을 경우, 그 수비력을 공격력이 넘은 만큼만 상대에게 전투 데미지를 준다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:06.368786',494,'2025-09-16 16:38:06.368786','ROTA-KR046','황위 머메일－넵트어비스','{\"attribute\": \"물\", \"type\": \"[해룡족／링크／효과]\", \"link_arrows\": \"Bottom-Left/Bottom/Bottom-Right\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 -\", \"card_text\": \"어류족 / 해룡족 / 물족 몬스터를 포함하는 몬스터 2장 이상이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 링크 앞의 물 속성 몬스터를 상대는 효과의 대상으로 할 수 없다. ②: 물 속성 몬스터가 카드의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 자신의 덱 / 묘지에서 \\\"어비스\\\" 장착 마법 카드 1장을 고르고, 패에 넣거나 이 카드에 장착한다. ③: 이 카드가 상대에 의해 파괴되었을 경우에 발동할 수 있다. 덱에서 \\\"해황\\\" 몬스터나 \\\"머메일\\\" 몬스터 1장을 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:06.544879',495,'2025-09-16 16:38:06.544879','ROTA-KR047','플라잉 메리','{\"attribute\": \"물\", \"type\": \"[언데드족／링크／효과]\", \"link_arrows\": \"Left/Right\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 -\", \"card_text\": \"언데드족 몬스터 2장이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 묘지 / 제외 상태인 레벨 5 이상의 언데드족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 지속 마법 카드로 취급하여 자신의 마법 & 함정 존에 앞면 표시로 놓고, 대상 몬스터를 특수 소환한다. ②: 이 카드를 지속 마법 카드로 취급할 경우, 자신 필드의 레벨 5 이상의 언데드족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 공격력 이하의 공격력을 가지는 상대 필드의 몬스터 1장을 파괴한다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:06.880705',496,'2025-09-16 16:38:06.880705','ROTA-KR049','리인카네이트 언베일 메일','{\"attribute\": \"마법\", \"card_text\": \"이 카드명은 룰상 \\\"아머드 엑시즈\\\" 카드로도 취급한다. 이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 이 카드를 장착한 엑시즈 몬스터는 이하의 효과를 얻는다. ●이 카드는 전투로는 파괴되지 않는다. ●이 카드가 전투를 실행한 자신 / 상대 턴에 1번, 발동할 수 있다. 이 카드의 장착 카드 1장을 패로 되돌린다. 그 후, 물 속성 엑시즈 몬스터 1장의 엑시즈 소환을 실행한다. ②: 이 카드가 묘지로 보내진 턴의 엔드 페이즈에 발동할 수 있다. 이 카드를 자신 필드의 엑시즈 몬스터 1장에 장착한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:07.184165',497,'2025-09-16 16:38:07.184165','ROTA-KR050','덮쳐오는 머신','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: \\\"메탈화 강화반사장갑\\\"의 카드명이 쓰여진 몬스터 1장이나 \\\"메탈화\\\" 함정 카드 1장을 자신의 덱 / 묘지에서 패에 넣는다. ②: 자신 필드에 \\\"메탈화\\\" 함정 카드가 존재할 경우, 묘지의 이 카드를 제외하고, 상대 필드의 수비 표시 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 앞면 공격 표시로 한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:07.582658',498,'2025-09-16 16:38:07.582658','ROTA-KR051','무장봉기','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 패 / 덱에서 공격력 1000 이하의 곤충족 몬스터 1장을 특수 소환한다. 이 효과로 덱에서 특수 소환했을 경우, 추가로 자신 필드의 몬스터 1장을 묘지로 보낸다. 이 카드의 발동 후, 턴 종료시까지 자신은 곤충족 몬스터밖에 특수 소환할 수 없다. ②: 이 카드가 묘지에 존재하는 상태에서, 자신 필드의 앞면 표시의 곤충족 싱크로 몬스터가 전투 / 효과로 파괴되었을 경우, 이 카드를 제외하고 발동할 수 있다. 덱에서 \\\"일제봉기\\\" 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:07.788775',499,'2025-09-16 16:38:07.788775','ROTA-KR052','B·F·W','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 1턴에 2번까지, 자신 필드에 \\\"B·F(비 포스)\\\" 몬스터가 일반 소환 / 특수 소환되었을 경우, 그 중의 1장을 대상으로 하고 발동할 수 있다. 그 몬스터보다 공격력이 낮은 \\\"B·F(비 포스)\\\" 몬스터 1장을 덱에서 패에 넣는다. ②: 1턴에 1번, 자신 필드의 레벨을 가지는 곤충족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 턴에, 자신은 대상 몬스터를 싱크로 소재로 할 경우, 튜너로 취급할 수 있다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:08.183247',500,'2025-09-16 16:38:08.183247','ROTA-KR053','성스러운 아자미나','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 엑스트라 덱의 \\\"아자미나\\\" 융합 몬스터 1장을 상대에게 보여주고, 그 레벨 4 당 1장, 자신의 패 / 필드에서 \\\"죄보\\\" 카드를 묘지로 보낸다(뒷면 표시 카드는 넘겨서 확인한다). 그 후, 보여준 몬스터를 융합 소환으로 취급하고 특수 소환한다. ②: 이 카드가 묘지에 존재할 경우, 자신의 필드 / 묘지의 \\\"아자미나\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 덱으로 되돌리고, 이 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:08.408657',501,'2025-09-16 16:38:08.408657','ROTA-KR055','죄보의 기만','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 필드의 몬스터 1장을 릴리스하고 발동할 수 있다. 덱에서 \\\"아자미나\\\" 카드 1장을 패에 넣는다. ②: 몬스터가 상대 묘지로 보내졌을 경우, 자신 필드에 \\\"아자미나\\\" 몬스터가 존재하고 있으면 발동할 수 있다. 상대는 1500 LP를 상실하고, 자신은 1500 LP 회복한다. ③: 마법 & 함정 존의 앞면 표시의 이 카드가 묘지로 보내진 턴의 엔드 페이즈에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:08.590726',502,'2025-09-16 16:38:08.590726','ROTA-KR056','하얀 숲의 악마','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 싱크로 몬스터 1장을 릴리스하고, 필드의 앞면 표시 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드의 효과를 턴 종료시까지 무효로 한다. \\\"하얀 숲\\\" 싱크로 몬스터를 릴리스하고 발동했을 경우, 추가로 자신 묘지에서 환상마족 몬스터 1장을 특수 소환할 수 있다. ②: 이 카드가 몬스터의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:08.945977',503,'2025-09-16 16:38:08.945977','ROTA-KR064','데카네로그','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 몬스터 1장과 상대 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'UNCOMMON'),(1,41,'2025-09-16 16:38:09.162675',504,'2025-09-16 16:38:09.162675','ROTA-KR066','소용돌이치는 해염','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●패에서 물 속성 몬스터 1장을 묘지로 버리고, 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 파괴한다. ●패의 화염 속성 몬스터 1장을 파괴한다. 그 후, 자신은 1장 드로우할 수 있다. ②: 상대 필드에만 몬스터가 존재할 경우, 묘지의 이 카드를 제외하고, 자신 묘지의 레벨 7 / 8 의 물 / 화염 속성 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:09.371221',505,'2025-09-16 16:38:09.371221','ROTA-KR072','시간의 기계－타임 엔진','{\"attribute\": \"함정\", \"card_text\": \"이 카드명은 룰상 \\\"메탈화\\\" 카드로도 취급한다. ①: 자신 필드의 몬스터가 전투 또는 상대 효과로 파괴되었을 경우, 그 중의 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. 이 효과로 레벨 5 이상의 기계족 몬스터를 특수 소환하고, 자신의 필드나 묘지에 이 카드 이외의 \\\"메탈화\\\" 함정 카드가 존재할 경우, 추가로 이하의 효과를 적용할 수 있다. ●상대 필드의 몬스터를 전부 파괴한다. 그 후, 이 효과로 특수 소환한 몬스터의 원래 공격력만큼의 데미지를 상대에게 줄 수 있다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:09.560557',506,'2025-09-16 16:38:09.560557','ROTA-KR074','죄보의 죄인','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"디아벨스타\\\" 몬스터 카드가 존재하고, 상대가 덱 / 엑스트라 덱에서 몬스터를 특수 소환했을 경우, 상대 필드의 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 덱으로 되돌린다. ②: 자신의 \\\"디아벨스타\\\" 몬스터가 상대 몬스터와 전투를 실행하는 데미지 스텝 개시시부터 데미지 계산 전까지, 묘지의 이 카드를 제외하고 발동할 수 있다. 그 상대 몬스터의 공격력은 턴 종료시까지 절반이 된다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:09.780079',507,'2025-09-16 16:38:09.780079','ROTA-KR077','뇌화의 사라시후지','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드는 발동 후, 일반 몬스터(식물족 / 어둠 / 레벨 4 / 공 1600 / 수 0)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다). 자신 필드에 \\\"뇌화\\\" 링크 몬스터가 존재할 경우, 추가로 상대 묘지에서 카드를 2장까지 제외할 수 있다. ②: 자신 / 상대의 엔드 페이즈에, 이 카드가 묘지에 존재할 경우에 발동할 수 있다. 자신의 묘지 / 제외 상태인 곤충족 / 식물족 / 파충류족 몬스터 2장을 덱으로 되돌리고, 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,41,'2025-09-16 16:38:10.020526',508,'2025-09-16 16:38:10.020526','ROTA-KR080','방학숙제 끝!','{\"attribute\": \"함정\", \"card_text\": \"이 카드를 발동할 경우, 이 카드에 숙제 카운터를 5개 놓고 발동한다. ①: 마법 / 함정 카드의 효과로, 엑스트라 덱에서 몬스터가 특수 소환되었을 경우, 또는 덱에서 카드가 묘지로 보내졌을 경우에 발동한다. 이 카드의 숙제 카운터를 1개 제거한다. 그 후, 이 카드의 숙제 카운터의 수가 0 일 경우, 이 카드를 파괴하고, 자신은 4000 LP 회복한다. 그 후, 자신의 덱 / 묘지에서 \\\"숙제\\\" 함정 카드 1장을 자신 필드에 세트한다. 그 후, 자신의 덱의 매수가 1장 이하일 경우, 자신은 듀얼에서 승리한다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:10.347478',509,'2025-09-16 16:38:10.347478','CYAC-KR004','초중무사 온－32','{\"attribute\": \"땅\", \"type\": \"[기계족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 200\", \"deffence\": \"수비력 700\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지에 마법 / 함정 카드가 존재하지 않을 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 자신 묘지에 마법 / 함정 카드가 존재하지 않을 경우, 이 카드를 릴리스하고, 상대 묘지의 마법 / 함정 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 자신 필드에 세트한다. 이 효과로 세트한 카드는 필드에서 벗어났을 경우에 제외된다. 이 효과는 상대 턴에도 발동할 수 있다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:10.687703',510,'2025-09-16 16:38:10.687703','CYAC-KR009','아르기로스의 낙윤','{\"attribute\": \"어둠\", \"type\": \"[번개족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 700\", \"deffence\": \"수비력 700\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 필드에 레벨 2 / 랭크 2 / 링크 2 의 몬스터 중 어느 것이 존재할 경우, 이 카드는 패에서 자신 또는 상대 필드에 특수 소환할 수 있다. ②: 이 카드를 링크 앞으로 하는 링크 몬스터는 효과를 발동할 수 없다. ③: 상대 턴에, 필드의 엑시즈 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 엑시즈 소재를 2개까지 제거한다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:11.336462',511,'2025-09-16 16:38:11.336462','CYAC-KR013','마나둠 히어리스','{\"attribute\": \"땅\", \"type\": \"[천사족／튜너／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없다. ①: 자신 필드에 \\\"비서스＝스타프로스트\\\" 또는 공격력 1500 / 수비력 2100 의 몬스터가 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 이 카드가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 덱에서 \\\"마나둠 히어리스\\\" 1장을 특수 소환한다. 이 효과를 발동한 턴의 배틀 페이즈 중, 자신 필드의 싱크로 몬스터의 공격력은 500 올린다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:11.593632',512,'2025-09-16 16:38:11.593632','CYAC-KR018','퓨어리 리리','{\"attribute\": \"어둠\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 100\", \"deffence\": \"수비력 100\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 소환 / 특수 소환에 성공했을 경우에 발동할 수 있다. 덱에서 속공 마법 카드 이외의 \\\"퓨어리\\\" 카드 1장을 패에 넣는다. ②: 자신 묘지의 \\\"퓨어리\\\" 속공 마법 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드명이 쓰여진 엑시즈 몬스터 1장을, 자신 필드의 이 카드 위에 겹치고 엑시즈 소환으로 취급하여 엑스트라 덱에서 특수 소환하고, 대상의 카드를 그 엑시즈 몬스터 아래에 겹쳐 엑시즈 소재로 한다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:11.879395',513,'2025-09-16 16:38:11.879395','CYAC-KR022','무한기동 로드롤러','{\"attribute\": \"땅\", \"type\": \"[기계족／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 2100\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패 / 묘지에 존재하고, 기계족 / 땅 속성 몬스터가, 릴리스되었을 경우 또는 앞면 표시로 제외되었을 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다. ②: 이 카드를 소재로서 가지고 있는, 원래의 종족이 기계족인 엑시즈 몬스터는 이하의 효과를 얻는다. ●이 카드가 몬스터 존에 존재하는 한, 상대 필드의 앞면 표시 몬스터는, 수비 표시가 되고, 수비력은 1000 내린다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:12.223239',514,'2025-09-16 16:38:12.223239','CYAC-KR025','풀액티브 듀플렉스','{\"attribute\": \"바람\", \"type\": \"[사이버스족／효과]\", \"level\": \"레벨 9\", \"attack\": \"공격력 2800\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지에서 링크 몬스터 2장을 제외하고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 링크 상태의 자신 몬스터는 1번의 배틀 페이즈 중에 2회까지 몬스터에 공격할 수 있다. ③: 이 카드가 묘지로 보내졌을 경우, 자신 필드의 사이버스족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 공격력은 1000 올린다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:12.429745',515,'2025-09-16 16:38:12.429745','CYAC-KR026','사천사 하비스트','{\"attribute\": \"어둠\", \"type\": \"[천사족／펜듈럼／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1800\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①②의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 소환 / 펜듈럼 소환에 성공했을 경우에 발동할 수 있다. 덱에서 \\\"승천의 뿔피리\\\" 1장을 패에 넣는다. ②: 이 카드가 릴리스되었을 경우에 발동할 수 있다. 이 카드를 자신의 펜듈럼 존에 놓는다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:12.672656',516,'2025-09-16 16:38:12.672656','CYAC-KR029','백금룡－링고블룸','{\"attribute\": \"빛\", \"type\": \"[드래곤족／튜너／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 100\", \"deffence\": \"수비력 1100\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 필드에 효과 몬스터 이외의 앞면 표시 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 자신이 싱크로 몬스터의 싱크로 소환에 성공한 턴의 자신 메인 페이즈에, 묘지의 이 카드를 제외하고 발동할 수 있다. 자신 필드에 \\\"백금 토큰\\\"(환룡족 / 빛 / 레벨 2 / 공 100 / 수 100) 1장을 특수 소환한다. 자신은 이 토큰을 싱크로 소재로 할 경우, 이 토큰을 튜너로서 취급할 수 있다.\"}',NULL,'UNCOMMON'),(1,35,'2025-09-16 16:38:12.901889',517,'2025-09-16 16:38:12.901889','CYAC-KR032','우사미미 도사','{\"attribute\": \"땅\", \"type\": \"[야수전사족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 200\", \"deffence\": \"수비력 100\", \"card_text\": \"①: \\\"우사미미 도사\\\" 이외의 필드의 몬스터 효과가 발동했을 때에 발동할 수 있다(동일한 체인 위에서는 1번까지). 그 몬스터에 우사미미 카운터를 1개 놓는다. 우사미미 카운터가 놓여 있는 몬스터는 전투로는 파괴되지 않는다. ②: 1턴에 1번, 우사미미 카운터가 놓여 있는 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터와 이 카드를 다음 턴의 스탠바이 페이즈까지 제외한다. 이 효과는 상대 턴에도 발동할 수 있다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:13.262021',518,'2025-09-16 16:38:13.262021','CYAC-KR037','비틀트루퍼 크루엘 새턴','{\"attribute\": \"어둠\", \"type\": \"[곤충족／융합／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 2000\", \"card_text\": \"비틀트루퍼 몬스터 ＋ 곤충족 몬스터이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 특수 소환에 성공했을 경우에 발동할 수 있다. 덱에서 \\\"비틀트루퍼\\\" 카드 1장을 패에 넣는다. ②: 이 카드가 몬스터 존에 존재하는 한, 자신은 곤충족 몬스터밖에 특수 소환할 수 없다. ③: 곤충족 몬스터가 앞면 표시로 제외되었을 경우, 제외되어 있는 자신의 \\\"비틀트루퍼\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,35,'2025-09-16 16:38:13.513290',519,'2025-09-16 16:38:13.513290','CYAC-KR038','쌍천의 사사－아훔','{\"attribute\": \"빛\", \"type\": \"[전사족／융합／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 0\", \"card_text\": \"쌍천 몬스터 × 2①: 이 카드는 융합 소재로 한 몬스터의 원래의 카드명에 따라 이하의 효과를 얻는다. ●\\\"쌍천장 금강\\\": 전투를 실행하는 자신의 \\\"쌍천\\\" 몬스터의 공격력은 데미지 계산시에만 3000 이 된다. ●\\\"쌍천장 밀적\\\": 상대 턴에 1번, 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 제외한다. ②: 융합 소환한 이 카드가 파괴되었을 경우에 발동할 수 있다. 덱에서 \\\"쌍천권의 웅비\\\" \\\"쌍천각의 홍곡\\\"을 1장씩 특수 소환한다. 그 몬스터는 이 턴에, 전투 / 효과로는 파괴되지 않는다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:14.805217',520,'2025-09-16 16:38:14.805217','CYAC-KR050','S－Force 나이트체이서','{\"attribute\": \"어둠\", \"type\": \"[사이버스족／링크／효과]\", \"link_arrows\": \"Bottom\", \"attack\": \"공격력 800\", \"deffence\": \"수비력 -\", \"card_text\": \"링크 몬스터 이외의 \\\"S－Force(시큐리티 포스)\\\" 몬스터 1장이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 몬스터 존에 존재하는 한, 자신의 \\\"S－Force(시큐리티 포스)\\\" 몬스터 정면의 상대 몬스터는, 자신과 같은 세로열의 몬스터를 공격 대상으로 선택할 수 없다. ②: 자신 / 상대의 메인 페이즈에, 자신 필드의 \\\"S－Force(시큐리티 포스)\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 주인의 덱으로 되돌린다. 그 후, 제외되어 있는 자신의 \\\"S－Force(시큐리티 포스)\\\" 몬스터 1장을 고르고 특수 소환할 수 있다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:15.013217',521,'2025-09-16 16:38:15.013217','CYAC-KR052','혁성의 상검','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 싱크로 몬스터가 존재할 경우, 자신 또는 상대의, 필드 / 묘지의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 제외한다. ②: 상대 필드에 의식 / 융합 / 싱크로 / 엑시즈 / 링크 몬스터 중 어느 것이 존재할 경우, 자신 묘지에서 싱크로 몬스터 1장을 제외하고 발동할 수 있다. 묘지의 이 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:15.249335',522,'2025-09-16 16:38:15.249335','CYAC-KR059','네무렐리아의 침희루','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 엑스트라 덱에서 뒷면 표시의 카드 2장을 뒷면 표시로 제외하고 발동할 수 있다. 덱에서 카드명이 다른 야수족 / 레벨 10 몬스터 2장을 패에 넣는다. 이 효과를 발동하는 턴에, 자신은 펜듈럼 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 자신의 엑스트라 덱에 앞면 표시의 \\\"꿈꾸는 네무렐리아\\\"가 존재하고, 자신 필드의 \\\"네무렐리아\\\" 몬스터가 전투 또는 상대 효과로 파괴될 경우, 대신에 자신의 엑스트라 덱의 뒷면 표시의 카드 1장을 뒷면 표시로 제외할 수 있다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:15.513639',523,'2025-09-16 16:38:15.513639','CYAC-KR061','퓨어리 슬리피메모리','{\"attribute\": \"마법\", \"card_text\": \"①: 이 턴에, 자신이 받는 전투 / 효과 데미지는 1번만 0 이 된다. 추가로, 이하의 효과를 적용할 수 있다. ●자신의 패를 1장 골라 버리고, 덱에서 레벨 1 의 \\\"퓨어리\\\" 몬스터 1장을 특수 소환한다. ②: 이 카드를 소재로서 가지고 있는 \\\"퓨어리\\\" 엑시즈 몬스터는 이하의 효과를 얻는다. ●상대 스탠바이 페이즈에 발동할 수 있다. 자신은 덱에서 1장 드로우한다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:15.729485',524,'2025-09-16 16:38:15.729485','CYAC-KR063','리브로맨서 오리진','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"리브로맨서 오리진\\\" 이외의 \\\"리브로맨서\\\" 마법 / 함정 카드 1장을 고르고 자신 필드에 세트할 수 있다. ②: 자신 필드의 \\\"리브로맨서\\\" 의식 몬스터의 공격력은 자신의 레벨 × 100 올린다. ③: 자신 필드에 의식 몬스터가 의식 소환되었을 경우, 상대 필드의 마법 / 함정 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'UNCOMMON'),(1,35,'2025-09-16 16:38:15.975453',525,'2025-09-16 16:38:15.975453','CYAC-KR066','추천메뉴 군관니기리','{\"attribute\": \"마법\", \"card_text\": \"①: 1턴에 1번, 패의 \\\"샤리 군관\\\" 1장을 상대에게 보여주고 발동할 수 있다. 이 카드에 카운터를 1개 놓고, 엑스트라 덱의 \\\"군관\\\" 엑시즈 몬스터 1장을 상대에게 보여주고, 상대는 \\\"군관\\\" 엑시즈 몬스터에 카드명이 쓰여진 \\\"샤리 군관\\\" 이외의 \\\"군관\\\" 몬스터의 카드명을 1개 선언한다. 자신은 상대가 선언한 카드를 덱에서 패에 넣는다. 넣을 수 없을 경우, 이 카드를 주인의 덱으로 되돌린다. ②: 이 카드가 상대에 의해 파괴되었을 경우에 발동한다. 상대는 이 카드에 놓여 있던 카운터의 수 × 500 LP를 지불한다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:16.187945',526,'2025-09-16 16:38:16.187945','CYAC-KR067','시간을 가르는 모르가나이트','{\"attribute\": \"마법\", \"card_text\": \"①: 이 듀얼 중, 이하의 효과를 각각 적용한다.●자신은 패의 몬스터 효과를 발동할 수 없다.●자신 드로우 페이즈의 일반 드로우는 2장이 된다.●자신은 통상 소환을 1턴에 2회까지 실행할 수 있다.②: 묘지의 이 카드를 제외하고, 패에서 \\\"시간을 가르는 모르가나이트\\\" 1장을 버리고 발동할 수 있다. 이 턴에, 자신이 몬스터의 일반 소환에 성공했을 때에는, 상대는 몬스터의 효과를 발동할 수 없다.\"}',NULL,'UNCOMMON'),(1,35,'2025-09-16 16:38:16.408372',527,'2025-09-16 16:38:16.408372','CYAC-KR070','빛나는 왕의 낙인','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: \\\"알버스의 낙윤\\\"을 융합 소재로 하는 자신 필드의 융합 몬스터 1장을 고르고, 그 몬스터 이외의 필드의 모든 앞면 표시의 카드 효과를 턴 종료시까지 무효로 한다. ②: 이 턴에 융합 몬스터가 자신 묘지로 보내지고 있을 경우, 엔드 페이즈에 발동할 수 있다. 묘지의 이 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:16.641084',528,'2025-09-16 16:38:16.641084','CYAC-KR071','낙인의 에튀드','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대 턴에 발동할 수 있다. 드래곤족 몬스터를 포함하는 자신 필드의 몬스터를 소재로서 싱크로 소환한다. ②: 자신 필드에 \\\"비스테드\\\" 몬스터가 존재하는 한, 상대의 의식 소환을 위해 릴리스되어 상대 묘지로 보내지는 몬스터 및, 상대의 융합 / 싱크로 / 링크 소환의 소재가 되어 상대 묘지로 보내지는 몬스터는, 묘지로는 가지 않으며 제외된다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:16.847439',529,'2025-09-16 16:38:16.847439','CYAC-KR072','마나둠 브레이크하트','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지의, 튜너 또는 싱크로 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. 이 효과로 빛 속성 몬스터를 특수 소환했을 경우, 추가로 그 공격력 이하의 공격력을 가지는 상대 필드의 몬스터 1장을 고르고 파괴할 수 있다. ②: 자신 필드의, \\\"비서스＝스타프로스트\\\" 또는 공격력 1500 / 수비력 2100 의 몬스터가 전투 / 효과로 파괴될 경우, 대신에 묘지의 이 카드를 제외할 수 있다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:17.045359',530,'2025-09-16 16:38:17.045359','CYAC-KR074','식무변세괴','{\"attribute\": \"함정\", \"card_text\": \"①: 필드에 \\\"비셔스＝아스트라우드\\\"가 존재할 경우, 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다. 그 후, 파괴한 카드의 원래의 카드명이 \\\"비셔스＝아스트라우드\\\"였을 경우, 제외되어 있는 자신의 \\\"비서스＝스타프로스트\\\" 1장을 고르고 특수 소환할 수 있다. \\\"비셔스＝아스트라우드\\\" 이외였을 경우, 자신 필드의 \\\"비셔스＝아스트라우드\\\" 1장을 고르고, 그 공격력을 1500 올릴 수 있다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:17.219898',531,'2025-09-16 16:38:17.219898','TT02-KRA23','REINFORCE!','{\"attribute\": \"함정\", \"card_text\": \"이 카드명은 룰상 \\\"R－ACE(레스큐 에이스)\\\" 카드로도 취급한다. 이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 \\\"R－ACE(레스큐 에이스)\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 자신 몬스터는 이 턴에, 공격력 / 수비력을 1500 올리고, 상대 몬스터의 효과를 받지 않으며, 1번만 전투로는 파괴되지 않는다. ②: 묘지의 이 카드를 제외하고, 자신 묘지의 \\\"R－ACE(레스큐 에이스)\\\" 마법 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,35,'2025-09-16 16:38:17.443857',532,'2025-09-16 16:38:17.443857','CYAC-KR076','다이놀피어 인택트','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드에 \\\"다이놀피어\\\" 카드가 존재하고, 몬스터의 효과가 발동했을 때, LP를 절반 지불하고 발동할 수 있다. 그 발동을 무효로 하고 파괴한다. 이 턴에, 자신이 받는 전투 데미지는 그 때의 자신 LP의 절반의 수치가 된다. ②: 자신의 LP가 2000 이하이고, 자신이 전투 데미지를 받는 데미지 계산시에, 묘지의 이 카드를 제외하여 발동할 수 있다. 그 전투로 발생하는 자신에게로의 전투 데미지를 0 으로 한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:18.099273',533,'2025-09-16 16:38:18.099273','SUDA-KR002','이블 히어로 데스 프리즌','{\"attribute\": \"빛\", \"type\": \"[암석족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1700\", \"deffence\": \"수비력 1100\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: \\\"다크 퓨전\\\"의 효과로만 특수 소환할 수 있는 융합 몬스터가 자신 필드에 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 덱에서 \\\"히어로\\\" 몬스터 1장을 묘지로 보내고 발동할 수 있다. 이 턴에, \\\"히어로\\\" 융합 몬스터를 융합 소환할 경우, 앞면 표시의 이 카드는 그 융합 몬스터에 카드명이 쓰여진 융합 소재 몬스터 1장으로 대용할 수 있다(다른 융합 소재는 대용할 수 없다).\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:18.309779',534,'2025-09-16 16:38:18.309779','SUDA-KR003','이블 히어로 헬 라이더','{\"attribute\": \"바람\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 800\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 자신의 덱 / 묘지에서 \\\"다크 퓨전\\\" 1장을 패에 넣는다. ②: 자신 묘지에서 몬스터 4장과 이 카드를 제외하고 발동할 수 있다. 덱에서 \\\"초융합\\\" 1장을 자신 필드에 세트한다. 상대 턴 종료시까지 자신은, \\\"히어로\\\" 몬스터밖에 특수 소환할 수 없으며, \\\"다크 퓨전\\\"의 효과로만 특수 소환할 수 있는 융합 몬스터를 그 이외의 효과로도 융합 소환할 수 있다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:18.527145',535,'2025-09-16 16:38:18.527145','SUDA-KR004','아르카나 포스 V－더 하이어로펀트','{\"attribute\": \"빛\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1500\", \"card_text\": \"①: 이 카드를 패에서 버리고 발동할 수 있다. 이 턴에, 자신 필드에 \\\"아르카나 포스\\\" 몬스터가 일반 소환 / 반전 소환 / 특수 소환되었을 때에 상대는 효과를 발동할 수 없다. ②: 이 카드를 일반 소환 / 반전 소환 / 특수 소환했을 경우에 발동한다. 코인 토스를 1회 실행하고, 그 앞뒷면에 따라 이하의 효과를 적용한다. ●앞: 같은 이름의 몬스터가 자신의 필드 / 묘지에 존재하지 않는, 레벨 4 이하의 \\\"아르카나 포스\\\" 몬스터 1장을 덱에서 특수 소환한다. ●뒤: 덱에서 \\\"아르카나 포스\\\" 몬스터 1장을 상대 필드에 특수 소환한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:18.774579',536,'2025-09-16 16:38:18.774579','SUDA-KR005','아르카나 포스 ⅩⅨ－더 선','{\"attribute\": \"빛\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2900\", \"deffence\": \"수비력 2900\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 코인 토스를 실행하는 효과를 가지는 카드가 필드에 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 일반 소환 / 반전 소환 / 특수 소환했을 경우에 발동한다. 코인 토스를 1회 실행하고, 그 앞뒷면에 따라 이하의 효과를 적용한다. ●앞: 코인 토스를 실행하는 효과를 가지는 마법 카드 1장을 덱에서 자신 필드에 세트한다. ●뒤: 서로의 마법 & 함정 존의 카드를 전부 파괴한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:18.998152',537,'2025-09-16 16:38:18.998152','SUDA-KR007','SR 윙 싱크론','{\"attribute\": \"바람\", \"type\": \"[기계족／펜듈럼／튜너／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 몬스터 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 엑스트라 덱에 앞면으로 넣어졌을 경우, 자신 필드의 바람 속성 싱크로 몬스터의 종족이 2종류 이상이면 발동할 수 있다. 덱에서 \\\"스피드로이드\\\" 마법 / 함정 카드 1장을 묘지로 보낸다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:19.465019',538,'2025-09-16 16:38:19.465019','SUDA-KR012','머티리어크톨 젭토윙','{\"attribute\": \"화염\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"머티리어크톨\\\" 카드가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 일반 소환 / 특수 소환 / 리버스했을 경우에 발동할 수 있다. 덱에서 \\\"머티리어크톨 젭토윙\\\" 이외의 \\\"머티리어크톨\\\" 카드 1장을 패에 넣는다. 그 후, 자신 묘지에서 레벨 3 일반 몬스터 1장을 패에 넣거나 특수 소환할 수 있다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:19.705572',539,'2025-09-16 16:38:19.705572','SUDA-KR016','굉해황 포세이도라','{\"attribute\": \"물\", \"type\": \"[해룡족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2800\", \"deffence\": \"수비력 1600\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 필드(앞면 표시)에서 다른 물 속성 몬스터 1장을 묘지로 보내고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 일반 소환 / 특수 소환했을 경우, 덱에서 \\\"해황\\\" 몬스터나 \\\"머메일\\\" 몬스터 1장을 묘지로 보내고, 상대 필드의 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 패로 되돌린다. ③: 자신 필드에 \\\"굉해황 포세이도라\\\" 이외의 몬스터가 존재하는 한, 상대 몬스터는 이 카드를 공격 대상으로 선택할 수 없다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:19.867470',540,'2025-09-16 16:38:19.867470','SUDA-KR018','슬레이브베어','{\"attribute\": \"땅\", \"type\": \"[야수족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 900\", \"deffence\": \"수비력 600\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 덱 / 엑스트라 덱에서 특수 소환된 \\\"검투수\\\" 몬스터가 자신 필드에 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 이 카드를 릴리스하고, 자신의 패 / 필드(앞면 표시)에서 \\\"검투수\\\" 몬스터 1장을 덱 / 엑스트라 덱으로 되돌리고 발동할 수 있다. \\\"검투수\\\" 몬스터를 2장까지, \\\"검투수\\\" 몬스터의 효과에 의한 특수 소환으로 취급하고 덱에서 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:20.210235',541,'2025-09-16 16:38:20.210235','SUDA-KR022','암흑해룡－드라이어글','{\"attribute\": \"물\", \"type\": \"[해룡족／효과]\", \"level\": \"레벨 10\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 3100\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재하고, 자신의 필드 / 묘지 / 제외 상태인 레벨 10 몬스터가 3장 이상일 경우에 발동할 수 있다. 이 카드를 특수 소환한다. ②: 이 카드를 특수 소환했을 경우, 자신의 덱 맨 위의 카드를 묘지로 보내고 발동할 수 있다. 이 카드의 공격력은 500 올린다. 그 후, 묘지로 보내진 카드가 몬스터였을 경우, 상대에게 1000 데미지를 준다. 다를 경우, 자신의 덱 맨 위의 카드를 묘지로 보낼 수 있다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:20.563751',542,'2025-09-16 16:38:20.563751','SUDA-KR024','대홍연 마투사','{\"attribute\": \"화염\", \"type\": \"[전사족／특수 소환／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드는 통상 소환할 수 없다. \\\"대홍연 마투사\\\"는 1턴에 1번, 효과 몬스터 이외의 자신 묘지의 몬스터를 3장까지 덱 / 엑스트라 덱으로 되돌렸을 경우에만 패 / 묘지에서 특수 소환할 수 있다. ①: 이 방법으로 특수 소환한 이 카드의 공격력은, 그 특수 소환을 위해 덱으로 되돌린 일반 몬스터의 수 × 800 올린다. ②: 1턴에 1번, 필드의 몬스터 1장과, 효과 몬스터 이외의 자신 묘지의 몬스터 1장을 대상으로 하고 발동할 수 있다. 대상 필드의 몬스터를 파괴하고, 대상 묘지의 몬스터를 특수 소환한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:20.744700',543,'2025-09-16 16:38:20.744700','SUDA-KR026','장난의 대정령 할로','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 이 카드가 자신 필드에 앞면 표시로 존재할 경우, 상대는 이하의 효과에서 1개를 고르고, 자신은 그 효과를 적용한다. ●이 카드의 공격력은, 자신 묘지의 악마족 몬스터의 수 × 800 올린다. ●자신 묘지의 악마족 몬스터의 수 × 500 데미지를 상대에게 준다. ②: 이 카드가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 상대 필드의 몬스터 1장을 묘지로 보낸다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:20.982266',544,'2025-09-16 16:38:20.982266','SUDA-KR027','과자의 대정령 윈','{\"attribute\": \"빛\", \"type\": \"[언데드족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 이 카드가 자신 필드에 앞면 표시로 존재할 경우, 상대는 이하의 효과에서 1개를 고르고, 자신은 그 효과를 적용한다. ●이 카드의 공격력은, 자신 묘지의 언데드족 몬스터의 수 × 800 올린다. ●자신 묘지의 언데드족 몬스터의 수 × 500 데미지를 상대에게 준다. ②: 이 카드가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 상대 묘지에서 몬스터 1장을 자신 필드에 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:21.223226',545,'2025-09-16 16:38:21.223226','SUDA-KR030','운부의 텐푸라－EBI','{\"attribute\": \"화염\", \"type\": \"[물족／펜듈럼／일반]\", \"level\": \"레벨 3\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 0\", \"card_text\": \"화제의 핫플, EDO－FRONT에 방문! 이곳의 텐푸라는 크기도 놀랍지만, 그 모양 또한 \'금푸라\'라는 별칭을 얻을 정도로 아름답습니다. 최첨단 설비와 이국적인 분위기로 가득 찬 항구이지만, 동시에 어딘가 향수를 불러일으키는 그윽한 향이 감돌고, 이따금 파삭파삭 울려 퍼지는 잔잔한 소리에 마음도 덩달아 들뜹니다. 오랫동안 고대하던 텐푸라였는데, 주변 공역의 날씨가 악화되어 오늘은 아쉽게도 입항이 취소되었습니다. 운이 나쁘게도, 이후 일정도 모두 백지화할 수밖에 없었습니다. 1년을 손꼽아 기다린 만큼 유감이지만, 이번 방문은 별 3개가 적당할 것 같습니다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:22.044501',546,'2025-09-16 16:38:22.044501','SUDA-KR043','라이트스톰 드래곤','{\"attribute\": \"빛\", \"type\": \"[드래곤족／싱크로／효과]\", \"level\": \"레벨 9\", \"attack\": \"공격력 2700\", \"deffence\": \"수비력 3000\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 특수 소환했을 경우, 자신 묘지의 일반 몬스터의 수 ＋ 1장까지, 필드의 마법 / 함정 카드를 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다. ②: 이 카드가 전투 / 효과로 파괴되었을 경우, 자신 묘지의 마법 / 함정 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 자신 필드에 세트한다. 이 효과로 세트한 카드는, 자신 필드에 일반 몬스터가 존재하지 않을 경우에는 발동할 수 없다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:22.309946',547,'2025-09-16 16:38:22.309946','SUDA-KR046','해황정 어비스트리테','{\"attribute\": \"물\", \"type\": \"[해룡족／엑시즈／효과]\", \"rank\": \"랭크 7\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 2800\", \"card_text\": \"물 속성 레벨 7 몬스터 × 2장 이상이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 엑시즈 소환했을 경우, 자신 묘지의 레벨 7 이하의 어류족 / 해룡족 / 물족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. ②: 이 카드가 몬스터 존에 존재하는 한, 자신 필드의 물 속성 몬스터의 공격력 / 수비력은, 이 카드의 엑시즈 소재의 수 × 300 올린다. ③: 이 카드의 엑시즈 소재를 1개 제거하고 발동할 수 있다. 덱에서 \\\"어비스\\\" 함정 카드 1장을 자신 필드에 세트한다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:22.516457',548,'2025-09-16 16:38:22.516457','SUDA-KR047','이클립스의 쌍둥이','{\"attribute\": \"빛\", \"type\": \"[전사족／엑시즈／효과]\", \"rank\": \"랭크 4\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 1200\", \"card_text\": \"레벨 4 몬스터 × 2이 카드를 엑시즈 소환할 경우, 자신 필드의 랭크 4 몬스터를 레벨 4 몬스터로 하고 소재로 할 수 있다. 이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 엑시즈 소재를 1개 제거하고 발동할 수 있다. 이 턴에, 이 카드는 1번의 배틀 페이즈 중에 2회까지 몬스터에 공격할 수 있다. ②: 이 카드가 묘지로 보내졌을 경우, 자신 묘지의 다른 랭크 4 이하의 엑시즈 몬스터 2장을 대상으로 하고 발동할 수 있다. 그 2장 중 1장을 특수 소환하고, 나머지 1장을 그 몬스터의 엑시즈 소재로 한다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:23.066206',549,'2025-09-16 16:38:23.066206','SUDA-KR051','다크 콘택트','{\"attribute\": \"마법\", \"card_text\": \"①: 이하의 효과에서 1개를 선택하고 발동할 수 있다(이 카드명의 이하의 효과는 각각 1턴에 1번밖에 선택할 수 없다).●자신의 필드 / 묘지 / 제외 상태인 몬스터를 융합 소재로서 덱으로 되돌리고, \\\"다크 퓨전\\\"의 효과로만 특수 소환할 수 있는 융합 몬스터 1장을 \\\"다크 퓨전\\\"에 의한 융합 소환으로 취급하여 융합 소환한다.●덱에서 \\\"패왕성\\\"이나 \\\"다크 퓨전\\\" 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:23.237208',550,'2025-09-16 16:38:23.237208','SUDA-KR053','빛의 파동','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 스탠바이 페이즈에, 자신의 필드 존에 \\\"빛의 결계\\\"가 존재하지 않을 경우에 발동한다. 코인 토스를 1회 실행하고, 뒷면이 나왔을 경우, 이 카드의 ②③의 효과는 다음 자신 스탠바이 페이즈까지 무효화된다. ②: 자신 필드의 천사족 몬스터의 공격력 / 수비력은 300 올린다. ③: 패를 1장 버리고 발동할 수 있다. 카드명이 다른 \\\"아르카나 포스\\\" 몬스터 2장을 덱에서 패에 넣는다. 이 턴에, 자신은 \\\"아르카나 포스\\\" 몬스터밖에 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:23.427811',551,'2025-09-16 16:38:23.427811','SUDA-KR055','하얀 숲의 죄보','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 악마족 / 환상마족 / 마법사족 몬스터 중 어느 것이 존재할 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●패에서 악마족 / 환상마족 / 마법사족 몬스터 1장을 특수 소환한다. ●자신의 패 / 필드의 몬스터를 융합 소재로 하고, 융합 몬스터 1장을 융합 소환한다. ②: 이 카드가 몬스터의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:23.715314',552,'2025-09-16 16:38:23.715314','SUDA-KR056','프레이 더 디아벨','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 마법 / 함정 카드가 카드의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 패 / 덱 / 엑스트라 덱에서 환상마족 / 마법사족 몬스터 1장을 묘지로 보낸다. ②: 자신 메인 페이즈에, 자신 묘지에서 이 카드를 포함하는 마법 / 함정 카드 3장을 제외하고 발동할 수 있다. 자신의 패 / 묘지에서 \\\"디아벨\\\" 몬스터 1장을 특수 소환한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:23.899495',553,'2025-09-16 16:38:23.899495','SUDA-KR057','라이크 더 디아벨','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 마법 / 함정 카드가 효과로 묘지로 보내졌을 경우에 발동할 수 있다. 자신의 패 / 묘지에서 마법 / 함정 카드 1장을 자신 필드에 세트한다. 이 효과로 세트한 카드는 이 턴에 발동할 수 없다. ②: 자신 메인 페이즈에, 자신 묘지에서 이 카드를 포함하는 마법 / 함정 카드 3장을 제외하고 발동할 수 있다. 자신의 패 / 묘지에서 \\\"디아벨\\\" 몬스터 1장을 특수 소환한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:24.127791',554,'2025-09-16 16:38:24.127791','SUDA-KR059','머티리어크톨 멜트다운','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 메인 페이즈에 발동할 수 있다. 자신의 덱 위에서 카드를 6장 넘기고, 그 중에서 \\\"머티리어크톨\\\" 카드 1장을 골라 패에 넣을 수 있다. 나머지를 좋아하는 순서대로 덱 위로 되돌린다. 그 후, 자신 필드의 랭크 3 인 엑시즈 몬스터가 엑시즈 소재로 하고 있는 카드 1장을 패에 넣을 수 있다. ②: 자신의 엑시즈 몬스터가 효과를 발동했을 경우에 발동할 수 있다. 자신의 덱 맨 위의 카드를 자신 필드의 \\\"머티리어크톨\\\" 엑시즈 몬스터 1장의 엑시즈 소재로 한다.\"}',NULL,'UNCOMMON'),(1,42,'2025-09-16 16:38:24.377768',555,'2025-09-16 16:38:24.377768','SUDA-KR060','검투수의 투기장－플라비스','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 패를 1장 버리고 발동할 수 있다. 덱에서 \\\"검투수\\\" 몬스터 1장을 패에 넣는다. ②: 상대 몬스터의 공격 선언시에 발동할 수 있다. 덱에서 \\\"검투수\\\" 몬스터 1장을 특수 소환한다. 이 효과로 특수 소환한 몬스터는 전투로는 파괴되지 않는다. ③: 이 턴에 자신의 덱에서 \\\"검투수\\\" 몬스터가 특수 소환되어 있을 경우, 엔드 페이즈에 발동할 수 있다. 덱에서 \\\"글래디얼\\\"이나 \\\"검투\\\" 함정 카드 1장을 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:24.640356',556,'2025-09-16 16:38:24.640356','SUDA-KR061','크리스트론 인클루전','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"크리스트론 인클루전\\\" 이외의 \\\"크리스트론\\\" 카드 1장을 패에 넣을 수 있다. ②: 자신의 \\\"크리스트론\\\" 몬스터는 각각 1턴에 1번만 전투로는 파괴되지 않는다. ③: 묘지의 이 카드를 제외하고, 자신 묘지의 \\\"크리스트론\\\" 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:24.860352',557,'2025-09-16 16:38:24.860352','SUDA-KR062','천위무궁의 경지','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"텅 빈 용륜\\\"이나 \\\"천환의 용륜\\\" 1장을 패에 넣을 수 있다. ②: 자신 필드의 환룡족 몬스터 1장을 릴리스하고, 필드의 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 파괴한다. ③: 자신 엔드 페이즈에 발동할 수 있다. 이 카드를 묘지로 보내고, 자신의 덱 / 묘지에서 \\\"천위무붕의 땅\\\" 1장을 자신의 필드 존에 앞면 표시로 놓는다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:25.166372',558,'2025-09-16 16:38:25.166372','SUDA-KR064','헤 아르케－「휴도르」','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신이나 상대 묘지의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터 주인의 필드의 물 속성 몬스터 1장을 파괴하고, 대상 몬스터를 그 필드에 수비 표시로 특수 소환한다. ②: 이 턴에 묘지로 보내져 있지 않은 이 카드를 묘지에서 제외하고, 자신이나 상대 묘지의 물 속성 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터 주인의 필드의 몬스터 1장을 파괴하고, 대상 몬스터를 그 필드에 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:25.349876',559,'2025-09-16 16:38:25.349876','SUDA-KR065','더블 와일드','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 레벨 5 이하의 몬스터 1장을 대상으로 하고 발동할 수 있다. 원래의 종족이 그 몬스터와 같은 레벨 10 몬스터 1장을 덱에서 패에 넣는다. 그 후, 이하의 효과를 적용할 수 있다. 이 카드의 발동 후, 턴 종료시까지 자신은 원래의 종족이 대상 몬스터와 같은 몬스터밖에 특수 소환할 수 없다. ●자신의 패를 1장 골라 버리고, 종족이 이 효과로 넣은 몬스터와 같은 몬스터를 패에서 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:25.644146',560,'2025-09-16 16:38:25.644146','SUDA-KR066','유혹의 Δ','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 레벨 5 이상의 언데드족 몬스터 1장을 묘지로 보낼 수 있다. ②: 필드에 언데드족 몬스터가 존재할 경우에 발동할 수 있다. 자신 필드에 \\\"Δ(델타) 토큰\\\"(언데드족 / 어둠 / 레벨 5 / 공 0 / 수 0) 1장을 특수 소환한다. ③: 이 카드가 묘지에 존재하는 상태에서, 몬스터가 묘지에서 패에 넣어졌을 경우에 발동할 수 있다. 이 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:25.847294',561,'2025-09-16 16:38:25.847294','SUDA-KR072','ARG☆S－비연의 카파네','{\"attribute\": \"함정\", \"card_text\": \"①: 이 카드가 마법 & 함정 존에 존재하는 한, 자신의 전사족 몬스터는 전투로는 파괴되지 않는다. ②: 1턴에 1번, 몬스터 존에 지속 함정 카드가 존재할 경우에 발동할 수 있다. 이 카드는 이하의 효과를 가지는 효과 몬스터(전사족 / 빛 / 레벨 4 / 공 1800 / 수 1800)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다). 자신의 \\\"ARG☆S(아르고스타즈)\\\" 몬스터가 제외되어 있을 경우, 추가로 자신은 500 LP 회복한다. ●자신 / 상대 턴에 1번, 발동할 수 있다. 이 카드를 자신의 마법 & 함정 존에 앞면 표시로 놓는다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:26.064235',562,'2025-09-16 16:38:26.064235','SUDA-KR073','ARG☆S－도룡의 에테오','{\"attribute\": \"함정\", \"card_text\": \"①: 이 카드가 마법 & 함정 존에 존재하는 한, 자신 필드의 전사족 몬스터는 효과로는 파괴되지 않는다. ②: 1턴에 1번, 상대가 효과를 발동했을 때에 발동할 수 있다. 이 카드는 이하의 효과를 가지는 효과 몬스터(전사족 / 빛 / 레벨 4 / 공 800 / 수 800)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다). 자신의 \\\"ARG☆S(아르고스타즈)\\\" 몬스터가 제외되어 있을 경우, 추가로 필드의 카드 1장을 패로 되돌릴 수 있다. ●자신 / 상대 턴에 1번, 발동할 수 있다. 이 카드를 자신의 마법 & 함정 존에 앞면 표시로 놓는다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:26.335403',563,'2025-09-16 16:38:26.335403','SUDA-KR075','메탈화 플레임 코팅','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: \\\"메탈화 강화반사장갑\\\"의 카드명이 쓰여진 자신 필드의 앞면 표시 몬스터 1장을 릴리스하고 이 카드를 발동할 수 있다. \\\"메탈화 강화반사장갑\\\"의 카드명이 쓰여진 통상 소환할 수 없는 몬스터 1장을 소환 조건을 무시하고 덱에서 특수 소환한다. 그 후, 이 카드를 이하의 효과를 가지는 장착 카드로 취급하고 그 몬스터에 장착할 수 있다. ●장착 몬스터가 전투 / 효과로 파괴될 경우, 대신에 이 카드를 묘지로 보낼 수 있다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:26.532719',564,'2025-09-16 16:38:26.532719','SUDA-KR077','어비스팀','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 어류족 / 해룡족 / 물족 몬스터 종족의 종류의 수만큼 자신은 드로우한다. 이 카드의 발동 후, 다음 자신 턴의 종료시까지 자신은 물 속성 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 이 카드가 묘지에 존재하는 상태에서, 자신 필드의 앞면 표시인 물 속성 몬스터가 전투 / 효과로 파괴되었을 경우, 이 카드를 제외하고 발동할 수 있다. 자신의 묘지 / 제외 상태인 \\\"머메일\\\" 몬스터 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,42,'2025-09-16 16:38:26.705223',565,'2025-09-16 16:38:26.705223','SUDA-KR080','크리스트론 클러스터','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 \\\"크리스트론\\\" 카드는 상대 효과로는 제외할 수 없다. ②: 필드의 앞면 표시 카드 1장을 대상으로 하고 발동할 수 있다(자신 필드에 \\\"크리스트론\\\" 싱크로 몬스터가 존재할 경우, 이 효과의 대상을 2장으로 할 수 있다). \\\"크리스트론 클러스터\\\" 이외의 자신의 묘지 / 제외 상태인 \\\"크리스트론\\\" 카드 1장을 덱으로 되돌리고, 대상의 카드를 파괴한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:27.027397',566,'2025-09-16 16:38:27.027397','ALIN-KR005','이블 히어로 비셔스 클로즈','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2500\", \"card_text\": \"이 카드명의, ①의 효과는 1턴에 1번밖에 사용할 수 없으며, ②의 효과는 듀얼 중에 1번밖에 사용할 수 없다. ①: 필드의 \\\"히어로\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 패에서 수비 표시로 특수 소환하고, 대상 몬스터의 공격력을 300 올린다. ②: 자신 필드의 몬스터가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 이 카드를 묘지에서 특수 소환한다. 그 후, 자신 묘지에 \\\"다크 퓨전\\\"의 카드명이 쓰여진 몬스터가 존재할 경우, 필드의 카드 1장을 파괴할 수 있다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:27.262661',567,'2025-09-16 16:38:27.262661','ALIN-KR006','요정수 레굴루스','{\"attribute\": \"빛\", \"type\": \"[야수족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1700\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"고대 요정 드래곤\\\"의 카드명이 쓰여진 마법 / 함정 카드 1장을 패에 넣는다. ②: 자신 메인 페이즈에 발동할 수 있다. 패에서 야수족 / 식물족 / 천사족이고 레벨 4 이하인 빛 속성 몬스터 1장을 수비 표시로 특수 소환한다. ③: 묘지의 이 카드를 제외하고, 자신 묘지의 필드 마법 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 덱 맨 아래로 되돌린다. 그 후, 자신은 1장 드로우한다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:27.575426',568,'2025-09-16 16:38:27.575426','ALIN-KR007','요정포 스포어','{\"attribute\": \"빛\", \"type\": \"[식물족／튜너／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 400\", \"deffence\": \"수비력 800\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 특수 소환했을 경우에 발동할 수 있다. 이 카드의 레벨을 자신 필드의 몬스터의 수까지 올린다. ②: 이 카드가 묘지에 존재하고, 자신 필드에 \\\"고대 요정 드래곤\\\" 또는 야수족 / 식물족 / 천사족인 빛 속성 몬스터 중 어느 것이 존재할 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과의 발동 후, 턴 종료시까지 자신은 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:27.906168',569,'2025-09-16 16:38:27.906168','ALIN-KR008','요정령 크리본','{\"attribute\": \"빛\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 300\", \"deffence\": \"수비력 200\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"고대 요정 드래곤\\\" 또는 야수족 / 식물족 / 천사족인 빛 속성 몬스터 중 어느 것이 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 효과로 특수 소환한 이 카드는 튜너로 취급한다. ②: 자신 필드의 다른, \\\"고대 요정 드래곤\\\" 또는 그 카드명이 쓰여진 몬스터가 효과로 파괴될 경우, 대신에 필드의 이 카드를 패로 되돌릴 수 있다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:28.186435',570,'2025-09-16 16:38:28.186435','ALIN-KR009','문장수 그리폰','{\"attribute\": \"바람\", \"type\": \"[비행야수족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 덱에서 \\\"문장수 그리폰\\\" 이외의 \\\"문장수\\\" 몬스터 1장을 묘지로 보내고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 효과의 발동 후, 턴 종료시까지 자신은 원래의 카드명에 \\\"문장수\\\"나 \\\"No.\\\"를 포함하는 몬스터만을 소재로 한 엑시즈 소환으로밖에 엑스트라 덱에서 몬스터를 특수 소환할 수 없다. ②: 몬스터 3장 이상을 소재로 하는 \\\"No.\\\" 엑시즈 몬스터를 엑시즈 소환할 경우, 이 카드는 2장만큼의 엑시즈 소재로 할 수 있다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:28.463719',571,'2025-09-16 16:38:28.463719','ALIN-KR010','문장수 스탓트 웨일','{\"attribute\": \"물\", \"type\": \"[어류족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 900\", \"deffence\": \"수비력 1900\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우, 패를 1장 버리고 발동할 수 있다. 덱에서 \\\"메달리온\\\" 마법 / 함정 카드 2장을 패에 넣는다. ②: 묘지의 이 카드를 제외하고, 자신 묘지의 같은 이름의 \\\"문장수\\\" 몬스터 2장을 대상으로 하여 발동할 수 있다. 그 몬스터를 수비 표시로 특수 소환한다. 이 효과의 발동 후, 턴 종료시까지 자신은 원래의 카드명에 \\\"문장수\\\"나 \\\"No.\\\"를 포함하는 몬스터만을 소재로 한 엑시즈 소환으로밖에 엑스트라 덱에서 몬스터를 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:28.795050',572,'2025-09-16 16:38:28.795050','ALIN-KR018','광정룡－스펙트르','{\"attribute\": \"빛\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 600\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 드래곤족이나 빛 속성의 몬스터 1장과 이 카드를 패에서 버리고 발동할 수 있다. 덱에서 \\\"광정룡－스펙트르\\\" 이외의 \\\"정룡\\\" 몬스터 2장을 패에 넣는다. ②: 드래곤족이나 빛 속성의 몬스터 1장과 이 카드를 자신 묘지에서 제외하고, 자신 묘지의 \\\"극정룡－샤스마티스\\\" 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:29.017753',573,'2025-09-16 16:38:29.017753','ALIN-KR019','암정룡－네뷸라스','{\"attribute\": \"어둠\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 600\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 드래곤족이나 어둠 속성의 몬스터 1장과 이 카드를 패에서 버리고, \\\"암정룡－네뷸라스\\\" 이외의 자신의 제외 상태인 속성이 다른 \\\"정룡\\\" 몬스터 2장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다. 이 효과로 특수 소환한 몬스터는 이 턴에 공격할 수 없다. ②: 드래곤족이나 어둠 속성의 몬스터 1장과 이 카드를 자신 묘지에서 제외하고, 자신 묘지의 \\\"흉정룡－이클렙시스\\\" 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:29.242975',574,'2025-09-16 16:38:29.242975','ALIN-KR020','ARG☆S－열투의 파르테','{\"attribute\": \"땅\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1400\", \"deffence\": \"수비력 1400\", \"card_text\": \"이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대 턴에, 패의 이 카드를 상대에게 보여주고 발동할 수 있다. 자신 필드의 앞면 표시인 \\\"ARG☆S(아르고스타즈)\\\" 지속 함정 카드 1장을 패로 되돌리고, 이 카드를 특수 소환한다. ②: 이 카드의 공격력 / 수비력은, 자신 필드의 다른 \\\"ARG☆S(아르고스타즈)\\\" 몬스터의 종류 × 700 올린다. ③: 필드의 이 카드를 제외하고 발동할 수 있다. 패에서 지속 함정 카드 1장을 세트한다. 이 효과로 세트한 카드는 세트한 턴에도 발동할 수 있다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:30.287168',575,'2025-09-16 16:38:30.287168','ALIN-KR025','붉은 눈의 강조룡','{\"attribute\": \"어둠\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 뒷면 표시 카드 1장을 묘지로 보내고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 일반 소환 / 특수 소환했을 경우, 자신의 필드나 묘지에 \\\"메탈화 강화반사장갑\\\"이 존재하고 있으면 발동할 수 있다. 자신의 덱 / 묘지에서 \\\"메탈화\\\" 함정 카드 1장을 패에 넣는다. ③: 이 카드가 몬스터 존에 존재하는 한, 자신은 \\\"메탈화\\\" 함정 카드를 세트한 턴에도 발동할 수 있다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:31.042312',576,'2025-09-16 16:38:31.042312','ALIN-KR030','NT8000－SIRIUS','{\"attribute\": \"어둠\", \"type\": \"[기계족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2300\", \"deffence\": \"수비력 2500\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 링크 상태의 이 카드는 전투로는 파괴되지 않는다. ②: 링크 몬스터의 효과가 발동한 자신 / 상대 턴에, 자신 및 상대 필드의 앞면 표시 카드를 1장씩 대상으로 하고 발동할 수 있다. 그 카드 2장을 파괴한다. ③: 이 카드가 필드 이외에서 묘지로 보내졌을 경우, 자신 필드에 어둠 속성 링크 몬스터가 존재하고 있으면 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:31.459995',577,'2025-09-16 16:38:31.459995','ALIN-KR031','사악룡 이블 나이트 드래곤','{\"attribute\": \"어둠\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2350\", \"deffence\": \"수비력 2400\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 필드의 어둠 속성 몬스터 1장을 릴리스하고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드가 전투로 파괴되었을 때, 상대 필드의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 묘지로 보낸다. 그 후, 이 카드를 특수 소환할 수 있다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:31.867423',578,'2025-09-16 16:38:31.867423','ALIN-KR032','홍천마 파이어 윙 페가수스','{\"attribute\": \"화염\", \"type\": \"[야수족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2250\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대 필드의 몬스터의 수가 자신 필드의 몬스터보다 많을 경우, 이 카드는 패에서 특수 소환할 수 있다. 이 턴에, 이 카드는 직접 공격할 수 있다. ②: 상대가 필드의 몬스터의 효과를 발동했을 때에 발동할 수 있다. 이 효과의 발동시에 쌓여 있는 체인의 수 × 300 데미지를 상대에게 주고, 이 카드는 그 효과들로는 파괴되지 않는다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:32.266052',579,'2025-09-16 16:38:32.266052','ALIN-KR033','브레인 컨트롤러','{\"attribute\": \"어둠\", \"type\": \"[사이킥족／튜너／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 100\", \"deffence\": \"수비력 200\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"세뇌－브레인 컨트롤－\\\" 1장을 패에 넣는다. ②: 자신이 LP를 지불했을 경우, 필드의 앞면 표시 몬스터 1장을 대상으로 하고, 1~8 까지의 임의의 레벨을 선언하여 발동할 수 있다. 그 몬스터의 레벨을 선언한 레벨로 한다. ③: 이 카드가 싱크로 소재로서 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 효과를 무효로 하고 상대 필드에 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:32.681828',580,'2025-09-16 16:38:32.681828','ALIN-KR034','봄버 플레이스','{\"attribute\": \"어둠\", \"type\": \"[마법사족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 1350\", \"deffence\": \"수비력 2400\", \"card_text\": \"①: 자신 / 상대 턴에, 600 LP를 지불하고, 이하에서 1개를 선택하여 발동할 수 있다(동일한 체인 위에서는 1번까지). ●자신 필드에 레벨 1~6 의 몬스터가 전부 존재할 경우에 발동할 수 있다. 상대 필드의 앞면 표시 몬스터 1장을 고르고, 그 레벨과 레벨 / 랭크 / 링크의 수치가 같은, 고른 몬스터 이외의 상대 필드의 몬스터를 전부 파괴한다. ●자신 필드의 앞면 표시 몬스터 1장을 고르고, 그 레벨과 레벨 / 랭크 / 링크의 수치가 같은, 고른 몬스터 정면의 상대 몬스터를 전부 파괴한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:33.587371',581,'2025-09-16 16:38:33.587371','ALIN-KR041','하얀 숲의 환요','{\"attribute\": \"빛\", \"type\": \"[환상마족／싱크로／튜너／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 700\", \"deffence\": \"수비력 2000\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 특수 소환했을 경우, 자신 묘지의 \\\"하얀 숲\\\" 몬스터 2장을 대상으로 하고 발동할 수 있다. 그 몬스터를 지속 마법 카드로 취급하고 원래 주인의 마법 & 함정 존에 앞면 표시로 놓는다. ②: 상대 메인 페이즈에 발동할 수 있다. 이 카드를 포함하는 자신 필드의 몬스터를 소재로서 싱크로 소환을 실행한다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:33.830271',582,'2025-09-16 16:38:33.830271','ALIN-KR043','주뢰신 쥬라','{\"attribute\": \"땅\", \"type\": \"[사이킥족／싱크로／효과]\", \"level\": \"레벨 11\", \"attack\": \"공격력 3100\", \"deffence\": \"수비력 3100\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 몬스터 존에 존재하는 한, 상대가 카드의 효과를 발동할 때마다, 자신은 300 LP 회복한다. ②: 상대 턴에, 1500 LP를 지불하고, 이 카드를 릴리스하고, 이하의 효과에서 1개를 선택하여 발동할 수 있다. ●상대 필드의 앞면 표시 몬스터를 전부 파괴한다. ●상대 필드의 앞면 표시의 마법 / 함정 카드를 전부 파괴한다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:34.077847',583,'2025-09-16 16:38:34.077847','ALIN-KR045','No.69 갓 메달리온 코트 오브 암즈－갓 섀터','{\"attribute\": \"빛\", \"type\": \"[사이킥족／엑시즈／효과]\", \"rank\": \"랭크 4\", \"attack\": \"공격력 2800\", \"deffence\": \"수비력 1600\", \"card_text\": \"레벨 4 몬스터 × 4이 카드는 원래 카드명이 \\\"No.69 갓 메달리온 코트 오브 암즈\\\"인 자신 필드의 몬스터 위에 겹쳐 엑시즈 소환할 수도 있다. 이 카드명의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대 필드의 몬스터가 효과를 발동했을 때, 또는 상대 몬스터의 공격 선언시에 발동할 수 있다. \\\"No.69 갓 메달리온 코트 오브 암즈－갓 레이지\\\" 1장을 자신 필드의 이 카드 위에 겹쳐 엑시즈 소환으로 취급하고 엑스트라 덱에서 특수 소환한다. 그 후, 그 상대 몬스터 1장을 파괴한다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:34.838207',584,'2025-09-16 16:38:34.838207','ALIN-KR050','노발천충 세이버 사우루스','{\"attribute\": \"화염\", \"type\": \"[공룡족／엑시즈／효과]\", \"rank\": \"랭크 4\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 600\", \"card_text\": \"레벨 4 몬스터 × 2이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 엑시즈 소재를 1개 제거하고 발동할 수 있다. 자신의 패 / 필드(앞면 표시)의 공룡족 몬스터 1장을 파괴한다. 그 후, 필드의 몬스터 1장의 표시 형식을 변경할 수 있다. ②: 다른 자신의 공룡족 몬스터가 전투를 실행하는 데미지 스텝 개시시에 발동할 수 있다. 이 카드를 파괴하고, 그 공룡족 몬스터의 공격력을 배틀 페이즈 종료시까지 2000 올린다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:35.058908',585,'2025-09-16 16:38:35.058908','ALIN-KR053','기동석기 도그라드','{\"attribute\": \"땅\", \"type\": \"[암석족／링크／효과]\", \"link_arrows\": \"Top/Bottom-Left/Bottom-Right\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 -\", \"card_text\": \"암석족 몬스터를 포함하는 몬스터 2장 이상이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 특수 소환했을 경우, 자신 묘지의 암석족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드의 공격력은 대상 몬스터의 공격력만큼 올린다. ②: 상대 메인 페이즈에, 이 카드의 공격력 이하의 공격력을 가지는 필드의 다른 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드의 공격력을 대상 몬스터의 공격력만큼 내리고, 대상 몬스터를 파괴한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:35.289300',586,'2025-09-16 16:38:35.289300','ALIN-KR054','츠나가리－Ai－','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 패의 사이버스족 몬스터 1장을 상대에게 보여주고 발동할 수 있다. 보여준 몬스터의 속성에 따라 이하의 효과를 적용한다. 이 카드의 발동 후, 턴 종료시까지 자신은 사이버스족 몬스터밖에 특수 소환할 수 없다.●어둠: 보여준 몬스터를 특수 소환하고, 덱에서 어둠 속성 이외로 레벨 4 이하인 사이버스족 몬스터 1장을 패에 넣는다.●어둠 이외: 보여준 몬스터를 덱으로 되돌리고, 되돌린 몬스터와는 속성이 다른 \\\"＠(앳)이그니스터\\\" 몬스터 1장을 덱에서 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:35.531383',587,'2025-09-16 16:38:35.531383','ALIN-KR055','정령의 세계','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드명의 ②③의 효과는 자신 필드에 레벨 7 이상의 드래곤족 / 빛 속성 싱크로 몬스터가 존재할 경우에밖에 발동할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"고대 요정 드래곤\\\"의 카드명이 쓰여진 몬스터 1장을 패에 넣을 수 있다. ②: 몬스터가 공격 표시로 특수 소환될 때마다 발동한다. 그 몬스터를 수비 표시로 한다. ③: 자신 / 상대의 엔드 페이즈에 발동한다. 턴 플레이어의 필드의 공격 표시 몬스터를 전부 파괴한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:35.741151',588,'2025-09-16 16:38:35.741151','ALIN-KR056','메달리온 플래시','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대 필드의 앞면 표시 몬스터를 임의의 수만큼 대상으로 하고 발동할 수 있다. 그 몬스터의 카드명을 \\\"언논\\\"으로 취급한다. ②: 자신 엔드 페이즈에, 이 카드가 묘지에 존재하고, 자신 필드에 사이킥족 엑시즈 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다. 이 효과로 세트한 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:36.138581',589,'2025-09-16 16:38:36.138581','ALIN-KR058','하얀 숲의 마녀','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"하얀 숲\\\" 몬스터 1장을 패에 넣을 수 있다. 그 경우, 이 턴에, 자신은 어둠 속성 몬스터를 엑스트라 덱에서 특수 소환할 수 없다. ②: 자신의 \\\"하얀 숲\\\" 몬스터는 각각 1턴에 1번만 전투로는 파괴되지 않는다. ③: 자신 필드의 \\\"하얀 숲\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 턴에, 그 몬스터를 튜너로서 취급한다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:36.312665',590,'2025-09-16 16:38:36.312665','ALIN-KR061','초룡재화','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신의 패 / 묘지 / 제외 상태인 \\\"정룡\\\" 몬스터 1장을 특수 소환한다. 그 후, 자신 필드의 \\\"정룡\\\" 몬스터만을 소재로서 \\\"정룡\\\" 엑시즈 몬스터 1장의 엑시즈 소환을 실행할 수 있다. ②: 자신 메인 페이즈에 묘지의 이 카드를 제외하고, 자신의 제외 상태인 \\\"정룡\\\" 몬스터를 임의의 수만큼 대상으로 하여 발동할 수 있다(같은 속성은 1장까지). 그 몬스터를 묘지로 되돌린다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:36.485086',591,'2025-09-16 16:38:36.485086','ALIN-KR062','ARG☆S－GiantKilling','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 덱에서 \\\"ARG☆S(아르고스타즈)\\\" 몬스터 1장을 패에 넣는다. 자신의 몬스터 존에 지속 함정 카드가 존재할 경우, 또는 자신을 몬스터로서 특수 소환하는 효과를 가지는 지속 함정 카드가 자신의 마법 & 함정 존에 존재할 경우, 추가로 전사족 몬스터 1장의 일반 소환을 실행할 수 있다. ②: 자신 메인 페이즈에 묘지의 이 카드를 제외하고, 자신 필드의 \\\"ARG☆S(아르고스타즈)\\\" 지속 함정 카드를 포함하는 필드의 카드 2장을 대상으로 하여 발동할 수 있다. 그 카드를 패로 되돌린다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:36.749978',592,'2025-09-16 16:38:36.749978','ALIN-KR063','머티리어크톨 멜트스루','{\"attribute\": \"마법\", \"card_text\": \"①: 이 카드의 발동시의 효과 처리로서, 자신의 덱 위에서 카드를 6장 넘기고, 좋아하는 순서대로 덱 위로 되돌린다. ②: 1턴에 1번, 1500 LP를 지불하고 발동할 수 있다. \\\"머티리어크톨\\\" 엑시즈 몬스터 1장을 자신 필드의 레벨 3 일반 몬스터 1장 위에 겹쳐 엑시즈 소환으로 취급하고 엑스트라 덱에서 특수 소환한다. 이 턴에, 자신은 엑시즈 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ③: 엑시즈 몬스터가 엑시즈 소환되었을 경우에 발동할 수 있다. 자신의 덱 맨 위의 카드를 자신 필드의 \\\"머티리어크톨\\\" 엑시즈 몬스터 1장의 엑시즈 소재로 한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:36.985969',593,'2025-09-16 16:38:36.985969','ALIN-KR064','M∀LICE IN THE MIRROR','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 자신의 패 / 필드(앞면 표시)에서 \\\"M∀LICE(맬리스)\\\" 몬스터 1장을 제외하고, 대상 몬스터의 효과를 턴 종료시까지 무효로 한다. ②: 이 카드가 제외되었을 경우, 자신 묘지의 \\\"M∀LICE(맬리스)\\\" 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 제외하고, 제외한 카드와 같은 종류(몬스터 / 마법 / 함정)의 \\\"M∀LICE(맬리스)\\\" 카드 1장을 덱에서 패에 넣는다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:37.244397',594,'2025-09-16 16:38:37.244397','ALIN-KR065','저주받은 하인 마스터','{\"attribute\": \"마법\", \"card_text\": \"①: 자신의 \\\"저주받은 하인 킹\\\"이 수비 표시 몬스터를 공격했을 경우, 그 수비력을 공격력이 넘은 만큼만 상대에게 전투 데미지를 준다. ②: 1턴에 1번, 자신 묘지의 \\\"저주받은 하인\\\"이나 \\\"저주받은 하인 킹\\\" 1장을 대상으로 하고 발동할 수 있다. \\\"저주받은 하인\\\" 또는 그 카드명이 쓰여진 몬스터 1장을 덱에서 묘지로 보내고, 대상 몬스터를 특수 소환한다. 이 효과의 발동 후, 턴 종료시까지 자신은 언데드족 몬스터밖에 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:37.615826',595,'2025-09-16 16:38:37.615826','ALIN-KR068','이른아침달리자 둘이함께달리자','{\"attribute\": \"마법\", \"card_text\": \"①: 자신의 필드(앞면 표시) / 묘지 / 제외 상태 중 어느 쪽에도 \\\"이른아침달리자 둘이함께달리자\\\"가 존재하지 않을 경우, 자신의 덱 위에서 카드 7장을 뒷면으로 제외하고 발동할 수 있다. 상대는 자신의 덱 위 / 엑스트라 덱에서 합계 7장의 카드를 뒷면으로 제외해야 한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:37.803366',596,'2025-09-16 16:38:37.803366','ALIN-KR069','칠성천류발도술－「파군」','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터와는 카드명이 다르고, 종족이 같은 레벨 7 몬스터 1장을 공격력 700 올리는 장착 마법 카드로 취급하고 패 / 덱에서 대상 몬스터에 장착한다. 이 효과로 장착한 카드는 엔드 페이즈에 패로 되돌아간다. ②: 이 카드가 묘지에 존재하는 상태에서, 레벨 / 랭크가 8 이상의 상대 몬스터가 전투로 파괴되었을 때에 발동할 수 있다. 이 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:38.044572',597,'2025-09-16 16:38:38.044572','ALIN-KR071','이터널 선샤인','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴 중에, 자신 필드의 \\\"고대 요정 드래곤\\\" 및 그 카드명이 쓰여진 몬스터의 수까지 사용할 수 있다. ①: 자신 필드의 몬스터의 수비력은, 자신 필드의 \\\"고대 요정 드래곤\\\" 및 그 카드명이 쓰여진 몬스터의 수 × 500 올린다. ②: 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다(동일한 체인 위에서는 1번까지). 그 몬스터는 턴 종료시까지, 공격력 / 수비력이 절반이 되고, 효과는 무효화된다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:38.269475',598,'2025-09-16 16:38:38.269475','ALIN-KR072','커스 오브 디아벨','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"디아벨\\\" 몬스터가 2장 이상 존재할 경우, 자신 필드의 몬스터 1장을 묘지로 보내고 발동할 수 있다. 상대 필드의 앞면 표시 카드를 전부 파괴한다. ②: 이 카드가 패 / 덱에서, 묘지로 보내졌을 경우 또는 제외되었을 경우에 발동할 수 있다. 덱에서 \\\"커스 오브 디아벨\\\" 이외의 \\\"디아벨\\\" 마법 / 함정 카드 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:38.504366',599,'2025-09-16 16:38:38.504366','ALIN-KR073','죄 없는 죄보','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이하의 효과에서 1개를 선택하고 발동할 수 있다.●자신의 묘지 / 제외 상태인 \\\"디아벨\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 자신의 패를 1장 골라 버리고, 대상 몬스터를 특수 소환한다.●자신의 마법 & 함정 존의 앞면 표시의 몬스터 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 특수 소환한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:38.791660',600,'2025-09-16 16:38:38.791660','ALIN-KR075','라이제올 매스 드라이버','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 턴 중에, 이하의 효과를 적용한다. 그 후, 이 카드를 자신 필드의 랭크 4 의 엑시즈 몬스터의 엑시즈 소재로 할 수 있다. ●자신 필드의 \\\"라이제올\\\" 몬스터의 공격력은 1000 올린다. ②: 이 카드가 필드 이외에서 묘지로 보내졌을 경우, 상대 묘지의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 제외한다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:38.982143',601,'2025-09-16 16:38:38.982143','ALIN-KR077','고귀한 황금향의 엘드릭시르','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 800 LP를 지불하고, 이하의 효과에서 1개를 선택하여 발동할 수 있다.●이 카드는 일반 몬스터(언데드족 / 빛 / 레벨 10 / 공 1500 / 수 2800)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다). 자신 필드에 \\\"황금경 엘드리치\\\"가 존재할 경우, 추가로 필드의 몬스터 1장을 패로 되돌릴 수 있다.●자신의 제외 상태인 \\\"황금향\\\" 마법 / 함정 카드나 \\\"엘드릭시르\\\" 마법 / 함정 카드 1장을 자신 필드에 세트한다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:39.191829',602,'2025-09-16 16:38:39.191829','ALIN-KR078','열왕시편','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. 자신 묘지에 몬스터가 존재하지 않을 경우, 이 카드의 발동은 패에서도 할 수 있다. ①: 상대가 필드의 몬스터의 효과를 발동했을 때에 발동할 수 있다. 그 효과를 무효로 한다. 자신 묘지에 함정 카드가 존재할 경우, 추가로 덱에서 \\\"도미나스\\\" 카드 1장을 패에 넣을 수 있다. 이 카드를 패에서 발동했을 경우, 발동 후, 다음 턴 종료시까지 자신은 패 / 묘지 / 제외 상태인 몬스터의 효과를 발동할 수 없다.\"}',NULL,'UNCOMMON'),(1,43,'2025-09-16 16:38:39.389543',603,'2025-09-16 16:38:39.389543','ALIN-KR079','드래곤즈 마인드','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 원래 공격력 또는 원래 수비력이 2500 인 몬스터가 존재하고, 몬스터의 효과 / 마법 / 함정 카드가 발동했을 때에 발동할 수 있다. 그 발동을 무효로 하고 파괴한다. ②: 이 카드가 묘지에 존재할 경우, 2500 LP를 지불하고 발동할 수 있다. 이 카드를 자신 필드에 세트한다. 이 효과로 세트한 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,43,'2025-09-16 16:38:39.662796',604,'2025-09-16 16:38:39.662796','ALIN-KR080','어브덕션','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 원래의 종족과 원래의 속성과 원래의 레벨 / 랭크 / 링크가 대상 몬스터와 같은 몬스터 1장을 덱 / 엑스트라 덱에서 제외하고, 대상 몬스터의 컨트롤을 얻는다. 원래의 카드명이 대상 몬스터와 같은 몬스터를 이 효과로 제외했을 경우, 이 효과로 컨트롤을 얻은 몬스터의 효과는 무효화된다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:40.171391',605,'2025-09-16 16:38:40.171391','AGOV-KR002','패왕권룡 라이트브룸','{\"attribute\": \"빛\", \"type\": \"[드래곤족／펜듈럼／튜너／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1200\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명의 ①②의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 자신의 엑스트라 덱(앞면)에서 \\\"패왕권룡\\\" 펜듈럼 몬스터나 \\\"패왕문\\\" 펜듈럼 몬스터 1장을 패에 넣는다. 그 후, \\\"패왕권룡\\\" 싱크로 몬스터 1장의 싱크로 소환 또는 \\\"패왕권룡\\\" 엑시즈 몬스터 1장의 엑시즈 소환을 실행할 수 있다. ②: 이 카드가 엑스트라 덱에 앞면으로 존재하는 상태에서, 자신 필드의 앞면 표시 펜듈럼 몬스터가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 이 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:40.752154',606,'2025-09-16 16:38:40.752154','AGOV-KR012','호루스의 축복－두아무테프','{\"attribute\": \"물\", \"type\": \"[야수족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"왕의 관\\\"이 존재할 경우, 이 카드는 묘지에서 특수 소환할 수 있다. ②: 이 카드의 공격력 / 수비력은, 자신 필드의 \\\"호루스\\\" 몬스터의 수 × 1200 올린다. ③: 이 카드가 몬스터 존에 존재하는 상태에서, 자신 필드의 다른 카드가 상대 효과로 필드에서 벗어났을 경우에 발동할 수 있다. 자신 메인 몬스터 존의 몬스터의 종류의 수만큼, 자신은 드로우한다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:41.117381',607,'2025-09-16 16:38:41.117381','AGOV-KR013','호루스의 선도－하피','{\"attribute\": \"바람\", \"type\": \"[야수전사족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 1600\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"왕의 관\\\"이 존재할 경우, 이 카드는 묘지에서 특수 소환할 수 있다. ②: 이 카드가 몬스터 존에 존재하는 상태에서, 자신 필드의 다른 카드가 상대 효과로 필드에서 벗어났을 경우, 서로의 묘지 / 제외 상태인 카드 중에서 합계 2장을 대상으로 하고 발동할 수 있다. 그 카드 2장을 주인의 패에 넣거나 그 카드 2장을 덱으로 되돌린다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:41.336072',608,'2025-09-16 16:38:41.336072','AGOV-KR014','호루스의 가호－케벤세누프','{\"attribute\": \"땅\", \"type\": \"[비행야수족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"왕의 관\\\"이 존재할 경우, 이 카드는 묘지에서 특수 소환할 수 있다. ②: 이 카드가 몬스터 존에 존재하는 상태에서, 자신 필드의 다른 카드가 상대 효과로 필드에서 벗어났을 경우에 발동할 수 있다. 이 턴에, 상대 몬스터는 \\\"호루스\\\" 몬스터를 공격 대상으로 할 수 없으며, 상대는 필드의 \\\"호루스\\\" 몬스터를 효과의 대상으로 할 수 없다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:41.908872',609,'2025-09-16 16:38:41.908872','AGOV-KR018','VS 쟈오롱','{\"attribute\": \"화염\", \"type\": \"[환룡족／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 2100\", \"card_text\": \"이 카드명의 ①②의 효과는, 각각 1턴에 1번밖에 사용할 수 없으며, 동일한 체인 위에서는 발동할 수 없다. ①: 자신이 \\\"VS(뱅키시 소울)\\\" 카드의 효과를 발동하기 위해 패를 보여줬을 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 자신 / 상대 턴에, 이하에서 1개 선택하고, 그 속성의 패의 몬스터를 1장씩 상대에게 보여주고 발동할 수 있다. ●화염: 필드의 몬스터 1장의 표시 형식을 변경한다. ●화염 / 화염: 덱에서 \\\"VS(뱅키시 소울) 쟈오롱\\\" 이외의 \\\"VS(뱅키시 소울)\\\" 카드 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:42.084863',610,'2025-09-16 16:38:42.084863','AGOV-KR021','유에프오라이트','{\"attribute\": \"화염\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 배틀 페이즈 이외로는, 필드의 이 카드를 상대는 효과의 대상으로 할 수 없다. ②: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다. ③: 자신 / 상대의 엔드 페이즈에 발동할 수 있다. 자신은 1장 드로우한다. 그 후, 자신의 패를 임의의 수만큼 골라 제외하고, 이 카드의 공격력은 이 효과로 제외한 카드의 수 × 500 올린다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:42.336044',611,'2025-09-16 16:38:42.336044','AGOV-KR022','오오야츠 츠마무히메','{\"attribute\": \"빛\", \"type\": \"[식물족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 200\", \"card_text\": \"①: 1턴에 1번, 필드의 이 카드가 공격 / 효과의 대상이 되었을 때에 발동할 수 있다. 자신 필드에 \\\"오야츠 토큰\\\"(식물족 / 빛 / 레벨 1 / 공 800 / 수 800) 1장을 특수 소환한다. ②: 1턴에 1번, 상대가 몬스터를 특수 소환할 시기에, 자신 필드의 일반 몬스터 1장을 릴리스하고 발동할 수 있다. 그 특수 소환을 무효로 하고, 그 몬스터를 파괴한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:42.550125',612,'2025-09-16 16:38:42.550125','AGOV-KR023','인베이시브 에일리언 스피시즈－I.A.S','{\"attribute\": \"빛\", \"type\": \"[파충류족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 상대의 필드 존에 앞면 표시 카드가 존재할 경우, 이 카드는 전투 / 효과로는 파괴되지 않는다. ②: 상대의 필드 존에 앞면 표시 카드가 존재할 경우, 상대 필드의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 파괴하고, 이 카드의 공격력을 1000 올린다. ③: 이 카드가 묘지에 존재하고, 상대의 필드 존에 앞면 표시 카드가 존재할 경우에 발동할 수 있다. 이 카드를 특수 소환한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:42.881614',613,'2025-09-16 16:38:42.881614','AGOV-KR025','대음양사 타오','{\"attribute\": \"땅\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 1200\", \"deffence\": \"수비력 900\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다. ②: 이 카드가 묘지로 보내졌을 경우, \\\"대음양사 타오\\\" 이외의 자신 묘지의 환상마족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 수비 표시로 특수 소환한다. 이 효과의 발동 후, 턴 종료시까지 자신은 환상마족 몬스터밖에 묘지에서 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:43.246691',614,'2025-09-16 16:38:43.246691','AGOV-KR026','하나요메닌교','{\"attribute\": \"땅\", \"type\": \"[마법사족／튜너／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 2100\", \"card_text\": \"①: 이 카드를 드로우했을 때, 이 카드를 상대에게 보여주고 발동할 수 있다. 이 카드를 특수 소환한다. ②: 자신 / 상대의 배틀 페이즈 개시시에 발동한다. 자신의 덱 매수가 상대보다도 많을 경우, 이 카드의 공격력은 턴 종료시까지, 그 차의 수 × 300 올린다. ③: 이 카드가 묘지로 보내진 턴의 엔드 페이즈에 발동한다. 이 카드를 덱 맨 위로 되돌린다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:43.488329',615,'2025-09-16 16:38:43.488329','AGOV-KR028','에스프릿 셰이드－희공작','{\"attribute\": \"바람\", \"type\": \"[비행야수족／의식／스피릿／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 2000\", \"card_text\": \"에스프릿 콜링에 의해 의식 소환이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 카드명은, 패 / 필드에 존재하는 한 \\\"에스프릿 로드－희공작\\\"으로 취급한다. ②: 이 카드를 의식 소환했을 경우에 발동할 수 있다. 효과 텍스트에 \\\"스피릿 몬스터\\\"라고 쓰여진 마법 / 함정 카드 1장을 덱에서 패에 넣는다. ③: 이 카드가 제외된 다음 턴의 스탠바이 페이즈에 발동한다. 제외 상태인 이 카드를 특수 소환한다. ④: 이 카드를 특수 소환한 턴의 엔드 페이즈에 발동한다. 이 카드를 패로 되돌린다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:43.665841',616,'2025-09-16 16:38:43.665841','AGOV-KR029','에스프릿 셰이드－언공작','{\"attribute\": \"바람\", \"type\": \"[비행야수족／의식／스피릿／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 200