:44.883307','AGOV-KR039','엑시즈 아머 토르피도','{\"attribute\": \"물\", \"type\": \"[전사족／엑시즈／효과]\", \"rank\": \"랭크 3\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 800\", \"card_text\": \"레벨 3 몬스터 × 2이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 엑시즈 소재가 없는 이 카드는 공격할 수 없다. ②: 이 카드의 엑시즈 소재를 2개 제거하고 발동할 수 있다. 자신은 1장 드로우한다. ③: 이 카드가 장착되어 있는 한, 이하의 효과를 적용한다. ●장착 몬스터가 전투를 실행할 경우, 데미지 스텝 종료시까지, 상대는 카드의 효과를 발동할 수 없으며, 상대 필드의 앞면 표시 몬스터의 효과는 무효화된다. ●장착 몬스터가 엑시즈 몬스터일 경우, 상대는 장착 몬스터를 효과의 대상으로 할 수 없다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:45.406525',621,'2025-09-16 16:38:45.406525','AGOV-KR043','헬프레임밴시','{\"attribute\": \"화염\", \"type\": \"[화염족／엑시즈／효과]\", \"rank\": \"랭크 4\", \"attack\": \"공격력 1700\", \"deffence\": \"수비력 600\", \"card_text\": \"레벨 4 몬스터 × 2이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 엑시즈 소재를 1개 제거하고 발동할 수 있다. 덱에서 화염족 몬스터 1장을 고르고, 패에 넣거나 묘지로 보낸다. ②: 이 카드가 제외되었을 경우, 자신 필드에 화염족 몬스터가 존재하고 있으면 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드의 공격력은 턴 종료시까지, 자신의 제외 상태인 몬스터의 수 × 100 올린다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:45.815519',622,'2025-09-16 16:38:45.815519','AGOV-KR048','광익의 용','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 / 상대의 메인 페이즈에 발동할 수 있다. 덱에서 \\\"패왕권룡\\\" 펜듈럼 몬스터나 \\\"패왕문\\\" 펜듈럼 몬스터 1장을 패에 넣는다. 자신 필드에 \\\"패왕룡 즈아크\\\"가 존재할 경우, 패에 넣지 않고 특수 소환할 수도 있다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:46.156931',623,'2025-09-16 16:38:46.156931','AGOV-KR050','TG－올클리어','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 필드의 \\\"TG(테크지너스)\\\" 몬스터는 기계족이 된다. ②: 자신은 통상 소환 외에도 1번만, 자신 메인 페이즈에 \\\"TG(테크지너스)\\\" 몬스터 1장을 일반 소환할 수 있다. ③: 자신 메인 페이즈에 발동할 수 있다. 자신의 패 / 필드의 \\\"TG(테크지너스)\\\" 몬스터 1장을 파괴하고, 그 몬스터와는 카드명이 다른 \\\"TG(테크지너스)\\\" 몬스터 1장을 자신의 덱 / 묘지에서 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:46.471185',624,'2025-09-16 16:38:46.471185','AGOV-KR054','“죄보사냥의 악마”','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 덱 / 묘지에서 \\\"디아벨스타\\\" 몬스터 1장을 패에 넣는다. ②: 자신 메인 페이즈에 묘지의 이 카드를 제외하고, \\\"“죄보사냥의 악마”\\\" 이외의 자신의 묘지 / 제외 상태인 \\\"죄보\\\" 마법 / 함정 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 덱 맨 아래로 되돌린다. 그 후, 자신은 1장 드로우한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:46.745257',625,'2025-09-16 16:38:46.745257','AGOV-KR055','죽음의 죄보－루시엘라','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 레벨 7 이상의 마법사족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이하의 효과를 각각 적용한다. ●대상의 앞면 표시 몬스터는 이 턴에, 다른 몬스터의 효과를 받지 않으며, 다음 턴의 스탠바이 페이즈에 묘지로 보내진다. ●상대 필드의 모든 몬스터의 공격력은, 대상 몬스터의 공격력만큼 내린다. 이 효과로 공격력이 0 이 되었을 경우, 추가로 그 몬스터를 파괴한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:46.947545',626,'2025-09-16 16:38:46.947545','AGOV-KR056','사안신전 스네이크아이','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 자신의 패 / 덱 / 묘지에서 \\\"스네이크아이\\\" 몬스터 1장을 지속 마법 카드로 취급하고 원래 주인의 마법 & 함정 존에 앞면 표시로 놓을 수 있다. ②: 자신 필드의 화염 속성 / 레벨 1 몬스터의 공격력은 1100 올린다. ③: 1턴에 1번, 상대가 몬스터를 일반 소환 / 특수 소환했을 경우, 자신 / 상대 필드의 지속 마법 카드 취급의 몬스터 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 자신 필드에 특수 소환한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:47.174010',627,'2025-09-16 16:38:47.174010','AGF3-KR001','원죄보－스네이크아이','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 이 카드 이외의 자신 필드의 앞면 표시 카드 1장을 묘지로 보내고 발동할 수 있다. 패 / 덱에서 화염 속성 / 레벨 1 몬스터 1장을 특수 소환한다. ②: 묘지의 이 카드를 제외하고, 자신 묘지의 \\\"스네이크아이\\\" 몬스터나 \\\"디아벨스타\\\" 몬스터 1장을 대상으로 하여 발동할 수 있다. 덱에서 화염 속성 / 레벨 1 몬스터 1장을 패에 넣는다. 그 후, 대상 몬스터를 덱 맨 아래로 되돌린다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:47.389560',628,'2025-09-16 16:38:47.389560','SD35-KR038','파이어 백','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지의 화염 속성 몬스터 1장을 대상으로 하고 발동할 수 있다. 자신의 패를 1장 골라 묘지로 보내고, 대상 몬스터를 특수 소환한다. ②: 묘지의 이 카드를 제외하고, 자신의 묘지 / 제외 상태인 화염 속성 몬스터 3장을 대상으로 하여 발동할 수 있다. 그 몬스터를 덱으로 되돌린다. 그 후, 자신은 1장 드로우한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:47.603491',629,'2025-09-16 16:38:47.603491','AGOV-KR060','싱크로 럼블','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 묘지의, 튜너 1장 또는 레벨 7 / 8 의 드래곤족 싱크로 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 수비 표시로 특수 소환한다. 이 카드의 발동 후, 턴 종료시까지 자신은 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 자신 필드의, \\\"붉은 용\\\" 또는 레벨 7 / 8 의 드래곤족 싱크로 몬스터가 전투 / 효과로 파괴될 경우, 대신에 묘지의 이 카드를 제외할 수 있다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:47.891794',630,'2025-09-16 16:38:47.891794','AGOV-KR061','성봉의 신리','{\"attribute\": \"마법\", \"card_text\": \"①: 1턴에 1번, 발동할 수 있다. 자신 필드의 스피릿 몬스터 및 \\\"에스프릿 버드 토큰\\\" 중에서, 레벨의 합계가 의식 소환할 몬스터의 레벨 이상이 되도록 릴리스하고, 덱에서 바람 속성의 의식 몬스터 1장을 의식 소환한다. ②: 1턴에 2번까지, 자신 필드의 앞면 표시의 바람 속성 몬스터가 자신의 패로 되돌아갔을 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●자신의 묘지 / 제외 상태인, 스피릿 몬스터 1장이나 의식 마법 카드 1장을 패에 넣는다. ●덱에서 \\\"성봉의 천하\\\" 1장을 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:48.109145',631,'2025-09-16 16:38:48.109145','AGOV-KR063','여명세계벽','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 파충류족 몬스터 1장을 릴리스하고 발동할 수 있다. 그 몬스터의 레벨 2 당 1장까지, 자신 필드에 \\\"명세계 토큰\\\"(파충류족 / 어둠 / 레벨 2 / 공 0 / 수 0)을 특수 소환한다. ②: 자신 메인 페이즈에 묘지의 이 카드를 제외하고, 자신의 제외 상태인 파충류족 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 덱으로 되돌린다. 그 후, 덱에서 파충류족 몬스터 1장을 묘지로 보낼 수 있다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:48.291091',632,'2025-09-16 16:38:48.291091','AGOV-KR064','Concours de Cuisine~살벌한 요리 대결~','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 패 / 덱 / 엑스트라 덱에서 \\\"누밸즈\\\" 펜듈럼 몬스터 1장과 \\\"파티시엘\\\" 펜듈럼 몬스터 1장을 고르고, 서로의 필드에 1장씩 특수 소환한다. 이 턴에, 자신은 \\\"누밸즈\\\" 몬스터 및 \\\"파티시엘\\\" 몬스터밖에 융합 / 싱크로 / 엑시즈 / 링크 소환의 소재로 할 수 없다. ②: 자신 메인 페이즈에 묘지의 이 카드를 제외하고, 필드의 앞면 표시 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터의 공격력은 서로의 묘지의 \\\"요리법\\\" 카드의 수 × 200 올린다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:48.562704',633,'2025-09-16 16:38:48.562704','AGOV-KR066','카드스캐너','{\"attribute\": \"마법\", \"card_text\": \"①: 1턴에 1번, 카드의 종류(몬스터 / 마법 / 함정)를 1개 선언하고 발동할 수 있다. 양쪽 플레이어는, 각각 자신의 덱 맨 아래의 카드를 서로 확인하고, 선언한 종류였을 경우, 그 카드를 자신의 패에 넣는다. 다를 경우, 확인한 카드를 자신의 덱 맨 위에 놓는다. ②: 마법 & 함정 존의 앞면 표시의 이 카드가 상대 효과로 파괴되었을 경우에 발동할 수 있다. 상대는 자신의 패를 1장 고르고 덱 맨 아래로 되돌린다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:48.741946',634,'2025-09-16 16:38:48.741946','AGOV-KR067','불사무사의 애도','{\"attribute\": \"마법\", \"card_text\": \"①: 자신 묘지의 몬스터는 전사족이 된다. ②: 자신 / 상대의 엔드 페이즈에 발동할 수 있다. 자신 필드의 몬스터를 전부 파괴한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:49.005278',635,'2025-09-16 16:38:49.005278','AGOV-KR068','패왕룡의 기적','{\"attribute\": \"함정\", \"card_text\": \"①: 자신 필드에 \\\"패왕룡 즈아크\\\"가 존재할 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다(이 카드명의 이하의 효과는 각각 1턴에 1번밖에 선택할 수 없다). ●자신 필드의 \\\"패왕룡 즈아크\\\" 1장을 파괴하고, 덱 / 엑스트라 덱에서 \\\"오드아이즈\\\" 펜듈럼 몬스터 또는 빛 속성의 \\\"패왕룡 즈아크\\\" 1장을 소환 조건을 무시하여 특수 소환한다. ●자신의 엑스트라 덱의 앞면의 펜듈럼 몬스터 1장을 자신의 펜듈럼 존에 놓는다. ●덱에서 속공 마법 카드 1장을 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:49.177053',636,'2025-09-16 16:38:49.177053','AGOV-KR069','패왕천룡의 혼','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 원래 공격력이 2500 의 마법사족 펜듈럼 몬스터 1장을 릴리스하고 발동할 수 있다. 자신의 패 / 덱 / 엑스트라 덱 / 필드 / 묘지의 몬스터를 융합 소재로서 제외하고, \\\"패왕룡 즈아크\\\" 1장을 융합 소환한다. 자신의 제외 상태인 \\\"펜듈럼 드래곤\\\" \\\"엑시즈 드래곤\\\" \\\"싱크로 드래곤\\\" \\\"퓨전 드래곤\\\" 몬스터가 각각 존재할 경우가 아니면, 이 효과로 특수 소환한 몬스터의 효과는 무효화된다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:49.406768',637,'2025-09-16 16:38:49.406768','AGOV-KR070','TG－클로즈','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신 필드에 기계족의 \\\"TG(테크지너스)\\\" 몬스터가 존재하고, 몬스터의 효과 / 마법 / 함정 카드가 발동했을 때에 발동할 수 있다. 그 발동을 무효로 하고 파괴한다. ②: 이 카드가 묘지에 존재하는 상태에서, 싱크로 몬스터가 제외되었을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다. 이 효과로 세트한 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:49.612799',638,'2025-09-16 16:38:49.612799','AGOV-KR071','풀 아머드 엑시즈','{\"attribute\": \"함정\", \"card_text\": \"①: 필드에 엑시즈 몬스터가 존재할 경우에 발동할 수 있다. 엑시즈 몬스터 1장의 엑시즈 소환을 실행한다. ②: 묘지의 이 카드를 제외하고, 자신 필드의 엑시즈 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터 이외의, 자신의 필드(앞면 표시) / 묘지의 엑시즈 몬스터 1장을 이하의 효과를 가지는 장착 마법 카드로 취급하고 대상 몬스터에 장착한다. ●장착 몬스터의 공격력은, 이 카드의 공격력만큼 올린다. ●장착 몬스터가 전투 / 효과로 파괴될 경우, 대신에 이 카드를 파괴한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:49.815457',639,'2025-09-16 16:38:49.815457','AGOV-KR074','배신의 죄보－실비아','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신의 패 / 필드(앞면 표시)에서 \\\"디아벨스타\\\" 몬스터 1장을 묘지로 보내고, 필드의 앞면 표시 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드의 효과를 무효로 한다. ②: 자신의 \\\"디아벨스타\\\" 몬스터 또는 자신의 \\\"죄보\\\" 마법 / 함정 카드의 효과 발동에 체인하여, 상대가 마법 / 함정 / 몬스터의 효과를 발동했을 때, 묘지의 이 카드를 제외하고 발동할 수 있다. 그 상대의 효과를 무효로 한다.\"}',NULL,'UNCOMMON'),(1,37,'2025-09-16 16:38:49.999100',640,'2025-09-16 16:38:49.999100','AGOV-KR075','노려보는 스네이크아이즈','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 \\\"스네이크아이\\\" 몬스터의 레벨의 합계가 2 이상일 경우, 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●상대의 필드(앞면 표시) / 묘지의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 지속 마법 카드로 취급하고 원래 주인의 마법 & 함정 존에 앞면 표시로 놓는다. ●자신 / 상대 필드의 지속 마법 카드 취급의 몬스터 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 자신 필드에 특수 소환한다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:50.274700',641,'2025-09-16 16:38:50.274700','AGOV-KR076','카노푸스의 수호자','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대가 효과를 발동했을 때에 발동할 수 있다(동일한 체인 위에서는 1번까지). 자신의 패 / 묘지에서 \\\"호루스\\\" 몬스터 1장을 특수 소환한다. 이 턴에, 자신은 이 효과로 특수 소환한 몬스터와 원래의 카드명이 같은 몬스터를 \\\"카노푸스의 수호자\\\"의 효과로는 특수 소환할 수 없다. ②: 이 카드가 패 / 필드에서 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다. 이 효과로 세트한 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:50.443279',642,'2025-09-16 16:38:50.443279','AGOV-KR078','VS 스노우데블','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 패의 어둠 / 땅 / 화염 속성 몬스터를 각각 1장까지 상대에게 보여주고 발동할 수 있다. 보여준 몬스터의 수에 따라 이하의 효과를 각각 적용한다. ●1장 이상: 상대에게 400 데미지를 준다. 그 후, 패에서 \\\"VS(뱅키시 소울)\\\" 몬스터 1장을 특수 소환할 수 있다. ●2장 이상: 상대에게 600 데미지를 준다. 이 턴 중에, 자신 필드의 \\\"VS(뱅키시 소울)\\\" 몬스터는 효과로는 파괴되지 않는다. ●3장: 상대에게 800 데미지를 준다. 그 후, 필드의 몬스터를 전부 파괴할 수 있다.\"}',NULL,'COMMON'),(1,37,'2025-09-16 16:38:50.646399',643,'2025-09-16 16:38:50.646399','AGOV-KR079','성소용전','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 필드의 융합 / 싱크로 / 엑시즈 / 링크 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 앞면 표시 몬스터를 엑스트라 덱으로 되돌린다. 그 후, 되돌린 몬스터의 종류(융합 / 싱크로 / 엑시즈 / 링크)에 따라 이하의 몬스터 1장을 자신 / 상대 묘지에서 자신 필드에 특수 소환할 수 있다. ●융합: 되돌린 몬스터와 같은 속성의 몬스터 ●싱크로: 되돌린 몬스터보다 레벨이 낮은 몬스터 ●엑시즈: 되돌린 몬스터의 랭크와 같은 수치의 레벨을 가지는 몬스터 ●링크: 되돌린 몬스터와 같은 종족의 몬스터\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:50.958468',644,'2025-09-16 16:38:50.958468','INFO-KR002','천년의 보물을 지키는 골렘','{\"attribute\": \"땅\", \"type\": \"[암석족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 2200\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재할 경우에 발동할 수 있다. 이 카드를 지속 마법 카드로 취급하고 자신의 마법 & 함정 존에 앞면 표시로 놓는다. ②: 이 카드를 지속 마법 카드로 취급할 경우, 2000 LP를 지불하거나 패의 \\\"천년의 십자\\\" 1장을 상대에게 보여주고 발동할 수 있다. 이 카드를 특수 소환한다. 그 후, 덱에서 \\\"웨주의 신전\\\" 1장을 패에 넣을 수 있다. ③: 이 카드가 몬스터 존에 존재하는 한, 자신의 \\\"천년의 십자\\\"의 발동은 무효화되지 않는다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:51.191329',645,'2025-09-16 16:38:51.191329','INFO-KR003','천년왕조의 방패','{\"attribute\": \"땅\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 3000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재할 경우에 발동할 수 있다. 이 카드를 지속 마법 카드로 취급하고 자신의 마법 & 함정 존에 앞면 표시로 놓는다. ②: 이 카드를 지속 마법 카드로 취급할 경우, 2000 LP를 지불하거나 패의 \\\"천년의 십자\\\" 1장을 상대에게 보여주고 발동할 수 있다. 이 카드를 특수 소환한다. 그 후, 덱에서 \\\"천년의 십자\\\" 1장을 패에 넣을 수 있다. ③: 이 카드는 몬스터 존에 존재하는 한, 마법 / 함정 카드의 효과로는 파괴되지 않는다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:51.429569',646,'2025-09-16 16:38:51.429569','INFO-KR004','밀레니엄문 메이든','{\"attribute\": \"빛\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1300\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재할 경우에 발동할 수 있다. 이 카드를 지속 마법 카드로 취급하고 자신의 마법 & 함정 존에 앞면 표시로 놓는다. ②: 이 카드를 지속 마법 카드로 취급하는 상태에서, 상대의 효과가 발동했을 경우에 발동할 수 있다. 이 카드를 특수 소환하고, 이 턴 중에, 자신 필드의 레벨 5 이상의 환상마족 / 마법사족 몬스터를 상대는 효과의 대상으로 할 수 없다. ③: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:51.676138',647,'2025-09-16 16:38:51.676138','INFO-KR005','밀레니엄 앱솔루터','{\"attribute\": \"바람\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1300\", \"deffence\": \"수비력 1400\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재할 경우에 발동할 수 있다. 이 카드를 지속 마법 카드로 취급하고 자신의 마법 & 함정 존에 앞면 표시로 놓는다. ②: 이 카드를 지속 마법 카드로 취급하는 상태에서, 상대의 효과가 발동했을 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 그 후, 필드의 몬스터 1장의 공격력 절반만큼 자신의 LP를 회복할 수 있다. ③: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:52.027716',648,'2025-09-16 16:38:52.027716','INFO-KR008','기믹 퍼핏－블러디 돌','{\"attribute\": \"어둠\", \"type\": \"[기계족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 400\", \"deffence\": \"수비력 1400\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없으며, 이 효과를 발동하는 턴에, 자신은 \\\"기믹 퍼핏\\\" 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ①: 이 카드가 패에 존재할 경우, 엑스트라 덱의 \\\"기믹 퍼핏\\\" 엑시즈 몬스터 1장을 상대에게 보여주고 발동할 수 있다. 보여준 몬스터의 랭크와 같은 수치의 레벨을 가지는 덱의 \\\"기믹 퍼핏\\\" 몬스터 1장과, 이 카드를 특수 소환한다. ②: 이 카드가 패 이외에서 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:52.309359',649,'2025-09-16 16:38:52.309359','INFO-KR009','기믹 퍼핏－캐틀 스크림','{\"attribute\": \"어둠\", \"type\": \"[기계족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 엑시즈 소재를 1개 제거하고 발동할 수 있다. 이 카드를 패 / 묘지에서 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다. ②: 이 카드를 소재로서 가지고 있는 \\\"기믹 퍼핏\\\" 엑시즈 몬스터는 이하의 효과를 얻는다. ●1턴에 1번, 상대 묘지의 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 상대 필드에 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:52.525842',650,'2025-09-16 16:38:52.525842','INFO-KR010','라이트엔드 서플리메이션 드래곤','{\"attribute\": \"빛\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2600\", \"deffence\": \"수비력 2100\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 엑스트라 덱에서 드래곤족 / 레벨 8 몬스터 1장을 제외하고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 턴에, 자신은 드래곤족 몬스터밖에 특수 소환할 수 없다. ②: 자신 메인 페이즈에 발동할 수 있다. 자신의 패 / 필드의 몬스터를 융합 소재로 하고, 융합 몬스터 1장을 융합 소환한다. ③: 상대 몬스터의 공격 선언시에 발동할 수 있다. 이 카드의 공격력 / 수비력을 500 내리고, 그 상대 몬스터의 공격력을 1500 내린다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:52.694942',651,'2025-09-16 16:38:52.694942','INFO-KR011','다크엔드 이배퍼레이션 드래곤','{\"attribute\": \"어둠\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2600\", \"deffence\": \"수비력 2100\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 엑스트라 덱에서 드래곤족 / 레벨 8 몬스터 1장을 제외하고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 턴에, 자신은 드래곤족 몬스터밖에 특수 소환할 수 없다. ②: 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●자신의 패 / 필드의 몬스터를 융합 소재로 하고, 융합 몬스터 1장을 융합 소환한다. ●필드의 다른 공격 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드의 공격력 / 수비력을 500 내리고, 대상 몬스터를 파괴한다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:52.938480',652,'2025-09-16 16:38:52.938480','INFO-KR012','갑옷기사룡－나이트 암드 드래곤－','{\"attribute\": \"바람\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 1400\", \"deffence\": \"수비력 1900\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신이 레벨 5 이상의 드래곤족 몬스터를 특수 소환했을 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 특수 소환했을 경우에 발동할 수 있다. 이 카드의 속성 / 레벨은, 자신의 제외 상태인 드래곤족 몬스터 1장과 같아진다. ③: 이 카드가 묘지로 보내졌을 경우, 자신 필드의 드래곤족 몬스터 1장을 대상으로 하고 발동할 수 있다(이 효과의 발동에 대하여 양쪽 플레이어는 효과를 발동할 수 없다). 그 몬스터의 공격력은 1000 올린다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:53.582835',653,'2025-09-16 16:38:53.582835','INFO-KR038','하얀 숲의 실비','{\"attribute\": \"빛\", \"type\": \"[마법사족／튜너／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 200\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"하얀 숲\\\" 마법 / 함정 카드 1장을 패에 넣는다. ②: 자신 / 상대 턴에, 이 카드가 묘지에 존재할 경우, 자신의 필드 / 묘지의 \\\"하얀 숲\\\" 싱크로 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 엑스트라 덱으로 되돌리고, 이 카드를 효과를 무효로 하여 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:53.880775',654,'2025-09-16 16:38:53.880775','INFO-KR016','하얀 숲의 루시아','{\"attribute\": \"빛\", \"type\": \"[마법사족／튜너／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 800\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"하얀 숲\\\" 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 자신의 패 / 필드에서 마법 / 함정 카드 1장을 묘지로 보내고 발동할 수 있다. 자신은 1장 드로우한다. ③: 자신 / 상대 턴에, 이 카드가 묘지에 존재할 경우, 자신의 필드 / 묘지의 \\\"하얀 숲\\\" 싱크로 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 엑스트라 덱으로 되돌리고, 이 카드를 효과를 무효로 하여 특수 소환한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:54.381501',655,'2025-09-16 16:38:54.381501','INFO-KR022','드라이트론－νⅡ','{\"attribute\": \"빛\", \"type\": \"[기계족／특수 소환／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드는 통상 소환할 수 없으며, 카드의 효과로만 특수 소환할 수 있다. 이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없으며, 이 효과를 발동하는 턴에, 자신은 기계족 몬스터밖에 의식 소환할 수 없다. ①: 필드에 \\\"드라이트론\\\" 카드가 존재할 경우에 발동할 수 있다. 이 카드를 패 / 묘지에서 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다. ②: 이 카드를 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"드라이트론－νⅡ(뉴투)\\\" 이외의 \\\"드라이트론\\\" 몬스터 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:54.812054',656,'2025-09-16 16:38:54.812054','INFO-KR024','기도의 여왕－코스모 퀸','{\"attribute\": \"어둠\", \"type\": \"[마법사족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2900\", \"deffence\": \"수비력 2450\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 필드 마법 카드가 발동했을 경우에 발동할 수 있다. 이 카드를 패에서 수비 표시로 특수 소환한다. ②: 필드 존의 앞면 표시 카드 1장을 대상으로 하고, 그 컨트롤러에 따라 이하의 효과를 발동할 수 있다. ●자신: 대상의 카드를 파괴하고, 파괴한 카드와는 카드명이 다른 필드 마법 카드 1장을 덱에서 패에 넣는다. ●상대: 대상의 카드의 효과를 턴 종료시까지 무효로 하고, 덱에서 필드 마법 카드 1장을 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:55.044096',657,'2025-09-16 16:38:55.044096','INFO-KR026','무공포탑－디세이블래스터','{\"attribute\": \"빛\", \"type\": \"[기계족／펜듈럼／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없다. ①: 카드가 존재하지 않는 세로열이 있을 경우, 이 카드는 그 세로열인 자신 필드에 패에서 특수 소환할 수 있다. ②: 이 카드가 몬스터 존에 존재하는 한, 이 카드와 같은 세로열에서 발동한 마법 / 함정 / 몬스터의 효과는 무효화된다. ③: 몬스터 존의 이 카드가 파괴되었을 경우에 발동할 수 있다. 이 카드를 자신의 펜듈럼 존에 놓는다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:55.668147',658,'2025-09-16 16:38:55.668147','AGF3-KR002','데먼스미스 라크리모사','{\"attribute\": \"빛\", \"type\": \"[악마족／융합／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 2400\", \"card_text\": \"악마족 / 빛 속성 몬스터 × 2이 카드명의 ①③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 융합 소환했을 경우, 자신의 묘지 / 제외 상태인 악마족 / 빛 속성 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 패에 넣거나 특수 소환한다. ②: 이 카드가 몬스터 존에 존재하는 한, 상대 필드의 몬스터의 공격력은 600 내린다. ③: 이 카드가 묘지로 보내졌을 경우, 자신 묘지에서 다른 악마족 / 빛 속성 몬스터 1장을 덱 / 엑스트라 덱으로 되돌리고 발동할 수 있다. 상대에게 1200 데미지를 준다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:56.125318',659,'2025-09-16 16:38:56.125318','INFO-KR038','하얀 숲의 마랑 실비아','{\"attribute\": \"빛\", \"type\": \"[마법사족／싱크로／튜너／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 1900\", \"deffence\": \"수비력 2400\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상①: 이 카드를 특수 소환했을 경우에 발동할 수 있다. 상대 필드의 앞면 표시 몬스터를 전부 뒷면 수비 표시로 한다. ②: 이 카드가 몬스터 존에 존재하는 한, 자신 필드의 환상마족 / 마법사족인 싱크로 몬스터는, 공격력을 500 올리고, 수비 표시 몬스터를 공격했을 경우, 그 수비력을 공격력이 넘은 만큼의 배의 수치만큼 상대에게 전투 데미지를 준다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:56.352689',660,'2025-09-16 16:38:56.352689','INFO-KR039','하얀 숲의 마성 루시엘라','{\"attribute\": \"빛\", \"type\": \"[마법사족／싱크로／튜너／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 1500\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 특수 소환했을 경우, 자신의 패 / 필드에서 마법 / 함정 카드 1장을 묘지로 보내고 발동할 수 있다. 덱에서 \\\"하얀 숲\\\" 카드 1장이나 마법사족 / 빛 속성 몬스터 1장을 패에 넣는다. ②: 이 카드가 몬스터 존에 존재하는 한, 자신 필드의 환상마족 / 마법사족인 싱크로 몬스터는, 공격력을 500 올리고, 상대의 효과로는 파괴되지 않는다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:57.041402',661,'2025-09-16 16:38:57.041402','INFO-KR045','이단의 포보스코보스','{\"attribute\": \"어둠\", \"type\": \"[환상마족／엑시즈／효과]\", \"rank\": \"랭크 4\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 1500\", \"card_text\": \"레벨 4 몬스터 × 2이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대 필드의 효과 몬스터 1장을 대상으로 하고 발동할 수 있다(이 카드가 환상마족 몬스터를 엑시즈 소재로 하고 있을 경우, 이 효과는 상대 턴에도 발동할 수 있다). 대상 몬스터의 효과를 무효로 한다. 그 몬스터가 이 턴에 전투를 실행하고 있을 경우, 추가로 그 컨트롤을 엔드 페이즈까지 얻을 수 있다. ②: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:57.509597',662,'2025-09-16 16:38:57.509597','INFO-KR050','미냥마돌체 냥카롱','{\"attribute\": \"땅\", \"type\": \"[야수족／링크／효과]\", \"link_arrows\": \"Bottom-Left/Bottom/Bottom-Right\", \"attack\": \"공격력 2300\", \"deffence\": \"수비력 -\", \"card_text\": \"마돌체 몬스터를 포함하는 효과 몬스터 2장 이상이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 링크 소환했을 경우에 발동할 수 있다. 덱에서 \\\"마돌체\\\" 카드 1장을 패에 넣는다. ②: 자신 묘지의 몬스터 1장을 대상으로 하고 발동할 수 있다. 패에서 \\\"마돌체\\\" 몬스터 1장을 특수 소환하고, 대상의 몬스터를 덱으로 되돌린다. 이 효과의 발동 후, 턴 종료시까지 자신은 \\\"마돌체\\\" 몬스터 이외의 몬스터의 효과를 발동할 수 없다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:57.679192',663,'2025-09-16 16:38:57.679192','INFO-KR051','성계수 이르미스틸','{\"attribute\": \"땅\", \"type\": \"[식물족／링크／효과]\", \"link_arrows\": \"Top-Left/Left/Bottom-Left/Bottom/Bottom-Right\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 -\", \"card_text\": \"효과 몬스터 3장 이상①: \\\"성계수 이르미스틸\\\"은 자신 필드에 1장밖에 앞면 표시로 존재할 수 없다. ②: 이 카드가 몬스터 존에 존재하는 한, 상대가 메인 페이즈에 몬스터를 앞면 표시로 특수 소환할 때마다, 자신은 그 몬스터의 공격력만큼만 LP를 회복한다. ③: 자신 / 상대 턴에 1번, 1000 의 배수의 LP를 지불하고 발동할 수 있다(최대 3000 까지). 이 카드의 공격력은 지불한 수치만큼 올린다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:58.018320',664,'2025-09-16 16:38:58.018320','INFO-KR056','지옥인형의 저택','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"기믹 퍼핏\\\" 몬스터 1장을 패에 넣을 수 있다. ②: 자신 필드의 \\\"기믹 퍼핏\\\" 몬스터는 전투로는 파괴되지 않으며, 엑시즈 몬스터 이외의 상대 몬스터가 발동한 효과를 받지 않는다. ③: 1턴에 1번, 자신 필드의 엑시즈 소재를 1개 제거하고, 자신 묘지의 \\\"기믹 퍼핏\\\" 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 상대 필드에 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:58.271717',665,'2025-09-16 16:38:58.271717','INFO-KR057','용의 영광','{\"attribute\": \"마법\", \"card_text\": \"①: 이하의 효과에서 1개를 선택하고 발동할 수 있다(이 카드명의 이하의 효과는 각각 1턴에 1번밖에 선택할 수 없다).●패의 드래곤족 / 레벨 8 몬스터 1장을 덱으로 되돌리고, 그 몬스터와는 속성이 다른 드래곤족 / 레벨 8 몬스터 1장을 덱에서 패에 넣는다.●자신 필드의 드래곤족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 공격력은 자신의 레벨 × 200 올린다.●자신 필드의 드래곤족 몬스터를 대상으로 하는 카드의 효과가 발동했을 때에 발동할 수 있다. 그 효과를 무효로 한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:58.467619',666,'2025-09-16 16:38:58.467619','INFO-KR058','하얀 숲의 전해져오는 이야기','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 환상마족이나 마법사족 몬스터가 존재할 경우에 발동할 수 있다. 덱에서 \\\"하얀 숲\\\" 몬스터 1장을 패에 넣는다. ②: 이 카드가 몬스터의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:58.707431',667,'2025-09-16 16:38:58.707431','INFO-KR059','하얀 숲에는 들어가지 말 것','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 레벨 6 이상의, 환상마족이나 마법사족 몬스터가 존재할 경우, 상대 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다. ②: 이 카드가 몬스터의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:58.969364',668,'2025-09-16 16:38:58.969364','INFO-KR060','죄보의 속삭임','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 환상마족 / 마법사족 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 앞면 표시 몬스터를 패 / 엑스트라 덱으로 되돌린다. 그 후, 자신의 묘지 / 제외 상태인 환상마족 / 마법사족 몬스터 1장을 특수 소환한다. ②: 이 카드가 몬스터의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:59.185468',669,'2025-09-16 16:38:59.185468','INFO-KR061','데먼스미스 트락투스','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 덱에서 악마족 / 빛 속성 몬스터 1장을 패에 넣는다. 그 후, 자신의 패를 1장 고르고 버린다. ②: 묘지의 이 카드를 제외하고 발동할 수 있다. 자신의 패 / 필드의 몬스터를 융합 소재로 하고, \\\"데먼스미스\\\" 융합 몬스터 1장을 융합 소환한다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:38:59.387298',670,'2025-09-16 16:38:59.387298','INFO-KR062','데먼스미스 상투스','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 앞면 표시 몬스터가, 존재하지 않을 경우 또는 악마족 / 빛 속성 몬스터뿐일 경우에 발동할 수 있다. 자신 필드에 \\\"데먼스미스 토큰\\\"(악마족 / 빛 / 레벨 1 / 공 0 / 수 0) 1장을 특수 소환한다. 이 턴에, 자신은 악마족 몬스터로밖에 공격 선언할 수 없다. ②: 이 카드가 묘지에 존재하는 상태에서, 자신 필드의 앞면 표시의 \\\"데먼스미스\\\" 몬스터가 상대의 효과로 파괴되었을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:59.683152',671,'2025-09-16 16:38:59.683152','INFO-KR065','트랩 개더','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 장착 몬스터의 공격력은, 자신 묘지의 함정 카드의 수 × 400 올린다. ②: 장착 몬스터가, 전투로 상대 몬스터를 파괴한 데미지 계산 후, 또는 상대에게 전투 데미지를 주었을 때, 이 카드를 묘지로 보내고 발동할 수 있다. 자신 묘지에서 함정 카드 1장을 자신 필드에 세트한다. ③: 자신 필드의 앞면 표시의 함정 카드가 효과로 파괴될 경우, 대신에 필드의 이 카드를 제외할 수 있다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:38:59.981272',672,'2025-09-16 16:38:59.981272','INFO-KR067','BBS','{\"attribute\": \"마법\", \"card_text\": \"①: \\\"BBS(비 백 사이트)\\\" 이외의 카드의 효과가 발동할 때마다 발동할 수 있다. 이 카드에 액세스 카운터를 1개 놓는다(최대 10개까지). ②: 자신 필드의 몬스터의 공격력은, 이 카드의 액세스 카운터의 수 × 100 올린다. ③: 이 카드에 액세스 카운터가 놓여지고, 그 액세스 카운터의 수가 10 이 되었을 경우에 발동할 수 있다. 이 카드를 패로 되돌리고, 자신을 몬스터로서 특수 소환하는 효과를 가지는 지속 함정 카드 1장을 덱에서 자신 필드에 세트한다. 이 효과로 세트한 카드는 세트한 턴에도 발동할 수 있다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:39:00.382972',673,'2025-09-16 16:39:00.382972','INFO-KR068','분노의 업화 에크조드 프레임','{\"attribute\": \"함정\", \"card_text\": \"이 카드명은 룰상 \\\"엑조드\\\" 카드로도 취급한다. 이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 레벨 10 이상의 \\\"엑조디아\\\" 몬스터가 존재할 경우에 발동할 수 있다. 상대 필드의 카드를 전부 파괴한다. ②: 이 턴에 묘지로 보내져 있지 않은 이 카드를 묘지에서 제외하고, 이하의 효과에서 1개를 선택하여 발동할 수 있다.●자신의 덱 / 묘지에서 \\\"봉인된\\\" 몬스터 1장을 패에 넣는다.●자신의 묘지 / 제외 상태인 \\\"봉인된\\\" 몬스터를 5장까지 덱으로 되돌린다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:39:00.679386',674,'2025-09-16 16:39:00.679386','INFO-KR069','흑마술의 방어막 거울의 힘','{\"attribute\": \"함정\", \"card_text\": \"①: 상대 몬스터의 공격 선언시, 또는 필드의 몬스터를 파괴하는 상대 몬스터의 효과가 발동했을 때, \\\"빛의 황금궤\\\"의 카드명이 쓰여진 몬스터가 필드에 존재하고 있으면 발동할 수 있다. 상대 필드의 공격 표시 몬스터를 전부 파괴한다. 자신 필드에 \\\"블랙 매지션\\\"이 존재할 경우, 추가로 파괴한 몬스터의 수 × 500 데미지를 상대에게 준다. 이 카드의 발동 후, 이 턴 중에, \\\"빛의 황금궤\\\"의 카드명이 쓰여진 자신 필드의 몬스터는 각각 1번만 전투 / 효과로는 파괴되지 않는다.\"}',NULL,'UNCOMMON'),(1,40,'2025-09-16 16:39:00.979324',675,'2025-09-16 16:39:00.979324','INFO-KR070','괴뢰유의－서비스트 퍼핏','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 \\\"기믹 퍼핏\\\" 엑시즈 몬스터의 수까지, 상대 필드의 몬스터를 대상으로 하고 발동할 수 있다. 그 몬스터의 컨트롤을 엔드 페이즈까지 얻는다. ②: 자신 필드에 \\\"기믹 퍼핏\\\" 엑시즈 몬스터가 존재할 경우, 이 턴에 묘지로 보내져 있지 않은 이 카드를 묘지에서 제외하고, 자신이나 상대의 묘지의 엑시즈 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 자신이나 상대의 필드에 수비 표시로 특수 소환한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:39:01.298571',676,'2025-09-16 16:39:01.298571','INFO-KR071','하얀 숲의 재앙','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 패 / 덱에서 \\\"하얀 숲\\\" 몬스터 1장을 특수 소환한다. 그 후, \\\"하얀 숲\\\" 싱크로 몬스터 1장의 싱크로 소환을 실행할 수 있다. ②: 이 카드가 몬스터의 효과를 발동하기 위해 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:39:01.536748',677,'2025-09-16 16:39:01.536748','INFO-KR074','순성의 가디언','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는, 각각 1턴에 1번밖에 사용할 수 없으며, 동일한 체인 위에서는 발동할 수 없다. ①: 의식 몬스터 이외의 자신 필드의 몬스터가 전투 / 효과로 파괴되었을 경우에 발동할 수 있다. 패 / 덱에서 \\\"로가디언\\\" 1장을 특수 소환한다. ②: 마법 & 함정 존의 앞면 표시의 이 카드를 묘지로 보내고, 자신 필드의 의식 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터의 공격력은 턴 종료시까지, 필드의 다른 몬스터의 원래 공격력의 합계만큼 올린다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:39:01.747380',678,'2025-09-16 16:39:01.747380','INFO-KR076','메테오로라 드라이트론','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: \\\"드라이트론\\\" 카드가 제외되었을 경우, 자신 필드의 \\\"드라이트론\\\" 몬스터 1장을 릴리스하고, 자신의 제외 상태인 \\\"드라이트론\\\" 카드를 2장까지 대상으로 하여 발동할 수 있다. 그 카드를 패에 넣는다. ②: 패의 \\\"메테오니스 드라이트론\\\" 1장을 상대에게 보여주고 발동할 수 있다. 공격력의 합계가 의식 소환할 몬스터의 공격력 이상이 되도록, 자신의 패 / 필드의 기계족 몬스터를 릴리스하고, 자신의 패 / 묘지에서 기계족 의식 몬스터 1장을 의식 소환한다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:39:01.975949',679,'2025-09-16 16:39:01.975949','INFO-KR079','그림자 모자','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 이 카드는 발동 후, 이하의 효과를 가지는 효과 몬스터(환상마족 / 어둠 / 레벨 4 / 공 1500 / 수 600)가 되고, 몬스터 존에 특수 소환한다(함정 카드로도 취급한다).●이 카드를 특수 소환했을 경우, 자신 필드의 환상마족 몬스터의 수까지 상대 필드의 앞면 표시 카드를 대상으로 하고 발동할 수 있다. 그 카드의 효과를 턴 종료시까지 무효로 한다.●이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다.\"}',NULL,'COMMON'),(1,40,'2025-09-16 16:39:02.243725',680,'2025-09-16 16:39:02.243725','INFO-KR080','삼위일체','{\"attribute\": \"함정\", \"card_text\": \"①: 상대 엔드 페이즈에, 상대의 패 / 필드의 카드의 수가, 자신의 패 / 필드의 카드의 수보다 많을 경우에 발동할 수 있다. 자신 묘지에서 일반 몬스터 3장을 특수 소환한다. ②: 묘지의 이 카드를 제외하고, 원래의 카드명이 다른 자신 필드의 몬스터 카드 3장을 대상으로 하여 발동할 수 있다. 그 카드 3장의 원래의 카드명이 전부 쓰여진 마법 / 함정 카드 1장을 패 / 덱에서 자신 필드에 세트한다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:02.753635',681,'2025-09-16 16:39:02.753635','POTE-KR002','크로스 키퍼','{\"attribute\": \"어둠\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 400\", \"deffence\": \"수비력 400\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 패 / 필드의 이 카드를 묘지로 보내고 발동할 수 있다. 자신의 패 / 묘지에서 \\\"엘리멘틀 히어로\\\" 몬스터 또는 \\\"네오 스페이시언\\\" 몬스터 1장을 고르고 특수 소환한다. 이 효과로 묘지에서 특수 소환한 몬스터의 효과는 무효화된다. ②: 이 카드가 묘지에 존재하는 상태에서, 자신이 \\\"엘리멘틀 히어로\\\" 융합 몬스터의 특수 소환에 성공했을 경우, 이 카드를 제외하고 발동할 수 있다. 자신은 덱에서 2장 드로우하고, 그 후 패를 1장 골라 덱 맨 아래로 되돌린다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:03.219288',682,'2025-09-16 16:39:03.219288','TT01-KRB07','스프라이트 제트','{\"attribute\": \"어둠\", \"type\": \"[번개족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 1300\", \"deffence\": \"수비력 700\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 레벨 2 나 랭크 2 인 몬스터가 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 이 카드를 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"스프라이트\\\" 마법 / 함정 카드 1장을 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,32,'2025-09-16 16:39:03.504351',683,'2025-09-16 16:39:03.504351','POTE-KR005','스프라이트 픽시즈','{\"attribute\": \"어둠\", \"type\": \"[번개족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 1400\", \"deffence\": \"수비력 1400\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 레벨 2 또는 랭크 2 의 몬스터가 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 이 카드 이외의 자신의 레벨 2 / 랭크 2 / 링크 2 의 몬스터가 상대 몬스터와 전투를 실행하는 데미지 계산시에, 패 / 필드의 이 카드를 묘지로 보내고 발동할 수 있다. 그 자신 몬스터의 공격력 / 수비력은 턴 종료시까지, 그 상대 몬스터의 공격력만큼 올린다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:03.729606',684,'2025-09-16 16:39:03.729606','TT01-KRB08','스프라이트 레드','{\"attribute\": \"화염\", \"type\": \"[번개족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 1200\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 레벨 2 나 링크 2 인 몬스터가 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 상대가 몬스터의 효과를 발동했을 때, 자신 필드의 다른 레벨 2 / 랭크 2 / 링크 2 인 몬스터 1장을 릴리스하고 발동할 수 있다. 그 효과를 무효로 한다. 랭크 2 나 링크 2 인 몬스터를 릴리스하고 발동했을 경우, 추가로 그 무효로 한 몬스터를 파괴할 수 있다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:04.053460',685,'2025-09-16 16:39:04.053460','TT01-KRB09','스프라이트 캐롯','{\"attribute\": \"화염\", \"type\": \"[번개족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 1900\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 레벨 2 나 링크 2 인 몬스터가 존재할 경우, 이 카드는 패에서 특수 소환할 수 있다. ②: 상대가 마법 / 함정 카드의 효과를 발동했을 때, 자신 필드의 다른 레벨 2 / 랭크 2 / 링크 2 인 몬스터 1장을 릴리스하고 발동할 수 있다. 그 효과를 무효로 한다. 랭크 2 나 링크 2 인 몬스터를 릴리스하고 발동했을 경우, 추가로 그 무효로 한 카드를 파괴할 수 있다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:04.218862',686,'2025-09-16 16:39:04.218862','POTE-KR008','세리온즈 \"임프레스\" 알라시아','{\"attribute\": \"땅\", \"type\": \"[파충류족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 2500\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지의, \\\"세리온즈\\\" 몬스터 또는 파충류족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 패에서 특수 소환하고, 대상 몬스터를 장착 카드로 취급하여 이 카드에 장착한다. ②: 패를 1장 버리고, 자신의 마법 & 함정 존의 \\\"세리온즈\\\" 몬스터 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 특수 소환한다. ③: 이 카드를 장착한 \\\"세리온즈\\\" 몬스터는, 공격력을 700 올리고, 이 카드명의 ②의 효과를 얻는다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:04.759143',687,'2025-09-16 16:39:04.759143','POTE-KR013','티아라멘츠 허프니스','{\"attribute\": \"어둠\", \"type\": \"[물족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 상대가 필드의 몬스터의 효과를 발동했을 때에 발동할 수 있다. 이 카드를 패에서 특수 소환하고, 자신의 덱 위에서 카드를 3장 묘지로 보낸다. ②: 이 카드가 효과로 묘지로 보내졌을 경우에 발동할 수 있다. 융합 몬스터 카드에 기재된, 묘지의 이 카드를 포함하는 융합 소재 몬스터를 자신의 패 / 필드 / 묘지에서 좋아하는 순서대로 주인의 덱 아래로 되돌리고, 그 융합 몬스터 1장을 엑스트라 덱에서 융합 소환한다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:04.961945',688,'2025-09-16 16:39:04.961945','POTE-KR015','티아라멘츠 레이노하트','{\"attribute\": \"물\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 2100\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 소환 / 특수 소환에 성공했을 경우에 발동할 수 있다. 덱에서 \\\"티아라멘츠 레이노하트\\\" 이외의 \\\"티아라멘츠\\\" 몬스터 1장을 묘지로 보낸다. ②: 이 카드가 효과로 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 특수 소환하고, 자신의 패에서 \\\"티아라멘츠\\\" 카드 1장을 골라 묘지로 보낸다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'UNCOMMON'),(1,32,'2025-09-16 16:39:05.291275',689,'2025-09-16 16:39:05.291275','POTE-KR017','숲과 자각의 봄화정','{\"attribute\": \"땅\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 900\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드와, 몬스터 1장 또는 \\\"봄화정\\\" 카드 1장을 패에서 버리고 발동할 수 있다. 통상 소환 가능한 땅 속성 몬스터 1장을 덱에서 묘지로 보낸다. 그 후, 그 몬스터와는 카드명이 다른 땅 속성 몬스터 1장을 자신 묘지에서 고르고 특수 소환할 수 있다. 이 턴에, 자신은 땅 속성 이외의 몬스터의 효과를 발동할 수 없다. ②: 자신 필드의 \\\"봄화정\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 공격력은 턴 종료시까지 배가 된다.\"}',NULL,'UNCOMMON'),(1,32,'2025-09-16 16:39:05.517900',690,'2025-09-16 16:39:05.517900','POTE-KR018','꽃과 들판의 봄화정','{\"attribute\": \"땅\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 600\", \"deffence\": \"수비력 1600\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드와, 몬스터 1장 또는 \\\"봄화정\\\" 카드 1장을 패에서 버리고 발동할 수 있다. 자신 묘지에서 \\\"꽃과 들판의 봄화정\\\" 이외의 땅 속성 몬스터 1장을 고르고 패에 넣는다. 그 후, 자신 묘지에서 땅 속성 몬스터 1장을 고르고 특수 소환할 수 있다. 이 턴에, 자신은 땅 속성 이외의 몬스터의 효과를 발동할 수 없다. ②: 이 카드가 몬스터 존에 존재하는 한, 자신 필드의 \\\"봄화정\\\" 몬스터는 상대 효과의 대상이 되지 않는다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:05.688319',691,'2025-09-16 16:39:05.688319','POTE-KR019','산과 설해의 봄화정','{\"attribute\": \"땅\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 1100\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드와, 몬스터 1장 또는 \\\"봄화정\\\" 카드 1장을 패에서 버리고 발동할 수 있다. 자신은 덱에서 1장 드로우한다. 그 후, 자신 묘지에서 땅 속성 몬스터 1장을 고르고 특수 소환할 수 있다. 이 턴에, 자신은 땅 속성 이외의 몬스터의 효과를 발동할 수 없다. ②: 자신 필드의 \\\"봄화정\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 턴에, 그 몬스터는 1번의 배틀 페이즈 중에 2회 공격할 수 있다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:05.927978',692,'2025-09-16 16:39:05.927978','TW02-KR054','브릴리언트 로즈','{\"attribute\": \"빛\", \"type\": \"[암석족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 500\", \"card_text\": \"이 카드명은 룰상 \\\"젬나이트\\\" 카드로도 취급한다. 이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 패에서 다른 \\\"젬나이트\\\" 카드나 \\\"환주\\\" 카드 1장을 버리고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 1턴에 1번, 엑스트라 덱에서 \\\"젬나이트\\\" 몬스터나 \\\"환주\\\" 몬스터 1장을 묘지로 보내고 발동할 수 있다. 이 카드의 카드명 / 종족 / 속성은 엔드 페이즈까지, 이 효과를 발동하기 위해 묘지로 보낸 몬스터의 원래의 카드명 / 종족 / 속성과 같아진다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:06.231945',693,'2025-09-16 16:39:06.231945','POTE-KR024','스카아 벤데드','{\"attribute\": \"어둠\", \"type\": \"[언데드족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2300\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 묘지로 보내졌을 경우에 발동할 수 있다. 덱에서 \\\"벤데드\\\" 마법 / 함정 카드 1장을 패에 넣는다. ②: 이 카드가 묘지에 존재하는 상태에서, 필드의 몬스터가 릴리스되었을 경우, 자신 묘지에서 이 카드 이외의 언데드족 몬스터 1장을 제외하고 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드가 몬스터 존에 앞면 표시로 존재하는 한, 자신은 \\\"벤데드\\\" 몬스터밖에 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:06.477683',694,'2025-09-16 16:39:06.477683','TT02-KRB01','엑소시스터 마르파','{\"attribute\": \"빛\", \"type\": \"[마법사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 800\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 몬스터가, 존재하지 않을 경우 또는 엑시즈 몬스터뿐일 경우에 발동할 수 있다(이 효과를 발동하는 턴에, 자신은 \\\"엑소시스터\\\" 몬스터밖에 특수 소환할 수 없다). 이 카드를 패에서 특수 소환하고, 덱에서 \\\"엑소시스터 에리스\\\" 1장을 특수 소환한다. ②: 자신이나 상대의 카드가 묘지에서 벗어났을 경우에 발동할 수 있다. \\\"엑소시스터\\\" 엑시즈 몬스터 1장을, 자신 필드의 이 카드 위에 겹쳐 엑시즈 소환으로 취급하고 엑스트라 덱에서 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,32,'2025-09-16 16:39:07.000582',695,'2025-09-16 16:39:07.000582','POTE-KR034','프레임 버디 에카','{\"attribute\": \"화염\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 200\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 소환 / 특수 소환에 성공했을 경우, 자신 또는 상대의 마법 & 함정 존의 앞면 표시의 몬스터 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 자신 필드에 특수 소환한다. ②: 이 카드 이외의 자신 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 앞면 표시 몬스터를 공격력 500 올리는 장착 카드로 취급하고 이 카드에 장착한다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:07.183335',696,'2025-09-16 16:39:07.183335','POTE-KR036','수계의 비석－카토린','{\"attribute\": \"물\", \"type\": \"[암석족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 1600\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 패에서 버리고 발동할 수 있다. 이 턴에, 자신은 통상 소환 외에도 1번만, 자신 메인 페이즈에 땅 / 물 속성 몬스터 1장을 일반 소환할 수 있다. ②: 이 카드가 묘지에 존재하고, 자신 필드에 땅 속성 몬스터 및 물 속성 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'UNCOMMON'),(1,32,'2025-09-16 16:39:07.381887',697,'2025-09-16 16:39:07.381887','POTE-KR037','너구러운 너구리부부','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 1600\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 몬스터 존에 존재하는 한, 이 카드는 릴리스할 수 없다. ②: 이 카드가 몬스터 존에 존재하는 한, 자신이 몬스터를 의식 소환할 경우, 자신의 엑스트라 덱의 몬스터 1장도 릴리스 대신에 묘지로 보낼 수 있다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:07.678404',698,'2025-09-16 16:39:07.678404','POTE-KR038','악성사 나이트멜트','{\"attribute\": \"바람\", \"type\": \"[사이킥족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 몬스터 1장을 릴리스하고 발동할 수 있다. 그 몬스터와는 원래의 카드명이 다르고, 원래의 종족 / 속성 / 레벨 / 공격력 / 수비력이 같은 몬스터 1장을 덱에서 특수 소환한다. 엑스트라 덱에서 특수 소환된 몬스터를 릴리스하고 발동했을 경우, 이 효과로 특수 소환할 몬스터를 엑스트라 덱에서 고를 수도 있다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:08.595399',699,'2025-09-16 16:39:08.595399','POTE-KR050','스케어클로 라이트하트','{\"attribute\": \"어둠\", \"type\": \"[야수전사족／링크／효과]\", \"link_arrows\": \"Left\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 -\", \"card_text\": \"스케어클로 몬스터 또는 \\\"비서스＝스타프로스트\\\" 1장이 카드를 링크 소환할 경우, 자신 메인 몬스터 존의 몬스터밖에 링크 소재로 할 수 없다. 이 카드명의 ②의 효과는 듀얼 중에 1번밖에 사용할 수 없다. ①: 이 카드가 엑스트라 몬스터 존에 링크 소환되었을 경우에 발동할 수 있다. 덱에서 \\\"사세괴＝라이포비아\\\" 1장을 패에 넣는다. ②: 자신 필드에 \\\"비서스＝스타프로스트\\\"가 존재할 경우에 발동할 수 있다. 이 카드를 묘지에서 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,32,'2025-09-16 16:39:08.929211',700,'2025-09-16 16:39:08.929211','POTE-KR053','EN 웨이브','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 \\\"엘리멘틀 히어로\\\" 몬스터가 융합 몬스터의 융합 소환의 소재가 되어, 묘지로 보내졌을 경우 또는 제외되었을 경우에 발동할 수 있다. 덱에서 \\\"네오 스페이시언\\\" 몬스터 또는 \\\"엘리멘틀 히어로 네오스\\\" 1장을 특수 소환한다. ②: \\\"네오 스페이시언\\\" 몬스터 또는 \\\"엘리멘틀 히어로 네오스\\\"가 자신의 필드 / 묘지에서 자신의 덱 / 엑스트라 덱으로 되돌아갔을 경우에 발동할 수 있다. 자신 묘지에서 \\\"엘리멘틀 히어로\\\" 몬스터 1장을 고르고 특수 소환한다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:09.191901',701,'2025-09-16 16:39:09.191901','TT01-KRB16','스프라이트 스타터','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 덱에서 \\\"스프라이트\\\" 몬스터 1장을 특수 소환하고, 자신은 그 몬스터의 원래 공격력만큼의 LP를 상실한다. 이 카드의 발동 후, 턴 종료시까지 자신은 레벨 2 / 랭크 2 / 링크 2 인 몬스터밖에 특수 소환할 수 없다.\"}',NULL,'UNCOMMON'),(1,32,'2025-09-16 16:39:09.496898',702,'2025-09-16 16:39:09.496898','TT01-KRB17','스프라이트 스매셔즈','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신의 패 / 묘지에서 \\\"스프리건즈\\\" 카드, \\\"세리온즈\\\" 카드, \\\"스프라이트\\\" 카드 중 어느 1장을 제외하고, 이하의 효과에서 1개를 선택하여 발동할 수 있다.●덱에서 \\\"스프리건즈\\\" 몬스터 1장을 특수 소환한다.●자신 묘지에서 \\\"세리온즈\\\" 몬스터 1장을 특수 소환한다.●자신 필드의 레벨 2 / 랭크 2 / 링크 2 인 몬스터 1장과 상대 필드의 카드 1장을 제외한다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:09.724151',703,'2025-09-16 16:39:09.724151','POTE-KR058','낙인의 센트럴 드래그마','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신이 마법 카드의 효과로 의식 몬스터 1장만을 특수 소환했을 경우에 발동할 수 있다. 자신 또는 상대의 엑스트라 덱을 확인하고, 그 중의 몬스터 1장을 골라 묘지로 보낸다. ②: 자신이 마법 카드의 효과로 융합 몬스터 1장만을 특수 소환했을 경우, 그 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터는 턴 종료시까지, 공격력을 자신의 원래 공격력만큼 올리고, 상대 필드의 공격 표시 몬스터에밖에 공격할 수 없다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:09.919658',704,'2025-09-16 16:39:09.919658','POTE-KR059','스케어클로 스트래들','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 이하의 효과에서 1개를 선택하고 발동할 수 있다.●자신 필드의, \\\"스케어클로\\\" 몬스터 또는 \\\"비서스＝스타프로스트\\\" 1장과, 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 상대 몬스터의 공격력과 수비력 중, 높은 쪽의 수치만큼만 그 자신 몬스터의 공격력 / 수비력을 올린다.●자신 필드의, \\\"스케어클로\\\" 몬스터 또는 \\\"비서스＝스타프로스트\\\"를 대상으로 하는 효과가 발동했을 때에 발동할 수 있다. 그 효과를 무효로 한다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:10.177830',705,'2025-09-16 16:39:10.177830','POTE-KR061','봄화정의 화관','{\"attribute\": \"마법\", \"card_text\": \"①: 이 카드가 마법 & 함정 존에 존재하는 한, 자신 필드의 땅 속성 몬스터는 \\\"봄화정\\\" 몬스터로도 취급한다. ②: 1턴에 1번, 자신이 패의 \\\"봄화정\\\" 몬스터의 효과를 발동하기 위해 그 몬스터와 카드 1장을 패에서 버릴 경우, 대신에 그 몬스터만을 버릴 수 있다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:10.900471',706,'2025-09-16 16:39:10.900471','POTE-KR070','분열된 낙인','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 융합 몬스터 1장을 릴리스하고, 서로의 묘지의 몬스터 및 제외되어 있는 몬스터 중에서, 융합 몬스터 이외의 몬스터 2장을 대상으로 하고 발동할 수 있다. 그 몬스터를 서로의 필드에 1장씩 특수 소환한다. \\\"알버스의 낙윤\\\"을 융합 소재로 하는 융합 몬스터를 릴리스하고 이 카드를 발동했을 경우, 대신에 대상 몬스터 2장을 자신 필드에 수비 표시로 특수 소환할 수 있다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:11.090481',707,'2025-09-16 16:39:11.090481','POTE-KR073','티아라멘츠 크라임','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신 필드에 \\\"티아라멘츠\\\" 몬스터 또는 \\\"비서스＝스타프로스트\\\"가 존재하고, 몬스터의 효과 / 마법 / 함정 카드가 발동했을 때에 발동할 수 있다. 그 발동을 무효로 하고, 그 카드를 주인의 덱으로 되돌린다. 그 후, 자신의 패에서 몬스터 1장을 고르고 묘지로 보낸다. ②: 이 카드가 효과로 묘지로 보내졌을 경우, 제외되어 있는 자신의 \\\"티아라멘츠\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 패에 넣는다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:11.370971',708,'2025-09-16 16:39:11.370971','POTE-KR074','봄화정의 달력넘기기','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 묘지의 \\\"봄화정\\\" 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 패에 넣거나 특수 소환한다. ②: 자신의 패가 0장일 경우, 상대 턴에, 묘지의 이 카드를 제외하고 발동할 수 있다. 자신 묘지에서 \\\"봄화정\\\" 몬스터를 가능한 한 특수 소환한다(같은 이름의 카드는 1장까지). 이 효과로 특수 소환한 몬스터는 자신 엔드 페이즈에 주인의 패로 되돌아간다. 이 효과는 이 카드가 묘지로 보내진 턴에는 발동할 수 없다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:11.539976',709,'2025-09-16 16:39:11.539976','POTE-KR075','봄화정과 꽃망울','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 묘지에서 특수 소환된 자신 필드의 땅 속성 몬스터의 종류의 수까지 상대 필드의 앞면 표시의 카드를 대상으로 하고 발동할 수 있다. 대상의 카드의 수만큼 자신 필드의 땅 속성 몬스터를 골라 주인의 패로 되돌리고, 대상의 카드를 주인의 패로 되돌린다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:11.762039',710,'2025-09-16 16:39:11.762039','POTE-KR077','A・∀・TT','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 \\\"어메이즈먼트\\\" 몬스터 또는 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 이 카드를 발동할 수 있다. 이 카드를 장착 카드로 취급하고 그 몬스터에 장착한다. ②: 장착 몬스터의 컨트롤러에 따라 이하의 효과를 발동할 수 있다.●자신: 장착 몬스터의 표시 형식을 변경하고, 자신 묘지의 \\\"어트랙션\\\" 함정 카드 1장을 상대가 고른다. 그 카드를 자신 필드에 세트한다.●상대: 장착 몬스터를 엔드 페이즈까지 제외한다.\"}',NULL,'COMMON'),(1,32,'2025-09-16 16:39:11.975416',711,'2025-09-16 16:39:11.975416','POTE-KR080','모래 먼지의 빅 허리케인','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신의 마법 & 함정 존에 세트된 카드를 임의의 수만큼 대상으로 하고 발동할 수 있다. 세트된 그 카드와, 이 카드를 주인의 패로 되돌린다. 그 후, 자신은 이 효과로 자신의 패로 되돌아간 카드의 수만큼, 패에서 마법 / 함정 카드를 세트할 수 있다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:12.396547',712,'2025-09-16 16:39:12.396547','PHNI-KR006','화이트 맘보','{\"attribute\": \"물\", \"type\": \"[어류족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1200\", \"deffence\": \"수비력 1000\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재할 경우, 같은 이름의 카드가 자신 필드에 존재하는 자신 묘지의 레벨 4 이하의 어류족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 특수 소환하고, 대상 몬스터를 특수 소환한다. ②: 이 카드를 묘지에서 특수 소환했을 경우에 발동할 수 있다. 이 턴에, 이 카드를 튜너로 취급한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:12.677966',713,'2025-09-16 16:39:12.677966','PHNI-KR007','화이트 사딘','{\"attribute\": \"물\", \"type\": \"[어류족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 800\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 덱에서 \\\"화이트 사딘\\\" 1장을 묘지로 보내고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 효과의 발동 후, 턴 종료시까지 자신은 물 속성 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 이 카드를 묘지에서 특수 소환했을 경우에 발동할 수 있다. 이 턴에, 이 카드를 튜너로 취급한다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:12.983205',714,'2025-09-16 16:39:12.983205','PHNI-KR014','환마의 소환신','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 릴리스하고 발동할 수 있다. \\\"신염황제 우리아\\\" \\\"번개황제 하몬\\\" \\\"환마황제 라비엘\\\" 중 어느 1장을 자신의 덱 / 묘지에서 패에 넣는다. 그 후, 공격력과 수비력의 수치가 같은 화염족 / 번개족 / 악마족의 레벨 10 몬스터 1장을 패에서 소환 조건을 무시하고 특수 소환할 수 있다. 이 효과로 특수 소환한 몬스터는 이 턴에 직접 공격할 수 없다. ②: 묘지의 이 카드를 제외하고 발동할 수 있다. 덱에서 \\\"차원 융합살\\\" 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:13.381360',715,'2025-09-16 16:39:13.381360','PHNI-KR015','고티스의 어스름 키프','{\"attribute\": \"물\", \"type\": \"[어류족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 필드에 어류족 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 상대 필드에 몬스터가 특수 소환되었을 경우, 그 중의 몬스터 1장과 자신의 제외 상태인 레벨 6 이하의 어류족 몬스터 1장을 대상으로 하고 발동할 수 있다. 대상의 상대 몬스터와 이 카드를 제외하고, 대상의 자신 몬스터를 특수 소환한다. ③: 이 카드가 제외된 다음 턴의 스탠바이 페이즈에 발동할 수 있다. 제외 상태인 이 카드를 특수 소환한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:13.681052',716,'2025-09-16 16:39:13.681052','PHNI-KR016','고티스의 월야 사이크스','{\"attribute\": \"물\", \"type\": \"[어류족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2400\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우에 발동할 수 있다. 덱에서 \\\"고티스의 월야 사이크스\\\" 이외의 어류족 몬스터 1장을 패에 넣는다. 그 후, 자신의 패 / 필드(앞면 표시)의 어류족 몬스터 1장을 제외한다. ②: 이 카드가 제외되었을 경우, 자신의 패 / 필드(앞면 표시) / 묘지에서 \\\"고티스의 월야 사이크스\\\" 이외의 어류족 몬스터 1장을 제외하고 발동할 수 있다. 이 카드를 특수 소환한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:13.851862',717,'2025-09-16 16:39:13.851862','PHNI-KR017','메멘토 우라몬','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 550\", \"deffence\": \"수비력 400\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 일반 소환 / 특수 소환했을 경우, \\\"메멘토 우라몬\\\" 이외의 자신 묘지의 \\\"메멘토\\\" 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 패에 넣는다. ②: 이 카드가 \\\"메멘토\\\" 몬스터의 효과로 묘지로 보내졌을 경우에 발동할 수 있다. 이 카드를 특수 소환한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:14.447561',718,'2025-09-16 16:39:14.447561','PHNI-KR020','순성의 용현희 사피라','{\"attribute\": \"빛\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2500\", \"deffence\": \"수비력 2400\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 패에서 버리고 발동할 수 있다. 덱에서 의식 마법 카드 1장을 묘지로 보낸다. 그 후, 전사족 / 드래곤족이고 빛 속성인 의식 몬스터 1장을 자신의 덱 / 묘지에서 패에 넣을 수 있다. ②: 묘지의 이 카드를 제외하고 발동할 수 있다. 레벨의 합계가 의식 소환할 몬스터의 레벨 이상이 되도록, 자신의 패 / 필드의 몬스터를 릴리스하고, 패에서 전사족 / 드래곤족이고 빛 속성인 의식 몬스터 1장을 의식 소환한다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:14.685830',719,'2025-09-16 16:39:14.685830','PHNI-KR021','순성의 용현성 사우라비스','{\"attribute\": \"빛\", \"type\": \"[드래곤족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2600\", \"deffence\": \"수비력 2800\", \"card_text\": \"이 카드명의, ①의 방법에 의한 특수 소환은 1턴에 1번밖에 할 수 없으며, ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드는 자신의 패 / 묘지에서 의식 마법 카드를 포함하는 마법 카드 2장을 덱으로 되돌리고, 패에서 특수 소환할 수 있다. ②: 상대가 카드의 효과를 발동했을 때, 필드의 이 카드를 패로 되돌리고 발동할 수 있다. 패 / 덱에서 전사족 / 드래곤족이고 빛 속성인 의식 몬스터 1장을 특수 소환한다. 이 효과로 특수 소환한 몬스터는 다음 턴의 엔드 페이즈에 덱으로 되돌아간다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:14.893230',720,'2025-09-16 16:39:14.893230','PHNI-KR023','마제스펙터 포큐파인','{\"attribute\": \"바람\", \"type\": \"[마법사족／펜듈럼／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에, 자신 필드에 \\\"마제스펙터\\\" 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드를 일반 소환 / 특수 소환했을 경우, 자신 묘지의 \\\"마제스펙터\\\" 마법 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 자신 필드에 세트한다. ③: 이 카드가 몬스터 존에 존재하는 한, 이 카드는 상대 효과로는 파괴되지 않으며, 상대는 이 카드를 효과의 대상으로 할 수 없다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:15.268160',721,'2025-09-16 16:39:15.268160','PHNI-KR029','고블린 강하 부대','{\"attribute\": \"바람\", \"type\": \"[전사족／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 패에서 공격 표시로 특수 소환했을 경우, 상대 필드의 효과 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 수비 표시로 한다. 대상 몬스터의 효과는, 이 카드가 앞면 수비 표시로 존재하는 동안에는 무효화된다. ②: 이 카드가 묘지에 존재하는 상태에서, 상대 필드에 몬스터가 특수 소환되었을 경우, 패를 1장 버리고 발동할 수 있다. 이 카드를 패에 넣는다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:15.498033',722,'2025-09-16 16:39:15.498033','PHNI-KR030','환랍관의 사자','{\"attribute\": \"화염\", \"type\": \"[환상마족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 800\", \"deffence\": \"수비력 1800\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대 몬스터의 공격 선언시에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. ②: 이 카드가 몬스터와 전투를 실행할 경우, 그 2장은 그 전투로는 파괴되지 않는다. ③: 상대 배틀 페이즈 종료시에 발동할 수 있다. 상대 필드의 모든 공격 표시 몬스터는 다음 상대 배틀 페이즈 개시시까지, 표시 형식을 변경할 수 없으며, 융합 / 싱크로 / 엑시즈 / 링크 소환의 소재로 할 수 없고, 효과는 무효화된다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:15.749340',723,'2025-09-16 16:39:15.749340','PHNI-KR031','동요 차항아리','{\"attribute\": \"어둠\", \"type\": \"[언데드족／튜너／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 몬스터 존에 존재하는 한, 이 카드와 같은 세로열의, 뒷면 수비 표시 몬스터는 표시 형식을 변경할 수 없으며, 마법 & 함정 존에 세트된 카드는 발동할 수 없다. ②: 자신 메인 페이즈에 발동할 수 있다. 이 카드를 옆의 메인 몬스터 존으로 이동한다. ③: 몬스터 존의 이 카드가 다른 몬스터 존으로 이동했을 경우에 발동한다. 이 카드와 같은 세로열의 다른 몬스터를 전부 뒷면 수비 표시로 한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:15.922044',724,'2025-09-16 16:39:15.922044','PHNI-KR036','다이노스 스태킹','{\"attribute\": \"땅\", \"type\": \"[야수족／효과]\", \"level\": \"레벨 1\", \"attack\": \"공격력 600\", \"deffence\": \"수비력 600\", \"card_text\": \"①: 1턴에 1번, 카드의 효과가 발동했을 때에 발동할 수 있다(데미지 스텝에도 발동 가능). 주사위를 1회 던진다. 이 효과의 발동시에 쌓여 있는 체인의 수에 따라 이하의 효과를 적용한다. ●2개: 이 카드의 공격력은 턴 종료시까지 나온 눈의 수 × 500 올린다. ●3개: 나온 눈의 수 × 500 데미지를 상대에게 준다. ●4개 이상: 나온 눈의 수까지 필드의 카드를 파괴한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:16.316913',725,'2025-09-16 16:39:16.316913','PHNI-KR039','아로마릴리스－매그놀리아','{\"attribute\": \"어둠\", \"type\": \"[식물족／융합／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2600\", \"deffence\": \"수비력 1800\", \"card_text\": \"아로마 몬스터 ＋ 식물족 몬스터①: 자신의 LP가 상대보다 많고, 이 카드가 몬스터 존에 존재하는 한, 자신 필드의 식물족 몬스터는 상대 효과로는 파괴되지 않는다. ②: 1턴에 1번, 2000 LP를 지불하고 발동할 수 있다. 자신 필드의 \\\"촉촉한 바람\\\" \\\"메마른 바람\\\" \\\"은혜의 바람\\\"의 수만큼, 필드의 카드를 제외한다. ③: 1턴에 1번, 자신의 LP가 회복했을 경우에 발동할 수 있다(데미지 스텝에도 발동 가능). 그 수치만큼만, 자신 필드의 모든 식물족 몬스터의 공격력은 턴 종료시까지 올린다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:16.603795',726,'2025-09-16 16:39:16.603795','PHNI-KR040','마스터 오브 HAM','{\"attribute\": \"땅\", \"type\": \"[야수족／융합／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 2100\", \"deffence\": \"수비력 1850\", \"card_text\": \"야수족 몬스터 × 2이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 융합 소환 / 리버스했을 경우에 발동할 수 있다. 자신의 패 / 덱에서 리버스 몬스터 1장을 뒷면 수비 표시로 특수 소환한다. ②: 이 카드가 묘지에 존재할 경우, 자신의 필드(앞면 표시) / 묘지에서 리버스 몬스터 2장을 제외하고 발동할 수 있다. 이 카드를 뒷면 수비 표시로 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:16.856889',727,'2025-09-16 16:39:16.856889','PHNI-KR041','화이트 아우라 포포이즈','{\"attribute\": \"물\", \"type\": \"[어류족／싱크로／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 1300\", \"card_text\": \"물 속성 튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 싱크로 소환했을 경우에 발동할 수 있다. 자신의 패 / 묘지에서 레벨 4 이하의 어류족 몬스터 1장을 수비 표시로 특수 소환한다. 그 후, 그와 같은 이름의 몬스터 1장을 자신 묘지에서 특수 소환할 수 있다. ②: 이 카드가 상대에 의해 파괴되어 묘지로 보내졌을 경우, 자신 묘지에서 다른 물 속성 몬스터 1장을 제외하고 발동할 수 있다. 이 카드를 튜너로 취급하고 특수 소환한다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:17.128994',728,'2025-09-16 16:39:17.128994','PHNI-KR044','피시램프','{\"attribute\": \"화염\", \"type\": \"[어류족／싱크로／튜너／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1200\", \"deffence\": \"수비력 400\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 싱크로 소재로서 묘지로 보내졌을 경우에 발동할 수 있다. 자신 필드에 \\\"램프 토큰\\\"(어류족 / 화염 / 레벨 2 / 공 0 / 수 0) 2장을 특수 소환한다. 이 턴에, 자신은 어류족 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 자신 필드에 어류족 싱크로 몬스터가 존재할 경우, 묘지의 이 카드를 제외하고, 필드의 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:17.637793',729,'2025-09-16 16:39:17.637793','PHNI-KR048','고블린즈 크레이지 비스트','{\"attribute\": \"어둠\", \"type\": \"[악마족／엑시즈／효과]\", \"rank\": \"랭크 6\", \"attack\": \"공격력 2700\", \"deffence\": \"수비력 0\", \"card_text\": \"레벨 6 몬스터 × 2장 이상이 카드명의 ③의 효과는 듀얼 중에 1번밖에 사용할 수 없다. ①: 자신 / 상대 턴에 1번, 필드의 마법 / 함정 카드 1장을 대상으로 하고 발동할 수 있다. 필드의 엑시즈 소재를 2개 제거하고, 대상의 카드를 이 카드의 엑시즈 소재로 한다. ②: 자신 필드의 몬스터가 효과로 파괴될 경우, 대신에 이 카드의 엑시즈 소재를 1개 제거할 수 있다. ③: 이 카드가 묘지에 존재할 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 그 후, 자신 묘지의 \\\"고블린\\\" 몬스터 1장을 이 카드의 엑시즈 소재로 할 수 있다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:17.993645',730,'2025-09-16 16:39:17.993645','PHNI-KR051','마제스펙터 오르트','{\"attribute\": \"바람\", \"type\": \"[마법사족／링크／효과]\", \"link_arrows\": \"Bottom-Left/Bottom-Right\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 -\", \"card_text\": \"마제스펙터 몬스터를 포함하는 펜듈럼 몬스터 2장이 카드명의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드를 링크 소환했을 경우에 발동할 수 있다. 자신의 엑스트라 덱(앞면)에서 \\\"마제스펙터\\\" 펜듈럼 몬스터를 2장까지 패에 넣는다. 그 후, 덱에서 \\\"마제스펙터\\\" 펜듈럼 몬스터를 2장까지 엑스트라 덱에 앞면으로 넣을 수 있다(같은 이름의 카드는 1장까지). 이 효과의 발동 후, 턴 종료시까지 자신은 \\\"마제스펙터\\\" 몬스터 및 \\\"룡검사\\\" 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:18.582375',731,'2025-09-16 16:39:18.582375','PHNI-KR053','세베크의 마도사','{\"attribute\": \"물\", \"type\": \"[물족／링크／효과]\", \"link_arrows\": \"Bottom-Left/Bottom-Right\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 -\", \"card_text\": \"효과 몬스터 2장이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드 또는 이 카드의 링크 앞의 자신 몬스터가 상대에게 전투 데미지를 주었을 때에 발동할 수 있다. 그 수치만큼만 자신의 LP를 회복한다. ②: 자신이나 상대의 LP가 회복했을 경우에 발동할 수 있다(데미지 스텝에도 발동 가능). 서로 1000 데미지를 받는다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:18.815168',732,'2025-09-16 16:39:18.815168','PHNI-KR054','나이트메어 페인','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 메인 페이즈에 발동할 수 있다. 자신의 패 / 필드(앞면 표시)의 어둠 속성 몬스터 1장을 파괴하고, \\\"나이트메어 페인\\\"이 아닌, \\\"유벨\\\" 1장 또는 그 카드명이 쓰여진 카드 1장을 덱에서 패에 넣는다. ②: 자신 필드에 \\\"유벨\\\" 몬스터가 존재하는 한, 공격 가능한 상대 몬스터는 \\\"유벨\\\" 몬스터를 공격해야 한다. ③: 자신의 \\\"유벨\\\" 몬스터의 전투로 발생하는 자신에게로의 전투 데미지는 대신에 상대가 받는다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:19.042624',733,'2025-09-16 16:39:19.042624','PHNI-KR055','매추어 크로니클','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: \\\"유벨\\\" 몬스터 또는 \\\"유벨\\\"의 카드명이 쓰여진 몬스터가 특수 소환될 때마다, 이 카드에 크로니클 카운터를 1개 놓는다. ②: 자신 필드의 크로니클 카운터를 이하의 수만큼 제거하고, 그 효과를 발동할 수 있다. ●1: 자신 묘지에서 \\\"유벨\\\" 1장을 특수 소환한다. ●2: 자신의 제외 상태인 카드 1장을 패에 넣는다. ●3: 덱에서 카드 1장을 고르고 제외한다. ●4: 필드의 카드 1장을 파괴한다. ●5: 덱에서 \\\"초융합\\\" 1장을 패에 넣는다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:19.388026',734,'2025-09-16 16:39:19.388026','PHNI-KR058','화이트 리인카네이션','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 자신을 튜너로 취급하는 효과를 가지는 어류족 몬스터 1장을 덱에서 패에 넣는다. ②: 1턴에 1번, 자신의 \\\"화이트 아우라\\\" 몬스터가 공격한 데미지 스텝 종료시에 발동할 수 있다. 그 공격 몬스터는 1번만 더 이어서 공격할 수 있다. ③: 1턴에 1번, 자신 묘지에서 레벨 8 이상의 어류족 싱크로 몬스터가 특수 소환되었을 경우에 발동할 수 있다(데미지 스텝에도 발동 가능). 상대 필드의 몬스터를 전부 파괴한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:19.630362',735,'2025-09-16 16:39:19.630362','PHNI-KR059','기성상','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의 몬스터가 자신의 마법 카드의 효과 또는 상대 효과로 파괴되어 묘지로 보내진 턴에 발동할 수 있다. 다음 자신 배틀 페이즈를 2회 실행할 수 있다. ②: 이 카드가 묘지에 존재하는 상태에서, 자신 필드의 몬스터가 덱 / 엑스트라 덱(뒷면)으로 되돌아갔을 경우에 발동할 수 있다. 이 카드를 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:19.869855',736,'2025-09-16 16:39:19.869855','PHNI-KR062','스네이크아이 추주극','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 덱 / 묘지에서 \\\"디아벨스타\\\" 몬스터 1장을 지속 마법 카드로 취급하고 원래 주인의 마법 & 함정 존에 앞면 표시로 놓는다. ②: 자신 / 상대의 엔드 페이즈에, 묘지의 이 카드를 제외하고, 자신 필드의 지속 마법 카드 취급의 몬스터 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 특수 소환한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:20.089141',737,'2025-09-16 16:39:20.089141','PHNI-KR064','지박융합','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. 이 카드는 필드 존에 카드가 존재하지 않을 경우, 자신 / 상대의 메인 페이즈에밖에 발동할 수 없다. ①: 자신의 패 / 필드의 몬스터를 융합 소재로 하고, 어둠 속성의 융합 몬스터 1장을 융합 소환한다. ②: 필드 존에 카드가 존재할 경우, 자신 메인 페이즈에 묘지의 이 카드를 제외하고 발동할 수 있다. 자신의 패 / 묘지에서 \\\"지박\\\" 몬스터 1장을 특수 소환한다. 이 턴에, 자신은 융합 / 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:20.312264',738,'2025-09-16 16:39:20.312264','PHNI-KR065','왕묘의 석벽','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드는 필드 존에 존재하는 한, 카드명을 \\\"왕의 관\\\"으로 취급한다. ②: 자신 메인 페이즈에 발동할 수 있다. 덱에서 \\\"호루스\\\" 몬스터 1장을 패에 넣는다. 그 후, 자신의 패를 1장 고르고 덱 맨 아래로 되돌린다. ③: 자신이 \\\"호루스의 흑염신\\\"의 효과를 발동했을 경우에 발동할 수 있다. 자신은 1장 드로우한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:20.517306',739,'2025-09-16 16:39:20.517306','PHNI-KR066','순성한 기도','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 레벨의 합계가 의식 소환할 몬스터의 레벨 이상이 되도록, 자신의 패 / 필드의 빛 속성 몬스터를 릴리스하고, 패에서 빛 속성의 의식 몬스터 1장을 의식 소환한다. ②: 자신 필드의 앞면 표시 빛 속성의 의식 몬스터가 상대 효과로 필드에서 벗어났을 경우, 묘지의 이 카드를 제외하고 발동할 수 있다. 패 / 덱에서 \\\"고성대 사우라비스\\\" \\\"용희신 사피라\\\" \\\"순성한 수호자 로가디언\\\" 중 어느 1장을 소환 조건을 무시하고 특수 소환한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:20.731015',740,'2025-09-16 16:39:20.731015','PHNI-KR067','순성한 결계','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드에 \\\"순성의 기도하는 손 로\\\" 및 빛 속성의 의식 몬스터가 존재하는 한, 상대 몬스터는 의식 몬스터밖에 공격 대상으로 선택할 수 없으며, 자신 필드의 빛 속성 몬스터를 상대는 효과의 대상으로 할 수 없다. ②: 자신 메인 페이즈에 발동할 수 있다. \\\"순성한 결계\\\"가 아닌, \\\"순성\\\" 카드 1장이나 \\\"로가디언\\\" 의식 몬스터 1장을 덱에서 패에 넣는다.\"}',NULL,'UNCOMMON'),(1,38,'2025-09-16 16:39:21.127017',741,'2025-09-16 16:39:21.127017','PHNI-KR069','마제스펙터 윈드','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. 이 카드는 자신 필드의 마법사족 / 바람 속성 몬스터 1장을 릴리스하고 발동할 수도 있다. ①: 자신의 패 / 묘지에서 \\\"마제스펙터\\\" 몬스터 1장을 특수 소환한다. 몬스터를 릴리스하고 이 카드를 발동했을 경우, 대신에 덱에서 \\\"마제스펙터\\\" 몬스터 1장을 특수 소환할 수도 있다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:21.345337',742,'2025-09-16 16:39:21.345337','PHNI-KR072','동박새우르르','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없으며, 몬스터 존의 카드와 마법 & 함정 존의 앞면 표시의 몬스터 카드가 합계 10장 이상 존재할 경우에밖에 발동할 수 없다. ①: 덱에서 몬스터 1장을 지속 마법 카드로 취급하고 자신의 마법 & 함정 존에 앞면 표시로 놓는다. ②: 묘지의 이 카드를 제외하고 발동할 수 있다. 덱에서 몬스터 1장을 지속 함정 카드로 취급하고 자신의 마법 & 함정 존에 앞면 표시로 놓는다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:21.590359',743,'2025-09-16 16:39:21.590359','PHNI-KR074','RR－그로리어스 브라이트','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신 필드에 \\\"RR(레이드 랩터즈)\\\" 몬스터가 존재할 경우, 상대 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다(자신 필드에 \\\"RR(레이드 랩터즈)\\\" 엑시즈 몬스터가 존재할 경우, 대신에 상대 필드의 앞면 표시 카드 1장을 대상으로 할 수도 있다). 그 카드의 효과를 턴 종료시까지 무효로 한다. ②: 묘지의 이 카드를 제외하고, 자신의 묘지 / 제외 상태인 \\\"RR(레이드 랩터즈)\\\" 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 패에 넣는다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:21.874603',744,'2025-09-16 16:39:21.874603','PHNI-KR076','순성한 위광','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에, 이하의 효과에서 1개를 선택하고 발동할 수 있다. ●자신의 패 / 묘지에서, 전사족 / 드래곤족이고 빛 속성인 의식 몬스터 1장 또는 의식 마법 카드 1장을 덱으로 되돌리고, 덱에서 \\\"순성\\\" 몬스터 1장을 골라, 패에 넣거나 특수 소환한다. ●자신 필드의 전사족 / 드래곤족이고 빛 속성인 의식 몬스터의 수까지, 상대 필드의 카드를 대상으로 하여 발동할 수 있다. 그 카드와 이 카드를 파괴한다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:22.179717',745,'2025-09-16 16:39:22.179717','PHNI-KR077','아로마힐링','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 자신은 자신 필드의 \\\"아로마\\\" 몬스터의 종류 × 1000 LP 회복한다. ②: 묘지의 이 카드를 제외하고, 자신 묘지의 \\\"아로마\\\" 몬스터 1장을 대상으로 하여 발동할 수 있다. 그 몬스터를 특수 소환한다. 그 후, 자신은 500 LP 회복한다. 이 효과로 특수 소환한 몬스터는, 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,38,'2025-09-16 16:39:22.482782',746,'2025-09-16 16:39:22.482782','AE21-KRS20','룸펠 토이펠','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 ①②의 효과는 1턴에 1번, 어느 쪽이든 1개밖에 사용할 수 없다. ①: 몬스터 카드명을 1개 선언하고 발동할 수 있다. 이 턴에, 서로 선언된 몬스터와 원래의 카드명이 같은 몬스터를 묘지 이외에서 특수 소환할 수 없다. ②: 묘지의 이 카드를 제외하고, 몬스터 카드명을 1개 선언하여 발동할 수 있다. 이 턴에, 서로 선언된 몬스터와 원래의 카드명이 같은 몬스터의 필드에서 발동하는 효과를 발동할 수 없다.\"}',NULL,'UNCOMMON'),(1,34,'2025-09-16 16:39:23.582307',747,'2025-09-16 16:39:23.582307','PHHY-KR007','스케어클로 크샤트리라','{\"attribute\": \"땅\", \"type\": \"[사이킥족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 2600\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에 발동할 수 있다. 이 카드를 패에서 특수 소환하고, 자신의 패 / 묘지에서 \\\"크샤트리라\\\" 카드 또는 \\\"스케어클로\\\" 카드 1장을 골라 제외한다. ②: 이 카드는 앞면 수비 표시 그대로 공격할 수 있다. 그 경우, 이 카드는 수비력을 공격력으로 취급하고 데미지 계산을 실행한다. ③: 자신의 \\\"크샤트리라\\\" 몬스터 또는 \\\"스케어클로\\\" 몬스터가, 상대 몬스터와 전투를 실행할 경우, 턴 종료시까지 그 상대 몬스터의 효과는 무효화된다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:23.833779',748,'2025-09-16 16:39:23.833779','PHHY-KR008','티아라멘츠 크샤트리라','{\"attribute\": \"물\", \"type\": \"[사이킥족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2300\", \"deffence\": \"수비력 1200\", \"card_text\": \"이 카드명의 ①②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에 발동할 수 있다. 이 카드를 패에서 특수 소환하고, 자신의 패 / 묘지에서 \\\"크샤트리라\\\" 카드 또는 \\\"티아라멘츠\\\" 카드 1장을 골라 제외한다. ②: 이 카드가 일반 소환 / 특수 소환에 성공했을 경우에 발동할 수 있다. 자신 또는 상대의 덱 위에서 카드를 3장 묘지로 보낸다. ③: 이 카드가 효과로 묘지로 보내졌을 경우에 발동할 수 있다. 자신의 덱 위에서 카드를 2장 묘지로 보낸다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:24.379354',749,'2025-09-16 16:39:24.379354','PHHY-KR010','쉘 오브 카오스','{\"attribute\": \"어둠\", \"type\": \"[기계족／특수 소환／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드는 통상 소환할 수 없으며, 카드의 효과로만 특수 소환할 수 있다. 이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 묘지에서 빛 속성 몬스터 1장을 제외하고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 턴에, 자신은 빛 / 어둠 속성의 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 이 카드가 특수 소환에 성공했을 경우, 제외되어 있는 자신의 \\\"코어 오브 카오스\\\" 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. ③: 앞면 표시의 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:24.681818',750,'2025-09-16 16:39:24.681818','PHHY-KR011','코어 오브 카오스','{\"attribute\": \"빛\", \"type\": \"[번개족／특수 소환／튜너／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 1600\", \"card_text\": \"이 카드는 통상 소환할 수 없으며, 카드의 효과로만 특수 소환할 수 있다. 이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신의 패 / 묘지에서 어둠 속성 몬스터 1장을 제외하고 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 턴에, 자신은 빛 / 어둠 속성의 싱크로 몬스터밖에 엑스트라 덱에서 특수 소환할 수 없다. ②: 이 카드가 특수 소환에 성공했을 경우, 제외되어 있는 자신의 \\\"쉘 오브 카오스\\\" 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 특수 소환한다. ③: 앞면 표시의 이 카드는 필드에서 벗어났을 경우에 제외된다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:25.002964',751,'2025-09-16 16:39:25.002964','PHHY-KR014','바이오인섹트아머','{\"attribute\": \"땅\", \"type\": \"[곤충족／효과]\", \"level\": \"레벨 5\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패 / 묘지에 존재하고, 자신 필드에 \\\"바이오인섹트아머\\\"가 존재하지 않을 경우, 자신 필드의 곤충족 몬스터 1장을 대상으로 하고 발동할 수 있다. 이 카드를 장착 카드로 취급하여 그 몬스터에 장착한다. 이 카드 및 이 효과로 이 카드를 장착한 몬스터는, 필드에서 벗어났을 경우에 제외된다. ②: 이 카드를 장착한 몬스터는 서로의 배틀 페이즈 및 메인 페이즈 2 동안, 공격력을 1500 올리고, 수비력을 2000 올린다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:25.243883',752,'2025-09-16 16:39:25.243883','PHHY-KR016','마계극단－리버티 드라마티스트','{\"attribute\": \"어둠\", \"type\": \"[악마족／펜듈럼／효과]\", \"level\": \"레벨 4\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 1500\", \"card_text\": \"이 카드명의 ①②의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 펜듈럼 존에서의 특수 소환에 성공했을 경우에 발동한다. 이 카드의 원래의 주인은, 자신의 덱에서 \\\"마계대본\\\" 마법 카드 3장을 상대에게 보여주고, 상대는 그 중에서 무작위로 1장 고른다. 그 카드 1장을 자신 필드에 세트하고, 나머지 카드는 덱으로 되돌린다. 이 효과로 세트한 카드는 엔드 페이즈에 파괴된다. ②: 이 카드가 파괴되었을 경우에 발동할 수 있다. 자신 묘지에서 \\\"마계대본\\\" 마법 카드 1장을 고르고 덱으로 되돌린다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:25.493985',753,'2025-09-16 16:39:25.493985','PHHY-KR017','중의 첩자－지오우','{\"attribute\": \"땅\", \"type\": \"[암석족／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 2300\", \"deffence\": \"수비력 2900\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 일반 소환 / 특수 소환 / 리버스했을 경우, 필드의 앞면 표시 몬스터를 2장까지 대상으로 하고 발동할 수 있다. 그 몬스터를 뒷면 수비 표시로 한다. 이 효과로 뒷면 수비 표시가 된 상대 필드의 몬스터는 표시 형식을 변경할 수 없다. ②: 이 카드가 이미 몬스터 존에 앞면 표시로 존재하는 상태에서, 필드의 몬스터가 리버스했을 경우, 상대 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:25.661795',754,'2025-09-16 16:39:25.661795','PHHY-KR019','주안의 권속 바실리코크','{\"attribute\": \"어둠\", \"type\": \"[악마족／효과]\", \"level\": \"레벨 3\", \"attack\": \"공격력 1000\", \"deffence\": \"수비력 2000\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대 턴에, 이 카드가 패 / 묘지에 존재하고, 자신 필드에 \\\"주안\\\" 몬스터가 존재할 경우에 발동할 수 있다. 이 카드를 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 필드에서 벗어났을 경우에 제외된다. ②: 상대 턴에 발동할 수 있다. 자신 필드의 몬스터를 링크 소재로서 \\\"주안\\\" 링크 몬스터 1장을 링크 소환한다. 그 시기에, 자신 필드의 \\\"주안\\\" 장착 마법 카드를 \\\"주안\\\" 몬스터로서 링크 소재로 할 수 있다.\"}',NULL,'COMMON