vel\": \"레벨 3\", \"attack\": \"공격력 500\", \"deffence\": \"수비력 100\", \"card_text\": \"이 카드명의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 필드의 앞면 표시 몬스터 1장을 대상으로 하고 발동할 수 있다. 자신의 패 / 필드에서 이 카드를 공격력 / 수비력 100 올리는 장착 카드로 취급하고 그 몬스터에 장착한다. 이 효과는 상대 턴에도 발동할 수 있다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:27.090435',760,'2025-09-16 16:39:27.090435','PHHY-KR027','Couple of Aces','{\"attribute\": \"땅\", \"type\": \"[천사족／효과]\", \"level\": \"레벨 2\", \"attack\": \"공격력 100\", \"deffence\": \"수비력 100\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 패에 존재할 경우에 발동할 수 있다. 코인 토스를 1회 실행한다. 앞면인 경우, 이 카드를 자신 필드에 특수 소환한다. 뒷면인 경우, 이 카드를 상대 필드에 특수 소환한다. ②: 이 카드의 ①의 효과로 특수 소환에 성공했을 경우에 발동한다. 자신은 덱에서 2장 드로우한다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:27.305735',761,'2025-09-16 16:39:27.305735','PHHY-KR029','메테오러시－시로쿠로이드','{\"attribute\": \"땅\", \"type\": \"[기계족／효과]\", \"level\": \"레벨 10\", \"attack\": \"공격력 0\", \"deffence\": \"수비력 0\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 5회 이상 공격 선언된 턴의 배틀 페이즈에 발동할 수 있다. 이 카드를 패에서 특수 소환한다. 이 효과는 상대 턴에도 발동할 수 있다. ②: 이 카드가 전투를 실행하는 데미지 스텝 동안, 이 카드의 공격력은, 이 턴에 턴 플레이어가 공격 선언한 횟수 × 1000 올린다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:27.479687',762,'2025-09-16 16:39:27.479687','PHHY-KR030','잠복의 G','{\"attribute\": \"땅\", \"type\": \"[곤충족／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 1300\", \"deffence\": \"수비력 2500\", \"card_text\": \"이 카드명의 ①의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 상대가 몬스터의 특수 소환에 성공했을 때에 발동할 수 있다. 이 카드를 패에서 뒷면 수비 표시로 특수 소환한다. 이 효과로 특수 소환한 이 카드는, 이 턴의 엔드 페이즈에 앞면 수비 표시가 된다. ②: 이 카드가 엔드 페이즈에 리버스했을 경우에 발동한다. 필드의 특수 소환된 몬스터를 전부 파괴한다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:28.185137',763,'2025-09-16 16:39:28.185137','PHHY-KR040','카오스 비스트－혼돈의 마수－','{\"attribute\": \"어둠\", \"type\": \"[악마족／싱크로／효과]\", \"level\": \"레벨 6\", \"attack\": \"공격력 2000\", \"deffence\": \"수비력 1800\", \"card_text\": \"빛 속성 튜너 ＋ 튜너 이외의 어둠 속성 몬스터 1장 이상이 카드명의 ②③의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 이 턴에 카드가 제외되어 있을 경우, 이 카드의 공격력은 1000 올린다. ②: 제외되어 있는 자신의 빛 / 어둠 속성 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 패에 넣는다. ③: 이 카드 이외의 빛 / 어둠 속성 몬스터를 1장씩, 자신의 패 / 묘지에서 제외하고 발동할 수 있다. 이 카드를 묘지에서 특수 소환한다. 이 효과는 이 카드가 묘지로 보내진 턴에는 발동할 수 없다.\"}',NULL,'UNCOMMON'),(1,34,'2025-09-16 16:39:28.403680',764,'2025-09-16 16:39:28.403680','PHHY-KR041','플런드롤－장중의 요르즈호','{\"attribute\": \"땅\", \"type\": \"[악마족／싱크로／펜듈럼／효과]\", \"level\": \"레벨 8\", \"attack\": \"공격력 1500\", \"deffence\": \"수비력 3000\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ①②의 몬스터 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 상대가 몬스터의 특수 소환에 성공했을 경우에 발동할 수 있다. 덱에서 \\\"플런드롤\\\" 카드 1장을 패에 넣는다. 이 카드가 \\\"플런드롤\\\" 카드를 장착하고 있을 경우, 추가로 덱에서 \\\"플런드롤\\\" 몬스터 1장을 특수 소환할 수 있다. ②: 자신 묘지의 \\\"플런드롤\\\" 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 패에 넣고, 이 카드를 자신의 펜듈럼 존에 놓는다.\"}',NULL,'UNCOMMON'),(1,34,'2025-09-16 16:39:28.651085',765,'2025-09-16 16:39:28.651085','PHHY-KR042','서클 오브 페어리','{\"attribute\": \"바람\", \"type\": \"[식물족／싱크로／효과]\", \"level\": \"레벨 7\", \"attack\": \"공격력 2200\", \"deffence\": \"수비력 2500\", \"card_text\": \"튜너 ＋ 튜너 이외의 몬스터 1장 이상이 카드명의 ②의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드가 몬스터 존에 존재하는 한, 자신은 통상 소환 외에도 1번만, 자신 메인 페이즈에 곤충족 / 식물족 몬스터 1장을 일반 소환할 수 있다. ②: 자신의 곤충족 / 식물족 몬스터의 전투로 몬스터가 파괴되어 묘지로 보내졌을 때, 그 파괴된 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터의 공격력 절반의 데미지를 상대에게 준다. 그 후, 준 데미지의 수치만큼만 자신의 LP를 회복한다.\"}',NULL,'UNCOMMON'),(1,34,'2025-09-16 16:39:29.287874',766,'2025-09-16 16:39:29.287874','PHHY-KR049','마계극단－슈퍼 프로듀서','{\"attribute\": \"어둠\", \"type\": \"[악마족／링크／효과]\", \"link_arrows\": \"Bottom-Left/Bottom-Right\", \"attack\": \"공격력 1600\", \"deffence\": \"수비력 -\", \"card_text\": \"악마족 몬스터를 포함하는 몬스터 2장이 카드명의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 / 상대의 메인 페이즈에, 자신 필드의 앞면 표시의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다. 그 후, 이하의 효과에서 1개를 고르고 적용할 수 있다.●덱에서 \\\"마계극장 \\\"판타스틱시어터\\\"\\\" 1장을 고르고 자신의 필드 존에 앞면 표시로 놓는다.●덱에서 \\\"마계극단\\\" 펜듈럼 몬스터 1장을 고르고 자신의 펜듈럼 존에 놓는다.\"}',NULL,'UNCOMMON'),(1,34,'2025-09-16 16:39:29.594722',767,'2025-09-16 16:39:29.594722','PHHY-KR052','누메론 크리에이션','{\"attribute\": \"마법\", \"card_text\": \"이 카드명은 룰상 \\\"갤럭시아이즈\\\" 카드로도 취급한다. 이 카드명의 효과는 1턴에 1번밖에 적용할 수 없다. ①: 원래 공격력이 3000 이상인 드래곤족 / 빛 속성 몬스터가 필드에 3장 이상 존재할 경우에 발동할 수 있다. 엑스트라 덱에서 드래곤족의 \\\"No.\\\" 엑시즈 몬스터 1장을 특수 소환한다. 그 후, 필드의 이 카드를 그 몬스터 아래에 겹쳐 엑시즈 소재로 한다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:30.080848',768,'2025-09-16 16:39:30.080848','PHHY-KR056','낙인의 빛','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 / 상대의, 필드 / 묘지의 융합 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터를 주인의 엑스트라 덱으로 되돌린다. 그 후, 자신 묘지의 \\\"알버스의 낙윤\\\"과 상대 묘지의 몬스터를 1장씩 골라 주인의 필드에 특수 소환할 수 있다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:30.482576',769,'2025-09-16 16:39:30.482576','PHHY-KR059','육세괴＝파라이조스','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없으며, 이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 이 카드의 발동시의 효과 처리로서, 덱에서 \\\"크샤트리라\\\" 몬스터 1장을 패에 넣을 수 있다. ②: 자신 필드의 몬스터의 공격력 / 수비력은, 필드의 몬스터 속성의 종류 × 100 올린다. ③: 자신 필드의 \\\"크샤트리라 샹그릴라\\\"가 효과를 발동했을 경우, 필드의 카드 1장을 대상으로 하고 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'UNCOMMON'),(1,34,'2025-09-16 16:39:30.736366',770,'2025-09-16 16:39:30.736366','PHHY-KR060','스케어클로 디팡','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ③의 효과는 1턴에 1번밖에 사용할 수 없다. ①: 자신 필드의, \\\"스케어클로\\\" 링크 몬스터 및 \\\"비서스＝스타프로스트\\\"는 상대 효과의 대상이 되지 않으며, 상대 효과로는 파괴되지 않는다. ②: 자신의, \\\"스케어클로\\\" 링크 몬스터 또는 \\\"비서스＝스타프로스트\\\"가 전투로 파괴한 몬스터는 묘지로는 가지 않으며 제외된다. ③: 자신의 필드 / 묘지에서 \\\"스케어클로\\\" 링크 몬스터 1장을 제외하고, 상대 필드의 카드 1장을 대상으로 하여 발동할 수 있다. 그 카드를 파괴한다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:31.195179',771,'2025-09-16 16:39:31.195179','PHHY-KR064','마계대본 \"드라마틱 스토리\"','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 자신 필드의 \\\"마계극단\\\" 펜듈럼 몬스터 1장을 대상으로 하고 발동할 수 있다. 그 몬스터와는 카드명이 다른 \\\"마계극단\\\" 몬스터 1장을 덱에서 특수 소환한다. 그 후, 대상 몬스터를 자신의 펜듈럼 존에 놓거나 파괴한다. ②: 자신의 엑스트라 덱에 앞면 표시의 \\\"마계극단\\\" 펜듈럼 몬스터가 존재하고, 세트된 이 카드가 상대의 효과로 파괴되었을 경우에 발동할 수 있다. 필드의 카드를 2장까지 고르고 주인의 패로 되돌린다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:31.439839',772,'2025-09-16 16:39:31.439839','PHHY-KR068','재탄의 주안','{\"attribute\": \"마법\", \"card_text\": \"이 카드명의 ①②의 효과는 각각 1턴에 1번밖에 사용할 수 없다. ①: 덱에서 \\\"주안\\\" 몬스터 1장과 \\\"주안\\\" 마법 / 함정 카드 1장을 묘지로 보내고 발동할 수 있다. 덱에서 \\\"주안\\\" 장착 마법 카드 1장을 패에 넣는다. 이 턴에, 자신이 \\\"주안\\\" 카드 이외의 카드의 효과를 발동할 때마다 자신은 500 LP를 상실한다. ②: 자신이 \\\"주안\\\" 링크 몬스터의 링크 소환에 성공했을 경우, 묘지의 이 카드를 제외하고 발동할 수 있다. 자신 묘지에서 \\\"주안\\\" 장착 마법 카드 1장을 고르고, 자신 필드의 \\\"주안\\\" 링크 몬스터 1장에 장착한다.\"}',NULL,'UNCOMMON'),(1,34,'2025-09-16 16:39:31.820320',773,'2025-09-16 16:39:31.820320','PHHY-KR071','포톤 리타데이션','{\"attribute\": \"함정\", \"card_text\": \"①: \\\"포톤\\\" 지속 마법 / 지속 함정 카드 또는 \\\"갤럭시\\\" 지속 마법 / 지속 함정 카드 1장을 덱에서 고르고, 패에 넣거나 자신 필드에 앞면 표시로 놓는다. ②: 세트된 이 카드가 상대 턴에 상대의 효과로 파괴되었을 경우, 자신 필드에 \\\"갤럭시아이즈 포톤 드래곤\\\" 또는 \\\"갤럭시아이즈 포톤 드래곤\\\"을 엑시즈 소재로 하고 있는 엑시즈 몬스터가 존재하면 발동할 수 있다. 이 턴의 엔드 페이즈가 된다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:32.008553',774,'2025-09-16 16:39:32.008553','PHHY-KR072','기간틱 썬더크로스','{\"attribute\": \"함정\", \"card_text\": \"이 카드명의 카드는 1턴에 1장밖에 발동할 수 없다. ①: 서로의 필드 / 묘지의 몬스터 중에서, 제외되어 있는 서로의 카드 매수의 차의 수만큼 대상으로 하고 발동할 수 있다. 그 몬스터를 제외한다. 그 후, 상대는 자신의 덱에서 몬스터 1장을 특수 소환할 수 있다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:32.324702',775,'2025-09-16 16:39:32.324702','PHHY-KR079','적식초 건널목','{\"attribute\": \"함정\", \"card_text\": \"①: \\\"적식초 건널목\\\"은 자신 필드에 1장밖에 앞면 표시로 존재할 수 없다. ②: 세트된 이 카드와 같은 세로열에 상대의 카드가 존재할 경우에 이 카드를 발동할 수 있다. 이 카드와 같은 세로열의, 이 카드 이외의 카드를 전부 주인의 패로 되돌린다. ③: 이 카드가 마법 & 함정 존에 존재하는 한, 이 카드와 같은 세로열의 사용하고 있지 않은 존은 사용할 수 없다.\"}',NULL,'COMMON'),(1,34,'2025-09-16 16:39:32.592630',776,'2025-09-16 16:39:32.592630','PHHY-KR080','위박광석－서머나이트','{\"attribute\": \"함정\", \"card_text\": \"①: 자신 묘지의 몬스터 3장을 대상으로 하고 발동할 수 있다. 자신은 그 3장 중에서 1장을 고른다. 그 후, 상대는 이하의 효과에서 1개를 고르고, 자신은 그 효과를 적용한다.●고른 몬스터를 특수 소환한다.●고른 몬스터 이외의 대상 몬스터를 가능한 한 특수 소환한다.\"}',NULL,'COMMON'),(3,59,'2025-09-16 16:53:39.633368',777,'2025-09-16 16:53:39.633368','BS8-009','버닝스파이스 쿠키','{\"field_cardDesc\": \"{sk} 파괴신의 재림<br /><br />【기동】 【턴 1회】 &lt;{R}&gt; 자신의 배틀 에리어에 다른 쿠키가 있다면 다른 모든 쿠키에게 1대미지를 준다. 그리고 &lt;{R}로 사용할 수 있다&gt; 자신의 브레이크 에리어의 LV.3마다 이 턴 중 이 쿠키의 공격 대미지를 +1한다.<br /><br />&lt;{R}{R}{N}&g