: \"잠깐 눈을 붙이려 했을 뿐인데, 어느새 깊은 꿈나라로 가버렸다...\"}','ROCK','AMAZING_RARE'),(4,61,'2025-09-28 12:44:05.627093',1457,'2025-09-28 12:44:05.627093','','어푸어푸 바캉스','{\"attribute\": \"가위\", \"character\":\"유진곰\", \"card_text\": \"내리쬐는 태양... 시원한 바람... 물놀이하기 딱 좋은 날씨잖아!\"}','SCISSORS','UNCOMMON'),(4,61,'2025-09-28 12:44:08.584564',1458,'2025-09-28 12:44:08.584564','','집중 좀 해볼까','{\"attribute\": \"보\", \"character\":\"유진곰\", \"card_text\": \"그런데... 연필이 너무 커다란 거 같지 않아?\"}','PAPER','UNCOMMON'),(4,61,'2025-09-28 12:44:11.734947',1459,'2025-09-28 12:44:11.734947','','누가 감자게?','{\"attribute\": \"보\", \"character\":\"조은곰\", \"card_text\": \"감자? 고구마? 아니. 나는 그냥 심쿵 유발자!\"}','PAPER','UNCOMMON'),(4,61,'2025-09-28 12:44:15.463573',1460,'2025-09-28 12:44:15.463573','','두근두근 발렌타인','{\"attribute\": \"보\", \"character\":\"조은곰\", \"card_text\": \"치명적인 필살기 \'두근두근 발렌타인\'을 맞는 순간, 너무 귀여워서 전의를 상실할지도 몰라.\"}','PAPER','RARE_HOLO_V'),(4,61,'2025-09-28 12:44:19.367154',1461,'2025-09-28 12:44:19.367154','','딸기 밭에서','{\"attribute\": \"가위\", \"character\":\"조은곰\", \"card_text\": \"아자, 올해 딸기 농사는 풍년이다! 한 줌, 한 줌 열심히 따다 보면 언젠가 바구니를 꽉 채우겠지~?\"}','SCISSORS','UNCOMMON'),(4,61,'2025-09-28 12:44:22.299937',1462,'2025-09-28 12:44:22.299937','','숨 참고 러브다이브','{\"attribute\": \"가위\", \"character\":\"조은곰\", \"card_text\": \"심장이 두근거리는 건, 숨을 참았기 때문이 아니라 네가 보여서야.\"}','SCISSORS','RARE_ULTRA'),(4,61,'2025-09-28 12:44:25.886645',1463,'2025-09-28 12:44:25.886645','','여기서부터 저기까지','{\"attribute\": \"가위\", \"character\":\"조은곰\", \"card_text\": \"단팥빵, 소보루, 카스테라... 따끈따끈 흰 빵 냄새에 홀려버렸어. 안되겠다. 여기서부터 저기까지 전부 주세요!\"}','SCISSORS','UNCOMMON'),(4,61,'2025-09-28 12:44:29.272283',1464,'2025-09-28 12:44:29.272283','','100% 전격 타코코','{\"attribute\": \"묵\", \"character\":\"타코코\", \"card_text\": \"착각이겠지만, 왠지 카드에서 정전기가 느껴지는 것만 같다...\"}','ROCK','UNCOMMON'),(4,61,'2025-09-28 12:44:31.959154',1465,'2025-09-28 12:44:31.959154','','뜨거운 건 싫어!','{\"attribute\": \"가위\", \"character\":\"타코코\", \"card_text\": \"땀은 식지 않고 심장은 쿵쿵. 하지만 진짜 용기는 바로 이 순간 드러난다.\"}','SCISSORS','RARE_RAINBOW'),(4,61,'2025-09-28 12:44:35.918612',1466,'2025-09-28 12:44:35.918612','','래퍼 햄타코','{\"attribute\": \"보\", \"character\":\"타코코\", \"card_text\": \"I love French fries, fried chicken, halal food, bibimbap, sushi, mulhoe, tteokbokki, pad thai, curry, tacos. it’s good! Ice cream, chocoloate... Yummy!\"}','PAPER','AMAZING_RARE'),(4,61,'2025-09-28 12:44:38.789691',1467,'2025-09-28 12:44:38.789691','','바다를 부유하는','{\"attribute\": \"보\", \"character\":\"타코코\", \"card_text\": \"우주에서 온 타코코이지만 때때로는 바다를 마치 자신의 고향처럼 느끼곤 한다. ...유전자의 힘이려나?\"}','PAPER','RARE_HOLO_VSTAR'),(4,61,'2025-09-28 12:44:41.601846',1468,'2025-09-28 12:44:41.601846','','새벽 2시,「코딩」','{\"attribute\": \"보\", \"character\":\"타코코\", \"card_text\": \"모두가 잠든 밤, 왠지 모를 자신감이 솟아난다. 뭐든지 구현할 수 있을 것만 같은 느낌.\"}','PAPER','UNCOMMON'),(4,61,'2025-09-28 12:44:44.915892',1469,'2025-09-28 12:44:44.915892','','악동 타코코','{\"attribute\": \"가위\", \"character\":\"타코코\", \"card_text\": \"으흐흐... 타락한 타코코의 악명이 전 우주에 울려퍼집니다. 조심하세요!\"}','SCISSORS','UNCOMMON'),(4,61,'2025-09-28 12:44:48.855981',1470,'2025-09-28 12:44:48.855981','','울트라 슈퍼 갤럭시','{\"attribute\": \"묵\", \"character\":\"타코코\", \"card_text\": \"작은 발걸음이 모여 큰 모험이 된다. 타코코가 당신을 응원합니다.\"}','ROCK','RARE_HOLO_VMAX'),(4,61,'2025-09-28 12:44:52.120552',1471,'2025-09-28 12:44:52.120552','','무료 교환권','{\"attribute\": \"가위\", \"character\":\"팝콩이\", \"card_text\": \"세상에서 가장 달콤한 건 공짜 간식. 입안 가득 퍼지는 값진 행복을 얻어요.\"}','SCISSORS','AMAZING_RARE'),(4,61,'2025-09-28 12:45:02.893205',1472,'2025-09-28 12:45:02.893205','','용기가 깃든 사탕','{\"attribute\": \"보\", \"character\":\"용기곰\", \"card_text\": \"또렷한 정신에 좋은 결과가 깃든다. 아무렴 그렇고 말고.\"}','PAPER','RARE_HOLO_VMAX');
